(12, 24, 1, 'TITLE', 'Lotobot - лотерея со стопроцентным призовым фондом и проверяемым результатом'),
(13, 24, 1, 'SUBTITLE', 'Анонимная лотерея Lotobot сочетает в себе преимущества уникальной и проверяемой системы розыгрыша, а также безопасность и анонимность биткоин платежей. Вот наши преимущества:'),
(14, 24, 1, 'SQUARE1', 'Доход от всех проданных билетов попадает в призовой фонд розыгрыша.'),
(15, 24, 1, 'SQUARE2', 'Призовой фонд всегда разыгрывается полностью<br><font>1 место - 50%</font><br><font>2 место - 30%</font><br><font>3 место - 20%</font>'),
