(17, 24, 1, 'SQUARE4', 'Исход розыгрыша зависит от каждого игрока и рассчитывается на основе цифр, указанных во всех билетах розыгрыша.'),
(18, 24, 1, 'SQUARE5', 'Результат всегда можно проверить. Публикуем список проданных билетов после каждого розыгрыша.'),
(19, 24, 1, 'SQUARE6', 'Комиссия сервиса всего 10%. Взимается в момент перевода выигрыша победителю.'),
(20, 24, 1, 'HOW_IT_WORKS', 'Как работает лотерея'),
(21, 24, 1, 'RULE1', 'Выбери тип лотереи: раз в неделю, раз в месяц или раз в три месяца.'),
(22, 24, 1, 'RULE2', 'Выбери 7 цифр от 0 до 99 и заполни пустые поля билета выбранными цифрами.'),
(23, 24, 1, 'RULE3', 'Заплати 0,0005 Bitcoin на указанный в билете кошелёк.'),
(24, 24, 1, 'RULE4', 'Кликни на кнопке \"Добавить билет в лотерею\".'),
(25, 24, 1, 'RULE5', 'Как только оплата пройдёт 3 подтверждения в сети Биткоин, купленный билет будет добавлен в розыгрыш, а оплаченная сумма добавится в призовой фонд.'),
(26, 24, 1, 'RULE6_1', 'По окончании периода проведения розыгрыша и продажи билетов Lotobot рассчитает md5 хеш для каждого лотерейного билета из розыгрыша и, сравнив их с md5 хешем суммы всех билетов лотереи, определит выигравшие комбинации. Подробно о том, как мы получаем md5 хеш для каждого билета, можно прочитать '),
(27, 24, 1, 'RULE6_2', 'на этой странице'),
(28, 24, 1, 'RULE7', 'Lotobot распределит призовой фонд согласно \"близости\" хеш суммы каждого отдельного билета к хеш сумме всего розыгрыша. Хеш сумма всего розыгрыша рассчитывается как md5 хеш от суммы всех билетов проданных в розыгрыше. Самое близкое получит 50% призового фонда, второе по близости 30% и третье 20%.'),
(29, 24, 1, 'RULE8', 'Lotobot перевёдёт на Bitcoin кошелёк победителя выигранную сумму.'),
