(125, 24, 5, 'RECOMMENDATION__2', 'Если считаешь, что это наша ошибка, сообщи нам, пожалуйста, воспользовавшись формой ниже. Не забудь указать неработающую ссылку или страницу.'),
(126, 24, 6, 'TITLE_HEADER', 'Как мы получаем число, которое участвует в розыгрыше лотереи'),
