(128, 24, 6, 'SUBTITLE', 'Число, которое участвует в розыгрыше, в рамках лотереи Lotobot называется оптимизированный md5 хеш'),
(129, 24, 6, 'USER_SELECT_NUMS', 'Во время покупки билета ты выбрал числа '),
(130, 24, 6, 'SELECT_DEF_NUMS', 'Допустим, во время покупки билета ты выбрал числа '),
(131, 24, 6, 'STEP_1', 'Первое, что мы делаем, это \"склеиваем\" их и получаем строку из выбранных чисел'),
(132, 24, 6, 'STEP_2', 'На втором шаге мы обрабатываем полученную на первом шаге строку с помощью алгоритма хеширования md5 и получаем последовательность символов'),
(133, 24, 6, 'ALGORITHM_1', 'Алгоритм md5 очень распространён в криптографии и часто используется для кодирования паролей. Подробнее о md5 можно прочитать в '),
(134, 24, 6, 'ALGORITHM_WIKI', 'статье на Википедии'),
(135, 24, 6, 'ALGORITHM_2', 'Ты всегда можешь поэкспериментировать с хешированием любых чисел и строк на одном из множества сервисов в интернете. Найти их можно с помощью '),
(136, 24, 6, 'ALGORITHM_GOOGLE', 'поиска Google'),
(137, 24, 0, 'MD5_WIKI_LINK', 'https://ru.wikipedia.org/wiki/MD5'),
(138, 24, 6, 'MD5_GOOGLE_LINK', 'https://www.google.ru/search?q=md5+online&oq=md5+online'),
(139, 24, 6, 'STEP_3', 'На третьем шаге мы удаляем из полученной md5 строки все символы кроме цифр и получаем большое число'),
(140, 24, 6, 'STEP_4', 'На шаге четыре мы удаляем из числа все нули в начале и в конце, если они есть. На четвертом шаге мы получаем итоговое число, именно это число и будет участвовать в розыгрыше лотереи'),
(141, 24, 6, 'INFOGRAPHICS_TITLE', 'Мы понимаем, что данный алгоритм довольно \"запутан\" и сложен, но он гарантирует отсутствие возможности фальсификации лотерейных билетов и предугадывания выигрышной комбинации.'),
(142, 24, 0, 'HAVE_QUESTS', 'Остались вопросы? Напиши нам.'),
(143, 24, 6, 'SELECTED_NUMS', 'Выбранные числа'),
(144, 24, 6, 'STEP', 'Шаг'),
(145, 24, 7, 'TITLE_HEADER', 'Правила биткоин лотереи Lotobot'),
(146, 24, 7, 'TITLE', 'Правила биткоин лотереи Lotobot'),
(147, 24, 7, 'TERMS_TITLE', 'Термины и определения'),
(148, 24, 7, 'TERMS_1', 'Лотерея Lotobot – это игра, проходящая в определённый промежуток времени, по истечении которого происходит распределение собранного выигрыша среди игроков, которые приобрели лотерейные билеты.'),
(149, 24, 7, 'TERMS_2', 'Розыгрыш лотереи – это процесс определения победителей среди участников, купивших лотерейный билет в срок проведения конкретной лотереи.'),
(150, 24, 7, 'TERMS_3', 'Лотерейный билет – это набор данных необходимых для участия в розыгрыше лотереи.'),
(151, 24, 7, 'TERMS_4', 'Оптимизированный md5 хеш - последовательность чисел полученная путем преобразования изначального числового ряда с применением алгоритма хеширования md5. Подробно прочитать, как мы получаем оптимизированный md5 хеш, можно '),
(152, 24, 0, 'ON_THIS_PAGE', 'на этой странице'),
(153, 24, 7, 'TERMS_5', 'Строка чисел лотерейного билета - это числа указанные в лотерейном билете, собранные в строку в той же последовательности, в которой они были занесены в лотерейный билет во время его покупки.'),
(154, 24, 7, 'TERMS_6', 'Оптимизированный md5 хеш розыгрыша лотереи – это последовательность чисел полученная путём оптимизации md5 хеша суммы всех строк чисел из всех лотерейных билетов конкретного розыгрыша.'),
(155, 24, 7, 'TERMS_7', 'Оптимизированный md5 хеш билета – это последовательность чисел полученная из строки чисел конкретного лотерейного билета с применением алгоритма хеширования md5. В рамках лотереи Lotobot оптимизированный md5 хеш билета называется ЧИСЛО, КОТОРОЕ УЧАСТВУЕТ В РОЗЫГРЫШЕ. Подробно прочитать, как мы получаем число, которое участвует в розыгрыше можно '),
(156, 24, 7, 'TERMS_8', 'Призовой фонд – это сумма выплачиваемая победителям розыгрыша после его завершения. Призовой фонд является суммой стоимости всех лотерейных билетов, проданных в конкретном розыгрыше.'),
(157, 24, 7, 'RULES_TITLE', 'Правила лотереи'),
(158, 24, 7, 'RULES_1', 'Каждый розыгрыш проводится ограниченное количество времени.'),
(159, 24, 7, 'RULES_2', 'В каждом розыгрыше принимает участие неограниченное число лотерейных билетов.'),
(160, 24, 7, 'RULES_3', 'Лотерейный билет является действительным и принимает участие в розыгрыше только после 3 принятых подтверждений платежа в сети Биткоин.'),
(161, 24, 7, 'RULES_4', 'Билеты, чьи 3 подтверждения платежа в сети Биткоин прошли после даты розыгрыша, являются недействительными и не принимают участия в розыгрыше.'),
(162, 24, 7, 'RULES_5', 'В каждом лотерейном билете владельцем билета указывается 7 чисел от 0 до 99, которые составляют базу для получения числа, которое участвует в розыгрыше лотереи. Полученное число и соответствующий ему проданный билет участвуют только в том розыгрыше лотереи, в котором был куплен лотерейный билет.'),
(163, 24, 7, 'RULES_6', 'Призовой фонд розыгрыша формируется из суммы Биткоин платежей уплаченных за все лотерейные билеты участвующие в конкретном розыгрыше.'),
(164, 24, 7, 'RULES_7', 'Розыгрыш лотереи и распределение призового фонда происходит в период не превышающий 24 часов после даты завершения розыгрыша.'),
(165, 24, 7, 'RULES_8', 'В процессе розыгрыша лотереи происходит формирование числа, которое участвует в розыгрыше лотереи для каждого лотерейного билета проданного в конкретной лотерее. Также в процессе розыгрыша происходит формирование оптимизированного md5 хеша розыгрыша лотереи.'),
(166, 24, 7, 'RULES_9', 'Победители розыгрыша определяются путём расчёта модуля разности между числом, которое участвует в розыгрыше лотереи для каждого лотерейного билета проданного в разыгрываемой лотерее, и оптимизированного md5 хеша розыгрыша лотереи, в которой был куплен лотерейный билет.'),
(167, 24, 7, 'RULES_10', 'В результате розыгрыша определяется первая категория победителей как наименьший модуль разности между числом, которое участвует в розыгрыше лотереи отдельного лотерейного билета проданного в разыгрываемой лотерее ,и оптимизированного md5 хеша розыгрыша лотереи, в которой был куплен лотерейный билет.'),
(168, 24, 7, 'RULES_11', 'В результате розыгрыша определяется вторая категория победителей как второй по величине модуль разности между числом, которое участвует в розыгрыше лотереи отдельного лотерейного билета проданного в разыгрываемой лотерее, и оптимизированного md5 хеша розыгрыша лотереи, в которой был куплен лотерейный билет.'),
(169, 24, 7, 'RULES_12', 'В результате розыгрыша определяется третья категория победителей как третий по величине модуль разности между числом, которое участвует в розыгрыше лотереи отдельного лотерейного билета проданного в разыгрываемой лотерее и оптимизированного md5 хеша розыгрыша лотереи, в которой был куплен лотерейный билет.'),
(170, 24, 7, 'RULES_13', 'Призовой фонд розыгрыша конкретной лотереи распределяется по трём категориям победителей в следующем соответствии:<br>- Первая категория победителей - 50% призового фонда;<br>- Вторая категория победителей - 30% призового фонда;<br>- Третья категория победителей - 20% призового фонда.'),
(171, 24, 7, 'RULES_14', 'В случае, если у двух и более участников розыгрыша лотереи модули разности между числом, которое участвует в розыгрыше лотереи отдельного лотерейного билета проданного в разыгрываемой лотерее, и оптимизированного md5 хеша розыгрыша лотереи, в которой был куплен лотерейный билет, совпадут, то выигрыш делится пропорционально между участниками с совпавшими модулями в соответствии с категорией выигрыша.'),
(172, 24, 0, 'RESULTS_LINK', 'Результаты розыгрышей и победители'),
(173, 24, 7, 'RULES_15_1', 'Результаты конкретного розыгрыша лотереи публикуются на сайте лотереи Lotobot.io на странице '),
(174, 24, 7, 'RULES_15_2', ' и отображаются после указания номера лотереи, в которой был приобретён лотерейный билет.'),
(175, 24, 0, 'REQUEST_PROFIT_LINK', 'Запрос на вывод выигрыша'),
(176, 24, 7, 'RULES_16_1', 'Выплата призового вознаграждения участнику лотереи, имеющего право на получение выигрыша какой-либо категории, осуществляется исключительно только после запроса, отправленного со страницы '),
(177, 24, 7, 'RULES_16_2', ' и только на биткоин кошелёк, указанный в форме запроса при её заполнении. Выплата производится не позднее, чем в период 24 часов с момента получения запроса на выплату выигрыша.'),
(178, 24, 7, 'RULES_17', 'Комиссия за вывод выигрыша на биткоин кошелёк владельца лотерейного билета имеющего право на получение выигрыша составляет 10%.'),
