(208, 24, 9, 'TITLE', 'Зарабатывай вместе с нами'),
(209, 24, 9, 'SUBTITLE', 'Присоединяйся к партнерской программе биткоин лотереи Lotobot и зарабатывай 50% от прибыли с каждого привлеченного участника лотереи'),
(210, 24, 9, 'DESCRIPTION', 'Lotobot - это интернет лотерея со 100% призовым фондом, а это значит, что все средства, уплаченные игроками лотереи, будут направлены в призовой фонд. Мы зарабатываем на обеспечении процесса розыгрыша. Комиссия нашего сервиса составляет 10% на вывод выигрыша на биткоин кошелёк победителя определенного розыгрыша лотереи. Как и у большинства успешных интернет ресурсов, у нас есть программа лояльности для партнеров, помогающих развивать наш сервис. <span class=\\\"red_text\\\"> Мы выплачиваем вознаграждение за каждого игрока, купившего лотерейный билет, независимо от того выиграл, привлеченный партнером, игрок или нет.</span> Благодаря нашей партнерской программе каждый может получать доход от интернет лотереи Lotobot.'),
(211, 24, 9, 'RULES_TITLE', 'Наши правила очень просты'),
(212, 24, 9, 'RULE_1', 'Мы выплачиваем 50% дохода полученного от игрока, что составляет 5% от стоимости купленных им билетов. Стоимость лотерейного билета 50000 Satoshi, наша комиссия 10% или 5000 Satoshi, и половину этой суммы мы выплачиваем партнеру, привлекшему игрока. То есть твой доход с каждого привлеченного и оплатившего свой билет участника лотереи составит 2500 Satoshi.'),
(213, 24, 9, 'RULE_2', 'У нас нет ограничений на сумму выплаты, таким образом ты можешь вывести доход, полученный даже с одного привлечённого участника лотереи.'),
(214, 24, 9, 'RULE_3', 'Начисление дохода происходит сразу после завершения розыгрыша, в котором был куплен билет привлеченным тобой игроком.'),
(215, 24, 9, 'RULE_4', 'Выплата полученного реферального дохода осуществляется на биткоин кошелек, указанный при запросе на вывод средств.'),
(216, 24, 9, 'RULE_5', 'Максимальный срок выплаты составляет 24 часа после получения запроса на вывод дохода.'),
(217, 24, 9, 'CHECK_TITLE', 'Нас легко проверить'),
(218, 24, 9, 'CHECK_DESCRIPTION', 'Чтобы быть уверенным, что каждый игрок, пришедший по полученной реферальной ссылке, попадет в список привлеченных тобой, просто купи один из лотерейных билетов через свою реферальную ссылку и ты сразу увидишь лотерейный билет в списке привлеченных.'),
(219, 24, 9, 'BECOME_PARTNER_TITLE', 'Стать нашим партнером просто'),
(220, 24, 9, 'BECOME_PARTNER_DESCRIPTION', 'Чтобы стать участником нашей партнерской программы, все, что тебе нужно, это получить реферальную ссылку. Укажи свой емэйл для входа на сервис, записав его в соответствующее поле формы ниже и кликни \"Стать партнером\". После этого ты получишь уникальный пароль и реферальную ссылку. Всё, что тебе останется, это делиться полученной ссылкой на форумах, в чатах, в социальных сетях и получать доход с каждого привлечённого участника лотереи. Ты сможешь вывести свой реферальный доход сразу после прохождения розыгрыша в котором привлечённый тобой реферал купил билет.'),
