(292, 24, 11, 'PAGE_DESCRIPTION', 'Страница для партнёров биткоин лотереи Lotobot. Здесь ты сможешь посмотреть привлеченных тобой игроков, узнать сумму дохода с привлечённых рефералов или запросить выплату вознаграждений.'),
(293, 24, 11, 'PAGE_KEYWORDS', 'посмотреть рефералов лотобот, посмотреть привлечённых игроков лотобот, запрос прибыли с рефералов лотобот, вывод прибили, вывод прибыли лотобот'),
(294, 24, 9, 'PAGE_DESCRIPTION', 'Реферальная программа биткоин лотереи Lotobot это удобный способ получать прибыль для вебмастеров и блогеров. Как стать партнером и зарабатывать с привлечённых игроков.'),
(295, 24, 9, 'PAGE_KEYWORDS', 'реферальная программа лотобот, заработать с лотобот, реферальная программа, как заработать на лотереи, заработать с продажи лотерейных билетов, лотобот партнёр'),
