(549, 2, 6, 'PAGE_DESCRIPTION', 'How do we get the number that participates in the Lotobot lottery. MD5 hashing is used to convert ticket numbers and the final number for the draw.'),
(550, 2, 6, 'PAGE_KEYWORDS', 'number for the drawing, number for the drawing of the lottery lottery lottery, number for the drawing of the lottery Lotobot, conversion of numbers of the ticket lotobot'),
(551, 2, 7, 'TITLE_HEADER', 'Rules of the Bitcoin lottery Lotobot'),
(552, 2, 7, 'TITLE', 'Rules of the Bitcoin lottery Lotobot'),
(553, 2, 7, 'TERMS_TITLE', 'Terms and Definitions'),
(554, 2, 7, 'TERMS_1', 'Lotobot Lottery is a game that takes place in a certain period of time, after which the collected winnings are distributed among the players who purchased lottery tickets.'),
(555, 2, 7, 'TERMS_2', 'Lottery drawing is a process of determining winners among participants who bought a lottery ticket on time for a specific lottery.'),
(556, 2, 7, 'TERMS_3', 'A lottery ticket is a set of data necessary to participate in a lottery.'),
(557, 2, 7, 'TERMS_4', 'Optimized md5 hash is a sequence of numbers obtained by converting the original number series using the md5 hash algorithm. You can read in detail how we get the optimized md5 hash '),
(558, 2, 7, 'TERMS_5', 'The lottery ticket number line is the numbers indicated in the lottery ticket, collected in a line in the same sequence in which they were entered in the lottery ticket at the time of purchase.'),
(559, 2, 7, 'TERMS_6', 'An optimized md5 hash of a lottery draw is a sequence of numbers obtained by optimizing the md5 hash of the sum of all strings of numbers from all lottery tickets of a particular draw.'),
(560, 2, 7, 'TERMS_7', 'An optimized md5 ticket hash is a sequence of numbers obtained from a string of numbers of a specific lottery ticket using the md5 hash algorithm. Within the Lotobot lottery, the optimized md5 ticket hash is called the NUMBER THAT PARTICIPATES IN THE WINNING. You can read in detail how we get the number that participates in the drawing. '),
(561, 2, 7, 'TERMS_8', 'Prize fund is the amount paid to the winners of the drawing after its completion. The prize pool is the sum of the cost of all lottery tickets sold in a particular lottery.'),
(562, 2, 7, 'RULES_TITLE', 'Lottery Rules'),
(563, 2, 7, 'RULES_1', 'Each draw has a limited amount of time.'),
(564, 2, 7, 'RULES_2', 'Each lottery draws an unlimited number of lottery tickets.'),
(565, 2, 7, 'RULES_3', 'The lottery ticket is valid and takes part in the drawing only after 3 accepted confirmations of payment in the Bitcoin network.'),
(566, 2, 7, 'RULES_4', 'Tickets whose 3 confirmations of payment on the Bitcoin network have passed after the date of the draw are invalid and do not participate in the draw.'),
(567, 2, 7, 'RULES_5', 'In each lottery ticket, the ticket owner indicates 7 numbers from 0 to 99, which form the basis for receiving the number that is involved in the lottery. The received number and the sold ticket corresponding to it participate only in the lottery draw in which the lottery ticket was purchased.'),
(568, 2, 7, 'RULES_6', 'The prize fund of the lottery is formed from the amount of Bitcoin payments paid for all lottery tickets participating in a particular lottery.'),
(569, 2, 7, 'RULES_7', 'Lottery drawing and distribution of the prize fund takes place in a period not exceeding 24 hours after the date of completion of the drawing.'),
(570, 2, 7, 'RULES_8', 'In the process of drawing a lottery, a number is formed that participates in the drawing of a lottery for each lottery ticket sold in a particular lottery. Also during the drawing process, an optimized md5 lottery drawing hash is formed.'),
(571, 2, 7, 'RULES_9', 'The winners of the lottery are determined by calculating the module of the difference between the number that participates in the lottery for each lottery ticket sold in the lottery being played, and the optimized md5 hash of the lottery ticket in which the lottery ticket was bought.'),
(572, 2, 7, 'RULES_10', 'As a result of the drawing, the first category of winners is determined as the smallest module of the difference between the number that participates in the lottery drawing of a separate lottery ticket sold in the lottery being played, and the optimized md5 hash of the lottery drawing in which the lottery ticket was bought.'),
(573, 2, 7, 'RULES_11', 'As a result of the draw, the second category of winners is determined as the second largest module of the difference between the number that participates in the lottery draw of a separate lottery ticket sold in the lottery being played, and the optimized md5 hash of the lottery draw in which the lottery ticket was purchased.'),
(574, 2, 7, 'RULES_12', 'As a result of the draw, the third category of winners is determined as the third largest module of the difference between the number that participates in the lottery draw of a separate lottery ticket sold in the lottery being played and the optimized md5 hash of the lottery draw in which the lottery ticket was purchased.'),
(575, 2, 7, 'RULES_13', 'The prize fund for drawing a specific lottery is divided into three categories of winners in the following accordance:<br> - The first category of winners - 50% of the prize pool;<br>- The second category of winners - 30% of the prize pool;<br>- The third category of winners is 20% of the prize pool.'),
(576, 2, 7, 'RULES_14', 'If two or more participants of the lottery draw, the difference between the number that participates in the lottery draw of an individual lottery ticket sold in the lottery being played and the optimized md5 hash of the lottery draw in which the lottery ticket was purchased coincide, the win is divided proportionally between participants with matching modules in accordance with the category of winnings.'),
(577, 2, 7, 'RULES_15_1', 'The results of a specific lottery drawing are published on the website of the lottery Lotobot.io on the page '),
(578, 2, 7, 'RULES_15_2', ' and are displayed after indicating the lottery number in which the lottery ticket was purchased.'),
(579, 2, 7, 'RULES_16_1', 'The payment of the prize to a lottery participant who is entitled to receive a prize of any category is carried out exclusively after a request sent from the page '),
(580, 2, 7, 'RULES_16_2', ' and only to the bitcoin wallet indicated in the request form when filling it out. Payment is made no later than within 24 hours from the date of receipt of the request for payment of winnings.'),
(581, 2, 7, 'RULES_17', 'The commission for withdrawing winnings to the bitcoin wallet of the owner of a lottery ticket entitled to receive a win is 10%.'),
(582, 2, 7, 'PAGE_DESCRIPTION', 'Lotobot Bitcoin rules, terms and definitions. Read to learn how to play and win the bitcoin lottery.'),
