(910, 3, 9, 'DESCRIPTION', 'Lotobot est une loterie en ligne avec un prize pool de 100%, ce qui signifie que tous les fonds payés par les joueurs de loterie seront envoyés au prize pool. Nous gagnons de l&#39;argent en assurant le processus de dessin. La commission de notre service est de 10% sur le retrait des gains vers le portefeuille Bitcoin du gagnant d&#39;un certain tirage de loterie. Comme la plupart des ressources Internet à succès, nous avons un programme de fidélisation pour les partenaires qui aident à développer notre service. <span class=\"red_text\">Nous payons une récompense pour chaque joueur qui achète un billet de loterie, qu&#39;il gagne ou non un joueur ou un partenaire.</span> Grâce à notre programme d&#39;affiliation, tout le monde peut recevoir des revenus de la loterie en ligne Lotobot.'),
(911, 3, 9, 'RULES_TITLE', 'Nos règles sont très simples.'),
(912, 3, 9, 'RULE_1', 'Nous payons 50% des revenus reçus du joueur, soit 5% du coût des billets achetés par lui. Le coût du billet de loterie est de 50 000 Satoshi, notre commission est de 10% ou 5 000 Satoshi, et nous payons la moitié de ce montant au partenaire qui a attiré le joueur. Autrement dit, votre revenu de chaque participant à la loterie attiré et payé sera de 2500 Satoshi.'),
