(1180, 4, 7, 'TERMS_1', 'Lotobot Lottery ist ein Spiel, das in einem bestimmten Zeitraum stattfindet. Danach werden die gesammelten Gewinne an die Spieler verteilt, die Lottoscheine gekauft haben.'),
(1181, 4, 7, 'TERMS_2', 'Beim Lottoziehen werden die Gewinner unter den Teilnehmern ermittelt, die rechtzeitig für eine bestimmte Lotterie einen Lottoschein gekauft haben.'),
(1182, 4, 7, 'TERMS_3', 'Ein Lottoschein ist ein Datensatz, der für die Teilnahme an einer Lotterie erforderlich ist.'),
(1183, 4, 7, 'TERMS_4', 'Der optimierte md5-Hash ist eine Folge von Zahlen, die durch Konvertieren der ursprünglichen Zahlenreihe mit dem md5-Hash-Algorithmus erhalten werden. Sie können im Detail lesen, wie wir den optimierten MD5-Hash bekommen. '),
(1184, 4, 7, 'TERMS_5', 'Die Lottoscheinnummer ist die Nummer, die auf dem Lottoschein angegeben ist. Sie wird in derselben Reihenfolge in einer Zeile gesammelt, in der sie zum Zeitpunkt des Kaufs im Lottoschein eingegeben wurden.'),
(1185, 4, 7, 'TERMS_6', 'Ein optimierter md5-Hash einer Lotterieziehung ist eine Folge von Zahlen, die durch Optimieren des md5-Hashs der Summe aller Zahlenfolgen aus allen Lotterielosen einer bestimmten Ziehung erhalten wird.'),
(1186, 4, 7, 'TERMS_7', 'Ein optimierter MD5-Ticket-Hash ist eine Folge von Zahlen, die mit dem MD5-Hash-Algorithmus aus einer Folge von Zahlen eines bestimmten Lottoscheins ermittelt werden. In der Lotobot-Lotterie heißt der optimierte md5-Ticket-Hash die ANZAHL, DIE AM GEWINN TEILNEHMT. Sie können im Detail nachlesen, wie wir die Nummer erhalten, die an der Zeichnung teilnimmt '),
(1187, 4, 7, 'TERMS_8', 'Der Preisfonds ist der Betrag, der den Gewinnern der Verlosung nach deren Abschluss ausgezahlt wird. Der Preispool ist die Summe der Kosten aller in einer bestimmten Lotterie verkauften Lottoscheine.'),
(1188, 4, 7, 'RULES_TITLE', 'Lotterieregeln'),
(1189, 4, 7, 'RULES_1', 'Jede Ziehung ist zeitlich begrenzt.'),
(1190, 4, 7, 'RULES_2', 'Jede Lotterie zieht eine unbegrenzte Anzahl von Lotterielosen.'),
(1191, 4, 7, 'RULES_3', 'Der Lottoschein ist gültig und nimmt erst nach 3 akzeptierten Zahlungsbestätigungen im Bitcoin-Netzwerk an der Verlosung teil.'),
(1192, 4, 7, 'RULES_4', 'Tickets, deren 3 Zahlungsbestätigungen im Bitcoin-Netzwerk nach dem Ziehungsdatum verstrichen sind, sind ungültig und nehmen nicht an der Ziehung teil.'),
(1193, 4, 7, 'RULES_5', 'In jedem Lottoschein gibt der Karteninhaber 7 Zahlen von 0 bis 99 an, die die Grundlage für den Erhalt der an der Lotterie beteiligten Nummer bilden. Die erhaltene Nummer und das dazugehörige verkaufte Los nehmen nur an der Verlosung teil, bei der das Los gekauft wurde.'),
(1194, 4, 7, 'RULES_6', 'Der Preisfonds der Lotterie wird aus dem Betrag der Bitcoin-Zahlungen gebildet, die für alle an einer bestimmten Lotterie teilnehmenden Lottoscheine gezahlt werden.'),
(1195, 4, 7, 'RULES_7', 'Die Verlosung und Verteilung des Preisgeldes erfolgt innerhalb eines Zeitraums von höchstens 24 Stunden nach Beendigung der Verlosung.'),
(1196, 4, 7, 'RULES_8', 'Bei der Auslosung einer Lotterie wird eine Zahl gebildet, die an der Auslosung einer Lotterie für jeden in einer bestimmten Lotterie verkauften Lottoschein teilnimmt. Während des Ziehungsprozesses wird auch ein optimierter MD5-Lotterie-Ziehungs-Hash gebildet.'),
(1197, 4, 7, 'RULES_9', 'Die Gewinner der Lotterie werden ermittelt, indem das Differenzmodul zwischen der Anzahl der Lotterieteilnehmer für jeden in der Lotterie verkauften Lottoschein und dem optimierten md5-Hash des Lottoscheins, in dem der Lottoschein gekauft wurde, berechnet wird.'),
(1198, 4, 7, 'RULES_10', 'Als Ergebnis der Ziehung wird die erste Kategorie von Gewinnern als das kleinste Modul der Differenz zwischen der Anzahl, die an der Ziehung eines separaten Lottoscheins teilnimmt, der in der Lotterie verkauft wird, und dem optimierten md5-Hash des Lottoscheins, in dem der Lottoschein gekauft wurde, bestimmt.'),
(1199, 4, 7, 'RULES_11', 'Als Ergebnis der Ziehung wird die zweite Kategorie von Gewinnern als das zweitgrößte Modul der Differenz zwischen der Anzahl, die an der Ziehung eines separaten Lottoscheins teilnimmt, der in der Lotterie verkauft wird, und dem optimierten MD5-Hash des Lottoscheins, in dem der Lottoschein gekauft wurde, bestimmt.'),
(1200, 4, 7, 'RULES_12', 'Als Ergebnis der Ziehung wird die dritte Kategorie von Gewinnern als drittgrößtes Modul der Differenz zwischen der Anzahl, die an der Ziehung eines separaten Lottoscheins teilnimmt, der in der Lotterie verkauft wird, und dem optimierten md5-Hash der Lotterie, in der der Lottoschein gekauft wurde, bestimmt.'),
(1201, 4, 7, 'RULES_13', 'Der Preisfonds für das Ziehen einer bestimmten Lotterie ist in drei Kategorien von Gewinnern unterteilt:<br>- Die erste Kategorie der Gewinner - 50% des Preispools;<br>- Die zweite Kategorie der Gewinner - 30% des Preispools;<br>- Die dritte Kategorie von Gewinnern macht 20% des Preispools aus.'),
(1202, 4, 7, 'RULES_14', 'Stimmen zwei oder mehr Lottoteilnehmer überein, wird die Differenz zwischen der Anzahl der Lottoteilnehmer eines in der Lotterie verkauften Lottoscheins und dem optimierten md5-Hash des Lottospiels, bei dem der Lottoschein gekauft wurde, proportional geteilt Teilnehmer mit passenden Modulen entsprechend der Gewinnkategorie.'),
