(1491, 5, 7, 'TITLE', 'Bitcoin governa la lotteria Lotobot'),
(1492, 5, 7, 'TERMS_TITLE', 'Termini e definizioni'),
(1493, 5, 7, 'TERMS_1', 'Lotobot Lottery è un gioco che si svolge in un determinato periodo di tempo, dopo di che le vincite raccolte vengono distribuite tra i giocatori che hanno acquistato i biglietti della lotteria.'),
(1494, 5, 7, 'TERMS_2', 'Il sorteggio è un processo per determinare i vincitori tra i partecipanti che hanno acquistato un biglietto della lotteria in tempo per una lotteria specifica.'),
(1495, 5, 7, 'TERMS_3', 'Un biglietto della lotteria è un insieme di dati necessari per partecipare a una lotteria.'),
(1496, 5, 7, 'TERMS_4', 'L&#39;hash md5 ottimizzato è una sequenza di numeri ottenuta convertendo le serie di numeri originali utilizzando l&#39;algoritmo hash md5. Puoi leggere in dettaglio come otteniamo l&#39;hash md5 ottimizzato. '),
(1497, 5, 7, 'TERMS_5', 'La riga del numero del biglietto della lotteria è i numeri indicati nel biglietto della lotteria, raccolti in una riga nella stessa sequenza in cui sono stati inseriti nel biglietto della lotteria al momento dell&#39;acquisto.'),
(1498, 5, 7, 'TERMS_6', 'Un hash md5 ottimizzato di un&#39;estrazione della lotteria è una sequenza di numeri ottenuta ottimizzando l&#39;hash md5 della somma di tutte le stringhe di numeri da tutti i biglietti della lotteria di una particolare estrazione.'),
(1499, 5, 7, 'TERMS_7', 'Un hash ticket md5 ottimizzato è una sequenza di numeri ottenuta da una stringa di numeri di un ticket lotteria specifico utilizzando l&#39;algoritmo hash md5. All&#39;interno della lotteria Lotobot, l&#39;hash del biglietto md5 ottimizzato è chiamato NUMERO CHE PARTECIPA ALLA VINCITA. Puoi leggere in dettaglio come otteniamo il numero che partecipa al disegno. '),
(1500, 5, 7, 'TERMS_8', 'Il montepremi è l&#39;importo pagato ai vincitori del sorteggio dopo il suo completamento. Il montepremi è la somma del costo di tutti i biglietti della lotteria venduti in una particolare lotteria.'),
(1501, 5, 7, 'RULES_TITLE', 'Regole della lotteria'),
(1502, 5, 7, 'RULES_1', 'Ogni sorteggio ha un periodo di tempo limitato.'),
(1503, 5, 7, 'RULES_2', 'Ogni lotteria disegna un numero illimitato di biglietti della lotteria.'),
(1504, 5, 7, 'RULES_3', 'Il biglietto della lotteria è valido e partecipa all&#39;estrazione solo dopo 3 conferme di pagamento accettate nella rete Bitcoin.'),
(1505, 5, 7, 'RULES_4', 'I biglietti le cui 3 conferme di pagamento sulla rete Bitcoin sono passate dopo la data dell&#39;estrazione non sono validi e non partecipano all&#39;estrazione.'),
(1506, 5, 7, 'RULES_5', 'In ogni biglietto della lotteria, il proprietario del biglietto indica 7 numeri da 0 a 99, che costituiscono la base per ricevere il numero coinvolto nella lotteria. Il numero ricevuto e il biglietto venduto corrispondente ad esso partecipano solo all&#39;estrazione della lotteria in cui è stato acquistato il biglietto della lotteria.'),
(1507, 5, 7, 'RULES_6', 'Il montepremi della lotteria è formato dalla quantità di pagamenti Bitcoin pagati per tutti i biglietti della lotteria che partecipano a una particolare lotteria.'),
(1508, 5, 7, 'RULES_7', 'Il sorteggio e la distribuzione del montepremi si svolgono in un periodo non superiore a 24 ore dopo la data di completamento del sorteggio.'),
(1509, 5, 7, 'RULES_8', 'Nel processo della lotteria è la cui formazione è coinvolto nella lotteria per ogni biglietto lotteria venduto a un particolare lotteria. Anche durante il processo di disegno, si forma un hash di disegno della lotteria md5 ottimizzato.'),
(1510, 5, 7, 'RULES_9', 'I vincitori della lotteria vengono determinati calcolando il modulo della differenza tra il numero che partecipa alla lotteria per ciascun biglietto della lotteria venduto nella lotteria in corso di gioco e l&#39;hash md5 ottimizzato del biglietto della lotteria in cui è stato acquistato il biglietto della lotteria.'),
(1511, 5, 7, 'RULES_10', 'Come risultato del sorteggio, la prima categoria di vincitori è determinata come il più piccolo modulo della differenza tra il numero che partecipa all&#39;estrazione della lotteria di un biglietto della lotteria separato venduto nella lotteria in corso di gioco e l&#39;hash md5 ottimizzato dell&#39;estrazione della lotteria in cui è stato acquistato il biglietto della lotteria.'),
(1512, 5, 7, 'RULES_11', 'Come risultato del sorteggio, la seconda categoria di vincitori è determinata come il secondo modulo più grande della differenza tra il numero che partecipa all&#39;estrazione della lotteria di un biglietto della lotteria separato venduto nella lotteria in corso e l&#39;hash md5 ottimizzato dell&#39;estrazione della lotteria in cui è stato acquistato il biglietto della lotteria.'),
(1513, 5, 7, 'RULES_12', 'Come risultato dell&#39;estrazione, la terza categoria di vincitori è determinata come il terzo modulo più grande della differenza tra il numero che partecipa all&#39;estrazione della lotteria di un biglietto della lotteria separato venduto nella lotteria in corso e l&#39;hash md5 ottimizzato dell&#39;estrazione della lotteria in cui è stato acquistato il biglietto della lotteria.'),
(1514, 5, 7, 'RULES_13', 'Il montepremi per l&#39;estrazione di una lotteria specifica è diviso in tre categorie di vincitori nel seguente accordo:<br> - La prima categoria di vincitori - 50% del montepremi;<br>- La seconda categoria di vincitori - 30% del montepremi;<br>- La terza categoria di vincitori è il 20% del montepremi.'),
(1515, 5, 7, 'RULES_14', 'Se due o più partecipanti all&#39;estrazione della lotteria, la differenza tra il numero che partecipa all&#39;estrazione della lotteria di un singolo biglietto della lotteria venduto nella lotteria in corso di gioco e l&#39;hash ottimizzato md5 dell&#39;estrazione della lotteria in cui è stato acquistato il biglietto della lotteria coincidono, la vincita viene divisa proporzionalmente tra partecipanti con moduli corrispondenti secondo la categoria di vincite.'),
(1516, 5, 7, 'RULES_15_1', 'I risultati di uno specifico disegno della lotteria sono pubblicati sul sito web della lotteria Lotobot.io nella pagina '),
(1517, 5, 7, 'RULES_15_2', ' e vengono visualizzati dopo aver indicato il numero della lotteria in cui è stato acquistato il biglietto della lotteria.'),
(1518, 5, 7, 'RULES_16_1', 'Il pagamento del premio a un partecipante alla lotteria che ha diritto a ricevere un premio di qualsiasi categoria viene effettuato esclusivamente dopo una richiesta inviata dalla pagina '),
(1519, 5, 7, 'RULES_16_2', ' e solo al portafoglio bitcoin indicato nel modulo di richiesta durante la compilazione. Il pagamento viene effettuato entro e non oltre 24 ore dalla data di ricezione della richiesta di pagamento delle vincite.'),
(1520, 5, 7, 'RULES_17', 'La commissione per il prelievo delle vincite sul portafoglio bitcoin del proprietario di un biglietto della lotteria che ha diritto a ricevere una vincita è del 10%.'),
