(1534, 5, 9, 'TITLE', 'Guadagna con noi'),
(1535, 5, 9, 'SUBTITLE', 'Unisciti al programma di affiliazione bitcoin della lotteria Lotobot e guadagna il 50% del profitto da ogni partecipante alla lotteria attratto'),
(1536, 5, 9, 'DESCRIPTION', 'Lotobot è una lotteria online con un montepremi del 100%, il che significa che tutti i fondi pagati dai giocatori della lotteria verranno inviati al montepremi. Guadagniamo fornendo un processo di disegno. La commissione del nostro servizio è del 10% sul prelievo delle vincite sul portafoglio bitcoin del vincitore di una determinata estrazione della lotteria. Come la maggior parte delle risorse Internet di successo, abbiamo un programma di fidelizzazione per i partner che aiutano a sviluppare il nostro servizio. <span class=\"red_text\">Paghiamo i premi per ogni giocatore che acquista un biglietto della lotteria, indipendentemente dal fatto che il giocatore abbia vinto o vinto da un partner o meno.</span> Grazie al nostro programma di partnership, tutti possono ricevere entrate dalla lotteria online Lotobot.'),
(1537, 5, 9, 'RULES_TITLE', 'Le nostre regole sono molto semplici.'),
(1538, 5, 9, 'RULE_1', 'Paghiamo il 50% delle entrate ricevute dal giocatore, che è il 5% del costo dei biglietti acquistati da lui. Il costo del biglietto della lotteria è di 50.000 Satoshi, la nostra commissione è del 10% o 5.000 Satoshi e paghiamo metà di questo importo al partner che ha attratto il giocatore. Cioè, il tuo reddito da ogni partecipante alla lotteria del biglietto attirato e pagato sarà 2500 Satoshi.'),
(1539, 5, 9, 'RULE_2', 'Non abbiamo restrizioni sull&#39;importo del pagamento, quindi puoi prelevare le entrate ricevute anche da un partecipante alla lotteria coinvolto.'),
(1540, 5, 9, 'RULE_3', 'L&#39;accantonamento delle entrate avviene immediatamente dopo la fine dell&#39;estrazione, in cui il biglietto è stato acquistato dal giocatore coinvolto.'),
(1541, 5, 9, 'RULE_4', 'Il pagamento delle entrate di riferimento ricevute viene effettuato sul portafoglio Bitcoin indicato quando si richiede un prelievo di fondi.'),
(1542, 5, 9, 'RULE_5', 'Il periodo di pagamento massimo è di 24 ore dopo aver ricevuto una richiesta di prelievo di reddito.'),
(1543, 5, 9, 'CHECK_TITLE', 'È facile verificarci'),
(1544, 5, 9, 'CHECK_DESCRIPTION', 'Per essere sicuro che ogni giocatore che fa clic sul link di referral sia incluso nell&#39;elenco delle persone attratte, basta acquistare uno dei biglietti della lotteria tramite il link di referral e vedrai immediatamente il biglietto della lotteria nell&#39;elenco di quelli attratti.'),
(1545, 5, 9, 'BECOME_PARTNER_TITLE', 'Diventare nostro partner è facile'),
(1546, 5, 9, 'BECOME_PARTNER_DESCRIPTION', 'Per diventare un membro del nostro programma di affiliazione, tutto ciò che serve è ottenere un link di riferimento. Indica il tuo indirizzo e-mail per accedere al servizio, scrivendolo nell&#39;apposito campo del modulo sottostante e fai clic su \"Diventa un partner\". Successivamente, riceverai una password univoca e un link di riferimento. Tutto ciò che resta per te è condividere il link ricevuto sui forum, nelle chat room, sui social network e ricevere entrate da ogni partecipante alla lotteria attratto. Sarai in grado di ritirare il tuo reddito di referral immediatamente dopo aver superato la lotteria in cui il referral che hai attratto ha acquistato un biglietto.'),
