(1798, 6, 6, 'INFOGRAPHICS_TITLE', 'Entendemos que este algoritmo es bastante confuso y complicado, pero garantiza la ausencia de la posibilidad de falsificación de boletos de lotería y predecir una combinación ganadora.'),
