(1800, 6, 6, 'STEP', 'Paso'),
(1801, 6, 6, 'PAGE_DESCRIPTION', 'Cómo obtenemos el número que participa en la lotería Lotobot? El hash MD5 se utiliza para convertir números de tickets y el número final para el sorteo.'),
(1802, 6, 6, 'PAGE_KEYWORDS', 'número para sorteo, número para sorteo de lotería de lotobot, conversión de números de boleto de lotobot'),
(1803, 6, 7, 'TITLE_HEADER', 'Reglas de lotería de Bitcoin Lotobot'),
(1804, 6, 7, 'TITLE', 'Reglas de lotería de Bitcoin Lotobot'),
(1805, 6, 7, 'TERMS_TITLE', 'Términos y definiciones'),
(1806, 6, 7, 'TERMS_1', 'Lotobot Lottery es un juego que tiene lugar en un cierto período de tiempo, después del cual hay una distribución de las ganancias recaudadas entre los jugadores que compraron boletos de lotería.'),
(1807, 6, 7, 'TERMS_2', 'El sorteo de lotería es un proceso para determinar los ganadores entre los participantes que compraron un boleto de lotería a tiempo para una lotería específica.'),
(1808, 6, 7, 'TERMS_3', 'Un boleto de lotería es un conjunto de datos necesarios para participar en una lotería.'),
(1809, 6, 7, 'TERMS_4', 'El hash md5 optimizado es una secuencia de números obtenidos al convertir la serie numérica original utilizando el algoritmo hash md5. Puede leer en detalle cómo obtenemos el hash md5 optimizado. '),
(1810, 6, 7, 'TERMS_5', 'La línea del número del boleto de lotería son los números indicados en el boleto de lotería, recopilados en una línea en la misma secuencia en que fueron ingresados en el boleto de lotería al momento de la compra.'),
(1811, 6, 7, 'TERMS_6', 'Un hash md5 optimizado de un sorteo de lotería es una secuencia de números obtenidos al optimizar el hash md5 de la suma de todas las cadenas de números de todos los boletos de lotería de un sorteo particular.'),
(1812, 6, 7, 'TERMS_7', 'Un hash de boleto md5 optimizado es una secuencia de números obtenidos de una serie de números de un boleto de lotería específico utilizando el algoritmo de hash md5. Dentro de la lotería Lotobot, el hash de boleto md5 optimizado se llama el NÚMERO QUE PARTICIPA EN EL GANADOR. Puede leer en detalle cómo obtenemos el número que participa en el sorteo. '),
(1813, 6, 7, 'TERMS_8', 'El fondo del premio es el monto pagado a los ganadores del sorteo después de su finalización. El premio total es la suma del costo de todos los boletos de lotería vendidos en una lotería en particular.'),
(1814, 6, 7, 'RULES_TITLE', 'Reglas de lotería'),
(1815, 6, 7, 'RULES_1', 'Cada sorteo tiene una cantidad de tiempo limitada.'),
(1816, 6, 7, 'RULES_2', 'Cada lotería saca un número ilimitado de boletos de lotería.'),
(1817, 6, 7, 'RULES_3', 'El boleto de lotería es válido y participa en el sorteo solo después de 3 confirmaciones de pago aceptadas en la red de Bitcoin.'),
(1818, 6, 7, 'RULES_4', 'Los boletos cuyas 3 confirmaciones de pago en la red de Bitcoin hayan pasado después de la fecha del sorteo no son válidos y no participan en el sorteo.'),
(1819, 6, 7, 'RULES_5', 'En cada boleto de lotería, el propietario del boleto indica 7 números del 0 al 99, que forman la base para recibir el número que participa en la lotería. El número recibido y el boleto vendido correspondiente corresponden solo al sorteo de lotería en el que se compró el boleto de lotería.'),
(1820, 6, 7, 'RULES_6', 'El fondo de premios del sorteo se forma a partir de la cantidad de pagos de Bitcoin pagados por todos los boletos de lotería que participan en un sorteo particular.'),
(1821, 6, 7, 'RULES_7', 'El sorteo de lotería y la distribución del fondo del premio se realizan en un período que no exceda las 24 horas posteriores a la fecha de finalización del sorteo.'),
(1822, 6, 7, 'RULES_8', 'En el proceso de sorteo, se forma un número que participa en el sorteo de cada boleto de lotería vendido en una lotería en particular. También durante el proceso de dibujo, se forma un hash md5 optimizado del sorteo de lotería.'),
(1823, 6, 7, 'RULES_9', 'Los ganadores de la lotería se determinan calculando el módulo de la diferencia entre el número que participa en la lotería para cada boleto de lotería vendido en la lotería que se está jugando y el hash md5 optimizado del boleto de lotería en el que se compró el boleto de lotería.'),
(1824, 6, 7, 'RULES_10', 'Como resultado del sorteo, la primera categoría de ganadores se determina como el módulo más pequeño de la diferencia entre el número que participa en el sorteo de un boleto de lotería separado vendido en la lotería que se está jugando y el hash md5 optimizado del sorteo de lotería en el que se compró el boleto de lotería.'),
(1825, 6, 7, 'RULES_11', 'Como resultado del sorteo, la segunda categoría de ganadores se determina como el segundo módulo más grande de la diferencia entre el número que participa en el sorteo de un boleto de lotería separado vendido en la lotería que se está jugando y el hash md5 optimizado del sorteo de lotería en el que se compró el boleto de lotería.'),
(1826, 6, 7, 'RULES_12', 'Como resultado del sorteo, la tercera categoría de ganadores se determina como el tercer módulo más grande de la diferencia entre el número que participa en el sorteo de un boleto de lotería vendido en la lotería que se está jugando y el hash md5 optimizado del sorteo de lotería en el que se compró el boleto de lotería. Como resultado del sorteo, la tercera categoría de ganadores se define como El tercer módulo más grande de la diferencia entre el número que participa en el sorteo de un boleto de lotería separado vendido en la lotería que se está jugando y optim º de hash MD5 de correo de la lotería, que fue comprado un billete de lotería.'),
(1827, 6, 7, 'RULES_13', 'El fondo de premios para el sorteo de una lotería específica se divide en tres categorías de ganadores de la siguiente manera:<br>- La primera categoría de ganadores: 50% del pozo de premios;<br>- La segunda categoría de ganadores: 30% del pozo de premios;<br>- La tercera categoría de ganadores es el 20% del pozo de premios.'),
(1828, 6, 7, 'RULES_14', 'Si dos o más participantes del sorteo de lotería, la diferencia entre el número que participa en el sorteo de un boleto de lotería individual vendido en la lotería que se está jugando y el hash md5 optimizado del sorteo de lotería en el que se compró el boleto de lotería, la ganancia se divide proporcionalmente entre participantes con módulos coincidentes de acuerdo con la categoría de ganancias.'),
(1829, 6, 7, 'RULES_15_1', 'Los resultados de un sorteo de lotería específico se publican en el sitio web de la lotería Lotobot.io en la página '),
(1830, 6, 7, 'RULES_15_2', ' y se muestran después de indicar el número de lotería en el que se compró el boleto de lotería.'),
(1831, 6, 7, 'RULES_16_1', 'El pago del premio a un participante de la lotería que tiene derecho a recibir un premio de cualquier categoría se realiza solo después de una solicitud enviada desde la página '),
(1832, 6, 7, 'RULES_16_2', ' y solo a la billetera Bitcoin indicada en el formulario de solicitud al completarla. El pago se realiza dentro de las 24 horas posteriores a la recepción de la solicitud de pago de ganancias.'),
(1833, 6, 7, 'RULES_17', 'La comisión por retirar las ganancias a la billetera bitcoin del propietario de un boleto de lotería con derecho a recibir una ganancia es del 10%.'),
