INSERT INTO `content` (`id_content_block`, `id_lang`, `id_page`, `name_content_block`, `value_content_block`) VALUES
(1849, 6, 9, 'DESCRIPTION', 'Lotobot es una lotería en línea con un bote de premios del 100%, lo que significa que todos los fondos pagados por los jugadores de lotería se enviarán al bote de premios. Ganamos dinero al proporcionar un proceso de dibujo. La comisión de nuestro servicio es del 10% por el retiro de ganancias a la billetera bitcoin del ganador de un cierto sorteo de lotería. Como la mayoría de los recursos de Internet exitosos, tenemos un programa de fidelización para socios que ayudan a desarrollar nuestro servicio. <span class=\"red_text\">Pagamos una recompensa por cada jugador que compre un boleto de lotería, independientemente de si ganó un socio, un jugador o no.</span> Gracias a nuestro programa de afiliados, todos pueden recibir ingresos de la lotería en línea de Lotobot.'),
(1850, 6, 9, 'RULES_TITLE', 'Nuestras reglas son muy simples.'),
(1851, 6, 9, 'RULE_1', 'Pagamos el 50% de los ingresos recibidos del jugador, que es el 5% del costo de los boletos comprados por él. El costo del boleto de lotería es de 50,000 Satoshi, nuestra comisión es del 10% o 5,000 Satoshi, y pagamos la mitad de esta cantidad al socio que atrajo al jugador. Es decir, su ingreso de cada participante de la lotería atraído y pagado por su boleto será de 2500 Satoshi.'),
(1852, 6, 9, 'RULE_2', 'No tenemos restricciones sobre el monto del pago, por lo que puede retirar los ingresos recibidos incluso de un participante de la lotería involucrado.'),
(1853, 6, 9, 'RULE_3', 'La acumulación de ingresos ocurre inmediatamente después del final del sorteo, en el que el jugador involucrado compró el boleto.'),
(1854, 6, 9, 'RULE_4', 'El pago de los ingresos de referencia recibidos se realiza en la billetera de Bitcoin especificada cuando se solicita un retiro de fondos.'),
(1855, 6, 9, 'RULE_5', 'El período de pago máximo es de 24 horas después de recibir una solicitud de retiro de ingresos.'),
(1856, 6, 9, 'CHECK_TITLE', 'Es fácil visitarnos'),
(1857, 6, 9, 'CHECK_DESCRIPTION', 'Para asegurarse de que cada jugador que haga clic en el enlace de referencia se incluirá en la lista de atraídos por usted, simplemente compre uno de los boletos de lotería a través de su enlace de referencia e inmediatamente verá el boleto de lotería en la lista de atraídos.'),
(1858, 6, 9, 'BECOME_PARTNER_TITLE', 'Convertirse en nuestro socio es fácil'),
(1859, 6, 9, 'BECOME_PARTNER_DESCRIPTION', 'Para convertirse en miembro de nuestro programa de afiliados, todo lo que necesita es obtener un enlace de referencia. Indique su dirección de correo electrónico para ingresar al servicio, escríbalo en el campo apropiado del formulario a continuación y haga clic en \"Conviértase en socio\". Después de eso, recibirá una contraseña única y un enlace de referencia. Todo lo que le queda es compartir el enlace recibido en los foros, en las salas de chat, en las redes sociales y recibir ingresos de cada participante de la lotería atraído. Podrá retirar su ingreso de referencia inmediatamente después de pasar el sorteo en el que la referencia que atrajo compró un boleto.'),
(1860, 6, 9, 'PAGE_DESCRIPTION', 'El programa de referidos de lotería de Bitcoin Lotobot es una forma conveniente de obtener ganancias para webmasters y bloggers. Cómo convertirse en socio y ganar dinero de jugadores atraídos.'),
