(2122, 7, 7, 'TERMS_4', 'Optimeret md5-hash er en sekvens af numre opnået ved at konvertere den originale nummerserie ved hjælp af md5-hash-algoritmen. Du kan læse detaljeret, hvordan vi får den optimerede md5-hash '),
(2123, 7, 7, 'TERMS_5', 'Lotteri-billetnummerlinjen er de numre, der er angivet på lotto-billetten, samlet på en linje i samme rækkefølge, som de blev indtastet i lotteriet på købstidspunktet.'),
(2124, 7, 7, 'TERMS_6', 'En optimeret md5-hash for en lodtrækning er en række af numre opnået ved at optimere md5-hash for summen af alle strenge af numre fra alle lotteri i en bestemt lodtrækning.'),
(2125, 7, 7, 'TERMS_7', 'En optimeret md5-billet-hash er en sekvens af numre opnået fra en streng med numre på en bestemt lotteri-billet ved hjælp af md5-hash-algoritmen. Inden for Lotobot-lotteriet kaldes den optimerede md5-billet-hash nummeret, som deltager i vindingen. Du kan læse detaljeret, hvordan vi får det nummer, der deltager i tegningen '),
(2126, 7, 7, 'TERMS_8', 'Præmiefond er det beløb, der udbetales til vinderne af tegningen efter dens færdiggørelse. Præmiepuljen er summen af prisen for alle lodter, der sælges i et bestemt lotteri.'),
(2127, 7, 7, 'RULES_TITLE', 'Lotteriregler'),
(2128, 7, 7, 'RULES_1', 'Hver lodtrækning har en begrænset tid.'),
(2129, 7, 7, 'RULES_2', 'Hvert lotteri trækker et ubegrænset antal lodter.'),
(2130, 7, 7, 'RULES_3', 'Lotteri billetten er gyldig og deltager først i tegningen efter 3 accepterede bekræftelser af betaling i Bitcoin-netværket.'),
(2131, 7, 7, 'RULES_4', 'Billetter, hvis 3 bekræftelser af betaling på Bitcoin-netværket er passeret efter datoen for lodtrækningen, er ugyldige og deltager ikke i lodtrækningen.'),
(2132, 7, 7, 'RULES_5', 'I hver lotteri angiver billetejer 7 numre fra 0 til 99, som danner grundlaget for at modtage det nummer, der deltager i lotteriet. Det modtagne nummer og den solgte billet, der svarer til den, deltager kun i det lodtrækning, hvor lotteriet blev købt.'),
(2133, 7, 7, 'RULES_6', 'Præmiefonden for lodtrækningen er dannet ud fra mængden af Bitcoin-betalinger, der betales for alle lotter, der deltager i en bestemt lodtrækning.'),
(2134, 7, 7, 'RULES_7', 'Lotteritegning og distribution af præmiefonden finder sted i en periode på højst 24 timer efter datoen for tegningens færdiggørelse.'),
(2135, 7, 7, 'RULES_8', 'I processen med at tegne et lotteri dannes et tal, der deltager i tegningen af et lotteri for hver lotteri, der sælges i et bestemt lotteri. Også under tegningsprocessen dannes en optimeret md5-hash af lotteritegningen.'),
(2136, 7, 7, 'RULES_9', 'Vinderne af lotteriet bestemmes ved at beregne modulet for forskellen mellem antallet, der deltager i lotteriet for hver lotteri, der sælges i lotteriet, der spilles, og den optimerede md5-hash for lotteriet, hvor lotteriet blev købt.'),
(2137, 7, 7, 'RULES_10', 'Som et resultat af lodtrækningen bestemmes den første kategori af vindere som det mindste modul for forskellen mellem antallet, der deltager i lotteritrekningen af en separat lotteri, der er solgt i det lotteri, der spilles, og den optimerede md5-hash for det lodtrækning, hvor lotteriet blev købt.'),
(2138, 7, 7, 'RULES_11', 'Som et resultat af lodtrækningen bestemmes den anden kategori vindere som det næststørste modul for forskellen mellem antallet, der deltager i lotteritrekningen af en separat lotteri, der er solgt i det lotteri, der spilles, og den optimerede md5-hash for lotteriet, hvor lotteriet blev købt.'),
(2139, 7, 7, 'RULES_12', 'Som et resultat af lodtrækningen bestemmes den tredje kategori af vindere som det tredje største modul for forskellen mellem antallet, der deltager i lotteritrekningen af en separat lotteri, der er solgt i lotteriet, der spilles, og den optimerede md5-hash i lotteristrekningen, hvor lotteriet blev købt.'),
(2140, 7, 7, 'RULES_13', 'Præmiefonden for at tegne et specifikt lotteri er opdelt i tre kategorier af vindere i følgende overensstemmelse:<br>- Den første kategori af vindere - 50% af præmiepuljen;<br>- Den anden kategori af vindere - 30% af præmiepuljen;<br>- Den tredje kategori af vindere er 20% af præmiepuljen.'),
(2141, 7, 7, 'RULES_14', 'Hvis to eller flere deltagere i lodtrækningen, forskellen mellem antallet, der deltager i lodtrækningen af en individuel lotteri, der er solgt i det lotteri, der spilles, og den optimerede md5-hash i lotteritrekningen, hvor lotteriet blev købt, falder sammen, deles gevinsten proportionalt mellem deltagere med matchende moduler i henhold til kategorien af gevinster.'),
(2142, 7, 7, 'RULES_15_1', 'Resultaterne af en bestemt lotteritegning offentliggøres på webstedet for Lotobot-lotteriet på siden '),
(2143, 7, 7, 'RULES_15_2', ' og vises efter angivelse af det lotterinummer, hvor lotteriet blev købt.'),
(2144, 7, 7, 'RULES_16_1', 'Betalingen af præmien til lotterideltageren, der har ret til at modtage en præmie i enhver kategori, udføres udelukkende efter en anmodning sendt fra siden '),
(2145, 7, 7, 'RULES_16_2', ' og kun til Bitcoin-tegnebogen, der er angivet i anmodningsformularen, når du udfylder den. Betaling sker senest inden for 24 timer efter modtagelse af anmodningen om betaling af gevinster.'),
(2146, 7, 7, 'RULES_17', 'Provisionen for tilbagetrækning af gevinster til bitcoin-tegnebogen fra ejeren af en lotteri, der har ret til at modtage en gevinst, er 10%.'),
