(2161, 7, 9, 'SUBTITLE', 'Deltag i Lotobot lotteriprogram og tjene 50% af overskuddet fra hver tiltrukket lotterideltager'),
(2162, 7, 9, 'DESCRIPTION', 'Lotobot er et online lotteri med en 100% præmiepulje, hvilket betyder, at alle midler, der betales af lotteri-spillere, sendes til præmiepuljen. Vi tjener penge ved at tilbyde en tegningsproces. Vores service er 10% for tilbagetrækning af gevinster til bitcoin-tegnebogen for vinderen af ​​en bestemt lodtrækning. Som de fleste succesrige internetressourcer har vi et loyalitetsprogram til partnere, der hjælper med at udvikle vores service. <span class=\"red_text\">Vi betaler en belønning for hver spiller, der køber en lotteri, uanset om han vandt af en partner, en spiller eller ej.</span> Takket være vores tilknyttede program kan alle modtage indtægter fra Lotobot online lotteri.'),
(2163, 7, 9, 'RULES_TITLE', 'Vores regler er meget enkle.'),
(2164, 7, 9, 'RULE_1', 'Vi betaler 50% af den indkomst, der er modtaget fra spilleren, hvilket er 5% af udgifterne til billetter købt af ham. Prisen på lotteriet er 50.000 Satoshi, vores provision er 10% eller 5.000 Satoshi, og vi betaler halvdelen af dette beløb til den partner, der tiltrækkede spilleren. Det vil sige, at din indkomst fra hver lotterideltager, der tiltrækkes og betales for din billet, vil være 2500 Satoshi.'),
(2165, 7, 9, 'RULE_2', 'Vi har ingen begrænsninger på betalingsbeløbet, så du kan trække den modtagne indkomst til og med fra en involveret lotterideltager.'),
(2166, 7, 9, 'RULE_3', 'Periodeafgrænsning sker direkte efter afslutningen af trækningen, hvor billetten blev købt af den involverede spiller.'),
(2167, 7, 9, 'RULE_4', 'Betaling af den modtagne henvisningsindkomst foregår på den Bitcoin-tegnebog, der er specificeret, når du anmoder om en tilbagetrækning af midler.'),
(2168, 7, 9, 'RULE_5', 'Den maksimale betalingsperiode er 24 timer efter modtagelse af en anmodning om inddragelse af indkomst.'),
(2169, 7, 9, 'CHECK_TITLE', 'Det er let at tjekke os ud'),
(2170, 7, 9, 'CHECK_DESCRIPTION', 'For at være sikker på, at hver spiller, der klikker på henvisningslinket, vil blive inkluderet på listen over tiltrukket af dig, skal du bare købe en af lotteriet gennem dit henvisningslink og du vil straks se lotteriet på listen over tiltrækkede.'),
(2171, 7, 9, 'BECOME_PARTNER_TITLE', 'At blive vores partner er let'),
(2172, 7, 9, 'BECOME_PARTNER_DESCRIPTION', 'For at blive medlem af vores tilknyttede program er alt hvad du behøver at få et henvisningslink. Angiv din e-mail for at gå ind i tjenesten, skriv den i det relevante felt i formularen herunder og klik på \"Bliv partner\". Derefter vil du modtage en unik adgangskode og et henvisningslink. Det eneste, der er tilbage for dig, er at dele det modtagne link på fora, i chatrum, på sociale netværk og modtage indtægter fra hver involveret lotterideltager. Du vil være i stand til at trække din henvisningsindtægt tilbage umiddelbart efter at have passeret lodtrækningen, hvor henvisningen, du tiltrådte, købte en billet.'),
