(2447, 8, 7, 'RULES_7', 'Losowanie i dystrybucja funduszu nagród odbywa się w okresie nieprzekraczającym 24 godzin od daty zakończenia losowania.'),
(2448, 8, 7, 'RULES_8', 'W procesie losowania loterii tworzona jest liczba uczestnicząca w losowaniu loterii dla każdego losu sprzedawanego w danej loterii. Również podczas procesu losowania tworzony jest zoptymalizowany skrót md5 losowania.'),
(2449, 8, 7, 'RULES_9', 'Zwycięzcy loterii są określani przez obliczenie modułu różnicy między liczbą uczestniczącą w loterii dla każdego losu sprzedawanego w loterii, a zoptymalizowanym hashem md5 losu, w którym kupiono los.'),
(2450, 8, 7, 'RULES_10', 'W wyniku losowania pierwszą kategorię zwycięzców określa się jako najmniejszy moduł różnicy między liczbą biorącą udział w losowaniu osobnego losu sprzedawanego w loterii, a zoptymalizowanym hasłem md5 losowania, w którym kupiono los.'),
(2451, 8, 7, 'RULES_11', 'W wyniku losowania drugą kategorię zwycięzców określa się jako drugi co do wielkości moduł różnicy między liczbą biorącą udział w losowaniu osobnego losu sprzedawanego w loterii, a zoptymalizowanym hasłem md5 losowania, w którym los został zakupiony.'),
(2452, 8, 7, 'RULES_12', 'W wyniku losowania trzecią kategorię zwycięzców określa się jako trzeci co do wielkości moduł różnicy między liczbą biorącą udział w losowaniu loterii osobnego losu sprzedawanego w loterii a zoptymalizowanym hashem md5 losowania losowania, w którym los został zakupiony.'),
(2453, 8, 7, 'RULES_13', 'Fundusz nagród za losowanie określonej loterii jest podzielony na trzy kategorie zwycięzców zgodnie z poniższą zasadą:<br>- Pierwsza kategoria zwycięzców - 50% puli nagród;<br>- Druga kategoria zwycięzców - 30% puli nagród;<br>- Trzecia kategoria zwycięzców to 20% puli nagród.'),
(2454, 8, 7, 'RULES_14', 'Jeżeli dwóch lub więcej uczestników losowania loterii, różnica między liczbą biorącą udział w losowaniu indywidualnego losu loterii sprzedanego w loterii, a zoptymalizowanym hashem md5 losowania loterii, w którym los został zakupiony, pokrywa się, wygrana jest dzielona proporcjonalnie między uczestnicy z dopasowanymi modułami zgodnie z kategorią wygranych.'),
