(2458, 8, 7, 'RULES_16_2', ' i tylko do portfela Bitcoin wskazanego w formularzu żądania podczas jego wypełniania. Płatności dokonuje się nie później niż w ciągu 24 godzin od otrzymania wniosku o wypłatę wygranych.'),
