(2472, 8, 9, 'MADE_PARTNER_ACCOUNT', 'Konto partnera z takim adresem e-mail jest już zarejestrowane.'),
(2473, 8, 9, 'TITLE', 'Zarabiaj z nami'),
(2474, 8, 9, 'SUBTITLE', 'Dołącz do programu partnerskiego loterii Lotobot i uzyskaj 50% zysku od każdego przyciągniętego uczestnika loterii'),
(2475, 8, 9, 'DESCRIPTION', 'Lotobot jest loterią online ze 100% pulą nagród, co oznacza, że ​​wszystkie środki wypłacone przez graczy loterii zostaną przesłane do puli nagród. Zarabiamy, zapewniając proces losowania. Prowizja za naszą usługę wynosi 10% od wypłaty wygranych do portfela bitcoin zwycięzcy pewnego losowania loterii. Podobnie jak większość udanych zasobów internetowych, mamy program lojalnościowy dla partnerów pomagający w rozwoju naszych usług. <span class=\"red_text\">Płacimy nagrodę za każdego gracza, który kupi los na loterię, niezależnie od tego, czy gracz wygrał, czy wygrał przez partnera, czy nie.</span> Dzięki naszemu programowi partnerskiemu każdy może otrzymać dochód z loterii internetowej Lotobot.'),
(2476, 8, 9, 'RULES_TITLE', 'Nasze zasady są bardzo proste.'),
(2477, 8, 9, 'RULE_1', 'Płacimy 50% dochodu otrzymanego od gracza, co stanowi 5% kosztu zakupionych przez niego biletów. Koszt losu wynosi 50 000 Satoshi, nasza prowizja wynosi 10% lub 5000 Satoshi, a połowę tej kwoty wypłacamy partnerowi, który przyciągnął gracza. Oznacza to, że Twój dochód z każdego uczestnika loterii przyciągniętego i zapłaconego za bilet wyniesie 2500 Satoshi.'),
(2478, 8, 9, 'RULE_2', 'Nie mamy żadnych ograniczeń co do kwoty płatności, więc możesz wypłacić dochód otrzymany nawet od jednego uczestnika loterii.'),
(2479, 8, 9, 'RULE_3', 'Naliczenie dochodu następuje natychmiast po zakończeniu losowania, w którym bilet został zakupiony przez zaangażowanego gracza.'),
(2480, 8, 9, 'RULE_4', 'Wypłata otrzymanego dochodu z polecenia jest dokonywana na portfelu Bitcoin określonym podczas wnioskowania o wypłatę środków.'),
(2481, 8, 9, 'RULE_5', 'Maksymalny okres płatności wynosi 24 godziny po otrzymaniu wniosku o wycofanie dochodu.'),
(2482, 8, 9, 'CHECK_TITLE', 'Łatwo nas sprawdzić'),
(2483, 8, 9, 'CHECK_DESCRIPTION', 'Aby mieć pewność, że każdy gracz, który kliknie link polecający, zostanie umieszczony na liście przyciągniętych przez ciebie, po prostu kup jeden z losów na loterię poprzez link polecający, a natychmiast zobaczysz los na loterii na liście przyciąganych.'),
(2484, 8, 9, 'BECOME_PARTNER_TITLE', 'Zostanie naszym partnerem jest łatwe'),
(2485, 8, 9, 'BECOME_PARTNER_DESCRIPTION', 'Aby zostać członkiem naszego programu partnerskiego, wystarczy uzyskać link polecający. Podaj swój adres e-mail, aby przejść do usługi, pisząc go w odpowiednim polu poniższego formularza i kliknij \"Zostań partnerem\". Następnie otrzymasz unikalne hasło i link polecający. Pozostaje Ci tylko udostępnić otrzymany link na forach, w pokojach czatowych, w sieciach społecznościowych i otrzymywać dochód od każdego uczestnika loterii. Będziesz mógł wycofać swój dochód z poleconych natychmiast po przejściu loterii, w której przyciągnięte przez ciebie polecenie kupiło bilet.'),
