(2744, 9, 7, 'TERMS_TITLE', 'Termos e definições'),
(2745, 9, 7, 'TERMS_1', 'Lotobot Lottery é um jogo que ocorre em um determinado período de tempo, após o qual há uma distribuição dos ganhos coletados entre os jogadores que compraram bilhetes de loteria.'),
(2746, 9, 7, 'TERMS_2', 'O sorteio da loteria é um processo de determinação dos vencedores entre os participantes que compraram um bilhete de loteria a tempo para uma loteria específica.'),
(2747, 9, 7, 'TERMS_3', 'Um bilhete de loteria é um conjunto de dados necessários para participar de uma loteria.'),
(2748, 9, 7, 'TERMS_4', 'O hash md5 otimizado é uma sequência de números obtida pela conversão da série de números original usando o algoritmo de hash md5. Você pode ler em detalhes como obtemos o hash md5 otimizado. '),
(2749, 9, 7, 'TERMS_5', 'A linha do número do bilhete de loteria são os números indicados no bilhete de loteria, coletados em uma linha na mesma sequência em que foram inseridos no bilhete de loteria no momento da compra.'),
(2750, 9, 7, 'TERMS_6', 'Um hash md5 otimizado de um sorteio é uma sequência de números obtida pela otimização do hash md5 da soma de todas as linhas de números de todos os bilhetes de loteria de um determinado sorteio.'),
(2751, 9, 7, 'TERMS_7', 'Um hash de ticket md5 otimizado é uma sequência de números obtida de uma sequência de números de um bilhete de loteria específico usando o algoritmo de hash md5. Na loteria da Lotobot, o hash otimizado do ticket md5 é chamado de NÚMERO QUE PARTICIPA NO VENCEDOR. Você pode ler em detalhes como obtemos o número que participa do desenho. '),
(2752, 9, 7, 'TERMS_8', 'Fundo de prêmio é o valor pago aos vencedores do sorteio após sua conclusão. O prêmio total é a soma do custo de todos os bilhetes de loteria vendidos em uma loteria específica.'),
(2753, 9, 7, 'RULES_TITLE', 'Regras da loteria'),
(2754, 9, 7, 'RULES_1', 'Cada sorteio tem um tempo limitado.'),
(2755, 9, 7, 'RULES_2', 'Cada loteria atrai um número ilimitado de bilhetes de loteria.'),
(2756, 9, 7, 'RULES_3', 'O bilhete de loteria é válido e participa do sorteio somente após 3 confirmações de pagamento aceitas na rede Bitcoin.'),
(2757, 9, 7, 'RULES_4', 'Os ingressos cujas três confirmações de pagamento na rede Bitcoin passaram após a data do sorteio são inválidas e não participam do sorteio.'),
(2758, 9, 7, 'RULES_5', 'Em cada bilhete de loteria, o proprietário do bilhete indica 7 números de 0 a 99, que formam a base para o recebimento do número que participa da loteria. O número recebido e o bilhete vendido correspondente a ele participam apenas do sorteio em que o bilhete foi adquirido.'),
(2759, 9, 7, 'RULES_6', 'O fundo do prêmio do sorteio é formado a partir do valor pago em Bitcoin pago por todos os bilhetes de loteria participantes de um sorteio específico.'),
(2760, 9, 7, 'RULES_7', 'O sorteio e a distribuição do fundo do prêmio ocorrem em um período não superior a 24 horas após a data de conclusão do sorteio.'),
(2761, 9, 7, 'RULES_8', 'No processo de sorteio de uma loteria, é formado um número que participa do sorteio de cada loteria vendida em uma loteria específica. Também durante o processo de desenho, um hash md5 otimizado do desenho da loteria é formado.'),
(2762, 9, 7, 'RULES_9', 'Os vencedores da loteria são determinados calculando o módulo da diferença entre o número que participa da loteria para cada bilhete de loteria vendido na loteria que está sendo disputada e o hash md5 otimizado do bilhete de loteria em que o bilhete de loteria foi comprado.'),
(2763, 9, 7, 'RULES_10', 'Como resultado do sorteio, a primeira categoria de vencedores é determinada como o menor módulo da diferença entre o número que participa do sorteio de um bilhete de loteria separado vendido na loteria em jogo e o hash md5 otimizado do sorteio no qual o bilhete de loteria foi comprado.'),
(2764, 9, 7, 'RULES_11', 'Como resultado do sorteio, a segunda categoria de vencedores é determinada como o segundo maior módulo da diferença entre o número que participa do sorteio de um bilhete de loteria separado vendido na loteria em jogo e o hash md5 otimizado do sorteio em que o bilhete de loteria foi adquirido.'),
(2765, 9, 7, 'RULES_12', 'Como resultado do sorteio, a terceira categoria de vencedores é determinada como o terceiro maior módulo da diferença entre o número que participa do sorteio de um bilhete de loteria separado vendido na loteria em jogo e o hash md5 otimizado do sorteio em que o bilhete de loteria foi adquirido.'),
(2766, 9, 7, 'RULES_13', 'O fundo do prêmio para o sorteio de uma loteria específica é dividido em três categorias de vencedores da seguinte maneira:<br>- A primeira categoria de vencedores - 50% do prêmio total;<br>- A segunda categoria de vencedores - 30% do prêmio total;<br>- A terceira categoria de vencedores é 20% do prêmio total.'),
(2767, 9, 7, 'RULES_14', 'Se dois ou mais participantes do sorteio, a diferença entre o número que participa do sorteio de um bilhete de loteria individual vendido na loteria que está sendo disputada e o hash md5 otimizado do sorteio em que o bilhete de loteria foi comprado coincidem, a vitória é dividida proporcionalmente entre participantes com módulos correspondentes de acordo com a categoria de ganhos.'),
(2768, 9, 7, 'RULES_15_1', 'Os resultados de um sorteio específico da loteria são publicados no site da loteria Lotobot.io na página '),
(2769, 9, 7, 'RULES_15_2', ' e são exibidos após indicar o número da loteria em que o bilhete foi comprado.'),
(2770, 9, 7, 'RULES_16_1', 'O pagamento do prêmio ao participante da loteria que tem direito a receber um prêmio de qualquer categoria é realizado exclusivamente após uma solicitação enviada da página '),
(2771, 9, 7, 'RULES_16_2', ' e apenas para a carteira Bitcoin indicada no formulário de solicitação ao preenchê-la. O pagamento é feito no prazo de 24 horas após o recebimento do pedido de pagamento dos ganhos.'),
(2772, 9, 7, 'RULES_17', 'A comissão pela retirada dos ganhos para a carteira de bitcoin do proprietário de um bilhete de loteria com direito a receber uma vitória é de 10%.'),
