(2783, 9, 9, 'TITLE_HEADER', 'Programa de afiliados Lotobot. Ganhe conosco'),
(2784, 9, 9, 'ERROR_PARTNER_ACCOUNT', 'Infelizmente, não foi possível criar uma conta de afiliado. Por favor tente novamente mais tarde.'),
(2785, 9, 9, 'MADE_PARTNER_ACCOUNT', 'Uma conta de parceiro com esse e-mail já está registrada.'),
(2786, 9, 9, 'TITLE', 'Ganhe conosco'),
(2787, 9, 9, 'SUBTITLE', 'Participe do programa de afiliados da Lotobot e ganhe 50% do lucro de cada participante da loteria atraído'),
(2788, 9, 9, 'DESCRIPTION', 'O Lotobot é uma loteria online com 100% de prêmios, o que significa que todos os fundos pagos pelos jogadores da loteria serão enviados para o prêmio. Ganhamos dinheiro fornecendo um processo de desenho. A comissão do nosso serviço é de 10% para a retirada dos ganhos na carteira de bitcoin do vencedor de um determinado sorteio da loteria. Como a maioria dos recursos bem-sucedidos da Internet, temos um programa de fidelidade para parceiros que ajudam a desenvolver nosso serviço. <span class=\"red_text\">Pagamos uma recompensa por cada jogador que compra um bilhete de loteria, independentemente de ganhar ou não ganhar por um parceiro.</span> Graças ao nosso programa de afiliados, todos podem receber renda com a loteria online Lotobot.'),
(2789, 9, 9, 'RULES_TITLE', 'Nossas regras são muito simples.'),
(2790, 9, 9, 'RULE_1', 'Pagamos 50% da renda recebida do jogador, que é 5% do custo dos ingressos comprados por ele. O custo do bilhete de loteria é de 50.000 Satoshi, nossa comissão é de 10% ou 5.000 Satoshi, e pagamos metade desse valor ao parceiro que atraiu o jogador. Ou seja, sua renda de cada participante da loteria atraída e paga pelo seu bilhete será de 2500 Satoshi.');
