(2795, 9, 9, 'CHECK_TITLE', 'É fácil verificar-nos'),
(2796, 9, 9, 'CHECK_DESCRIPTION', 'Para ter certeza de que cada jogador que clicar no link de indicação será incluído na lista de atraídos por você, basta comprar um dos bilhetes de loteria através do seu link de indicação e você verá imediatamente o bilhete de loteria na lista de atraídos.'),
(2797, 9, 9, 'BECOME_PARTNER_TITLE', 'Tornar-se nosso parceiro é fácil'),
(2798, 9, 9, 'BECOME_PARTNER_DESCRIPTION', 'Para se tornar um membro do nosso programa de afiliados, tudo o que você precisa é obter um link de indicação. Indique seu E-mail para entrar no serviço, escrevendo-o no campo apropriado do formulário abaixo e clique em \"Tornar - se um parceiro\". Depois disso, você receberá uma senha exclusiva e um link de referência. Tudo o que resta para você é compartilhar o link recebido nos fóruns, salas de bate-papo, redes sociais e receber renda de cada participante da loteria envolvido. Você poderá retirar sua receita de indicação imediatamente após passar no sorteio em que a indicação atraiu um ingresso.'),
(2799, 9, 9, 'PAGE_DESCRIPTION', 'Programa de referência Loteria Bitcoin Lotobot é uma maneira conveniente de obter lucro para webmasters e blogueiros. Como se tornar um parceiro e ganhar dinheiro com jogadores atraídos.'),
