(2836, 9, 11, 'TITLE', 'Aqui estão todas as suas referências'),
(2837, 9, 11, 'PAGE_DESCRIPTION', 'Página para parceiros da loteria Bitcoin Lotobot. Aqui você pode ver os jogadores que atraiu, descobrir a quantia de receita proveniente de indicações atraídas ou solicitar o pagamento de recompensas.'),
(2838, 9, 11, 'PAGE_KEYWORDS', 'ver referências de lotobot, ver jogadores atraídos de lotobot, solicitar lucro de referências de lotobot, retirar pregado, retirar lucro lotobot'),
(3421, 10, 9, 'RULE_2', 'Vi har ingen begrensninger på betalingsbeløpet, så du kan ta ut inntektene mottatt selv fra en involvert lotterideltaker.'),
(3422, 10, 9, 'RULE_3', 'Periodisering av inntekter skjer rett etter tegningens slutt, hvor billetten ble kjøpt av den involverte spilleren.'),
(3420, 10, 9, 'RULE_1', 'Vi betaler 50% av inntekten mottatt fra spilleren, som er 5% av kostnadene for billetter kjøpt av ham. Kostnaden for lodd er 50.000 Satoshi, vår provisjon er 10% eller 5.000 Satoshi, og vi betaler halvparten av dette beløpet til partneren som tiltrakk seg spilleren. Det vil si at inntekten fra hver lotterideltaker som tiltrekkes og betalt for billetten din vil være 2500 Satoshi.'),
(3419, 10, 9, 'RULES_TITLE', 'Våre regler er veldig enkle.'),
(3418, 10, 9, 'DESCRIPTION', 'Lotobot er et online lotteri med 100% premiepott, noe som betyr at alle midler som er betalt av lotteri spillere vil bli sendt til premiepotten. Vi tjener penger ved å tilby en tegneprosess. Kommisjonen til vår tjeneste er 10% for uttak av gevinster til bitcoin lommeboken til vinneren av en viss loddtrekning. Som de fleste vellykkede internettressurser, har vi et lojalitetsprogram for partnere som hjelper deg med å utvikle tjenesten vår. <span class=\"red_text\"> Vi betaler en belønning for hver spiller som kjøper en lodd, uansett om spilleren har vunnet eller vunnet av en partner eller ikke.</span> Takket være vårt tilknytningsprogram, kan alle motta inntekter fra Lotobot-lotteriet.'),
