(3397, 10, 7, 'RULES_14', 'Hvis to eller flere deltakere i loddtrekningen, forskjellen mellom antallet som deltar i loddtrekningen av en individuell lodd som er solgt i lotteriet som spilles, og den optimaliserte md5-hasjen til loddtrekningen som lotteribilen ble kjøpt sammenfaller, blir gevinsten delt proporsjonalt mellom deltakere med matchende moduler i henhold til kategorien gevinster.'),
(3396, 10, 7, 'RULES_13', 'Premiefondet for tegning av et spesifikt lotteri er delt inn i tre kategorier av vinnere i følgende samsvar:<br>- Den første kategorien av vinnere - 50% av premiepotten;<br>- Den andre kategorien av vinnere - 30% av premiepotten;<br>- Den tredje kategorien av vinnere er 20% av premiepotten.'),
(3395, 10, 7, 'RULES_12', 'Som et resultat av trekningen blir den tredje kategorien av vinnere bestemt som den tredje største modulen med forskjellen mellom antallet som deltar i loddtrekningen til en egen lodd som er solgt i lotteriet som spilles og den optimaliserte md5-hasjen til loddtrekningen der lotteriet ble kjøpt.'),
(3394, 10, 7, 'RULES_11', 'Som et resultat av trekningen blir den andre kategorien av vinnere bestemt som den nest største modulen med forskjellen mellom antallet som deltar i loddtrekningen til en egen lodd som er solgt i lotteriet som spilles, og den optimaliserte md5-hasjen til loddtrekningen som lotteribilen ble kjøpt i.'),
(3393, 10, 7, 'RULES_10', 'Som et resultat av tegningen blir den første kategorien av vinnere bestemt som den minste modulen med forskjellen mellom antallet som deltar i loddtrekningen av en egen lodd som er solgt i lotteriet som spilles, og den optimaliserte md5-hasjen til loddtrekningen der lotteriet ble kjøpt.'),
(3392, 10, 7, 'RULES_9', 'Vinnere av lotteriet bestemmes ved å beregne modulen for forskjellen mellom antallet som deltar i lotteriet for hver lodd som er solgt i lotteriet som spilles, og den optimaliserte md5-hasjen til lotto som lotteriet ble kjøpt i.'),
(3391, 10, 7, 'RULES_8', 'I prosessen med å tegne et lotteri dannes det et nummer som deltar i tegningen av et lotteri for hver lodd som selges i et bestemt lotteri. Også under tegningsprosessen dannes en optimalisert md5-hash av loddtrekningen.'),
(3390, 10, 7, 'RULES_7', 'Lotteritegning og utdeling av premiefondet foregår i en periode som ikke overstiger 24 timer etter datoen for tegningen er fullført.'),
(3389, 10, 7, 'RULES_6', 'Premiefondet for trekningen er dannet av mengden Bitcoin-betalinger som er betalt for alle lodd som deltar i en spesiell trekning.'),
(3387, 10, 7, 'RULES_4', 'Billetter hvis 3 bekreftelser på betaling i Bitcoin-nettverket har gått etter trekkdatoen, er ugyldige og deltar ikke i trekningen.'),
(3388, 10, 7, 'RULES_5', 'I hver lodd angir billettseieren 7 nummer fra 0 til 99, som danner grunnlaget for å motta nummeret som deltar i lotteriet. Det mottatte nummeret og den solgte billetten som tilsvarer den, deltar bare i loddtrekningen der lotteribilletten ble kjøpt.'),
