(3381, 10, 7, 'TERMS_7', 'En optimalisert md5-billett-hash er en sekvens av tall hentet fra en streng med tall på en spesifikk lodd ved bruk av md5-hash-algoritmen. Innenfor Lotobot-lotteriet kalles den optimaliserte md5-billett-hasjen NUMMERET AT DELTAKER I VINNEN. Du kan lese detaljert hvordan vi får tallet som deltar i tegningen. '),
