(3680, 11, 6, 'INFOGRAPHICS_TITLE', 'Vi förstår att denna algoritm är ganska förvirrande och komplicerad, men den garanterar avsaknaden av möjligheten att förfalska lotter och förutsäga en vinnande kombination.'),
