(3686, 11, 7, 'TITLE', 'Regler Bitcoin lotteri Lotobot'),
(3687, 11, 7, 'TERMS_TITLE', 'Villkor och definitioner'),
(3688, 11, 7, 'TERMS_1', 'Lotobot Lottery är ett spel som äger rum under en viss tid, varefter det finns en fördelning av de insamlade vinsterna bland de spelare som köpte lotteri.'),
(3689, 11, 7, 'TERMS_2', 'Lotteriteckning är en process för att bestämma vinnare bland deltagare som köpte en lottbiljett i tid för ett specifikt lotteri.'),
(3690, 11, 7, 'TERMS_3', 'En lotteri är en uppsättning data som krävs för att delta i ett lotteri.'),
(3691, 11, 7, 'TERMS_4', 'Optimerad md5-hash är en sekvens av nummer erhållna genom att konvertera den ursprungliga nummerserien med hjälp av md5-hash-algoritmen. Du kan läsa i detalj hur vi får den optimerade md5-hash. '),
(3692, 11, 7, 'TERMS_5', 'Lotteri biljettnumret är de nummer som anges på lotteriet, samlade i en rad i samma sekvens som de togs in i lotteriet vid köpstillfället.'),
(3693, 11, 7, 'TERMS_6', 'En optimerad md5-hash för en lotteritrekning är en sekvens av nummer som erhålls genom att optimera md5-hash för summan av alla rader med nummer från alla lotter i en viss dragning.'),
(3694, 11, 7, 'TERMS_7', 'En optimerad md5-biljett hash är en sekvens av nummer erhållna från en sträng med nummer för en specifik lotterikort med md5-hash-algoritmen. Inom Lotobot-lotteriet kallas den optimerade md5-biljett hashnumret NUMMERET SOM DELTAR I VINNINGEN. Du kan läsa i detalj hur vi får numret som deltar i ritningen. '),
(3695, 11, 7, 'TERMS_8', 'Prisfond är det belopp som betalas till vinnarna på teckningen efter dess slutförande. Prispotten är summan av kostnaden för alla lotter som säljs i ett visst lotteri.'),
(3696, 11, 7, 'RULES_TITLE', 'Lotteriregler'),
(3697, 11, 7, 'RULES_1', 'Varje drag har en begränsad tid.'),
(3698, 11, 7, 'RULES_2', 'Varje lotteri drar ett obegränsat antal lotter.'),
(3699, 11, 7, 'RULES_3', 'Lottobilen är giltig och deltar i ritningen först efter 3 godkända betalningsbekräftelser i Bitcoin-nätverket.'),
(3700, 11, 7, 'RULES_4', 'Biljetter vars 3 bekräftelser av betalningen i Bitcoin-nätverket har passerat efter dragningen är ogiltiga och deltar inte i dragningen.'),
(3701, 11, 7, 'RULES_5', 'I varje lotteri anges biljettägaren 7 nummer från 0 till 99, som utgör grunden för att ta emot det nummer som deltar i lotteriet. Det mottagna numret och den sålda biljetten som motsvarar den deltar endast i lotteritrekningen där lotteribilen köpts.'),
(3702, 11, 7, 'RULES_6', 'Lottets prisfond bildas av mängden Bitcoin-betalningar som betalas för alla lotter som deltar i en viss dragning.'),
(3703, 11, 7, 'RULES_7', 'Lotteriteckning och utdelning av prisfonden äger rum under en period som inte överstiger 24 timmar efter att ritningen slutförts.'),
(3704, 11, 7, 'RULES_8', 'I processen att dra ett lotteri bildas ett nummer som deltar i ritningen av ett lotteri för varje lotteri som säljs i ett visst lotteri. Även under ritningsprocessen bildas en optimerad md5-hash för lotteriteckningen.'),
(3705, 11, 7, 'RULES_9', 'Vinnarna i lotteriet bestäms genom att beräkna modulen för skillnaden mellan antalet som deltar i lotteriet för varje lotterbiljett som säljs i lotteriet som spelas, och den optimerade md5-hashen för lotteriet där lotteriet köpts.'),
(3706, 11, 7, 'RULES_10', 'Som ett resultat av ritningen bestäms den första kategorin av vinnare som den minsta modulen av skillnaden mellan antalet som deltar i lotteriteckningen för en separat lotterit som sålts i lotteriet som spelas, och den optimerade md5-hashen i lotteriteckningen där lotteriet köpts.'),
(3707, 11, 7, 'RULES_11', 'Som ett resultat av dragningen bestäms den andra kategorin av vinnare som den näst största modulen med skillnaden mellan antalet som deltar i lotteritrekningen för en separat lotterit som sålts i lotteriet som spelas, och den optimerade md5-hashen i lotteridraget där lotteriet köpts.'),
(3708, 11, 7, 'RULES_12', 'Som ett resultat av dragningen bestäms den tredje kategorin av vinnare som den tredje största modulen för skillnaden mellan antalet som deltar i lotteritrekningen för en separat lotteribiljett som sålts i lotteriet som spelas och den optimerade md5-hashen i lotteridraget där lotterit köptes.'),
(3709, 11, 7, 'RULES_13', 'Prisfonden för att dra ett specifikt lotteri är uppdelat i tre kategorier av vinnare i följande överensstämmelse:<br>- Den första kategorin av vinnare - 50% av prispotten;<br>- Den andra kategorin av vinnare - 30% av prispotten;<br>- Den tredje kategorin av vinnare är 20% av prispotten.'),
(3710, 11, 7, 'RULES_14', 'Om två eller flera deltagare i lotteritrekningen, skillnaden mellan antalet som deltar i lotteritrekningen av en enskild lotterit som sålts i lotteriet som spelas och den optimerade md5-hash i lotteritrekningen där lotteriköpningen köpts sammanfaller, delas vinsten proportionellt mellan deltagare med matchande moduler i enlighet med kategorin vinster.'),
(3711, 11, 7, 'RULES_15_1', 'Resultaten av en specifik lotteriteckning publiceras på webbplatsen för lotobot.io-lotteriet på sidan '),
(3712, 11, 7, 'RULES_15_2', ' och visas efter att ha angett lotterinumret där lotteribilen köpts.'),
(3713, 11, 7, 'RULES_16_1', 'Betalningen av priset till lottodeltagaren som har rätt att få ett pris i vilken kategori som helst görs endast efter en begäran skickad från sidan '),
(3714, 11, 7, 'RULES_16_2', ' och endast till Bitcoin-plånboken som anges i förfrågningsblanketten när du fyller i den. Betalning sker senast inom 24 timmar efter mottagandet av begäran om betalning av vinster.'),
(3715, 11, 7, 'RULES_17', 'Provisionen för att dra tillbaka vinster till bitcoin-plånboken för ägaren av en lotteri som har rätt att få en vinst är 10%.'),
