(3725, 11, 8, 'PAGE_KEYWORDS', 'lotobot-biljett, lotobot-biljettinformation, lotobot-biljettinformation, lotobot-biljettutskrift'),
(3726, 11, 9, 'TITLE_HEADER', 'Lotobot affiliate-program. Tjäna med oss'),
(3727, 11, 9, 'ERROR_PARTNER_ACCOUNT', 'Tyvärr kunde vi inte skapa ett affiliate-konto. Försök igen senare.'),
(3728, 11, 9, 'MADE_PARTNER_ACCOUNT', 'Ett partnerkonto med sådan e-post är redan registrerad.'),
(3729, 11, 9, 'TITLE', 'Tjäna med oss'),
(3730, 11, 9, 'SUBTITLE', 'Gå med i Lotobot lotteriprogram och tjäna 50% av vinsten från varje attraherad lotterideltagare'),
(3731, 11, 9, 'DESCRIPTION', 'Lotobot är ett online-lotteri med en 100% prispott, vilket innebär att alla pengar som betalas av lotterispelare kommer att skickas till prispottet. Vi tjänar pengar genom att tillhandahålla en ritningsprocess. Uppdraget för vår tjänst är 10% för uttag av vinster till bitcoin-plånboken för vinnaren av en viss lotteritrekning. Som de flesta framgångsrika internetresurser har vi ett lojalitetsprogram för partners som hjälper till att utveckla vår tjänst. <span class=\"red_text\">Vi betalar en belöning för varje spelare som köper en lottbiljett, oavsett om han vann av en partner, en spelare eller inte.</span> Tack vare vårt affiliate-program kan alla få inkomster från Lotobot-lotteriet online.'),
(3732, 11, 9, 'RULES_TITLE', 'Våra regler är mycket enkla.'),
(3733, 11, 9, 'RULE_1', 'Vi betalar 50% av intäkterna från spelaren, vilket är 5% av kostnaden för biljetter som han har köpt. Kostnaden för lotteriet är 50 000 Satoshi, vår provision är 10% eller 5 000 Satoshi, och vi betalar hälften av detta belopp till den partner som lockade spelaren. Det vill säga att din inkomst från varje lotterideltagare som dras in och betalas för din biljett blir 2500 Satoshi.'),
(3734, 11, 9, 'RULE_2', 'Vi har inga begränsningar för betalningsbeloppet, så du kan ta ut de inkomster som du fått även från en involverad lotterideltagare.'),
