(3993, 12, 6, 'INFOGRAPHICS_TITLE', 'Ymmärrämme, että tämä algoritmi on melko hämmentävä ja monimutkainen, mutta se takaa sen, että arpajaisten lippuja ei voida väärentää ja ennustaa voittava yhdistelmä.'),
