(4000, 12, 7, 'TERMS_TITLE', 'Termit ja määritelmät'),
(4001, 12, 7, 'TERMS_1', 'Lotobot-arpajaiset on peli, joka tapahtuu tietyn ajanjakson ajan, jonka jälkeen kerätyt voitot jaetaan pelaajien keskuudessa, jotka ostivat arpalippuja.'),
(4002, 12, 7, 'TERMS_2', 'Arpajaisten piirtäminen on prosessi, jonka avulla voittajat määritetään osallistujien keskuudessa, jotka ostivat arpajaisen lipun oikeaan aikaan tiettyyn arpajaiseen.'),
(4003, 12, 7, 'TERMS_3', 'Lottolippu on joukko tietoja, jotka ovat välttämättömiä arvontaan osallistumiseen.'),
(4004, 12, 7, 'TERMS_4', 'Optimoitu md5-hash on numerosarja, joka saadaan muuntamalla alkuperäinen numerosarja käyttämällä md5-hash-algoritmia. Voit lukea yksityiskohtaisesti kuinka saamme optimoidun md5-tiivisteen. '),
(4005, 12, 7, 'TERMS_5', 'Arpajaisen lipun numerorivi on arvontalipussa ilmoitetut numerot, jotka on kerätty riville samassa järjestyksessä, jossa ne merkittiin arpajaiseen lippuun ostohetkellä.'),
(4006, 12, 7, 'TERMS_6', 'Arpajaisten optimoitu md5-tiiviste on numerosarja, joka saadaan optimoimalla tietyn arvonnan kaikkien arpajaisten lippujen kaikkien numerojonojen summan md5-tiiviste.'),
(4007, 12, 7, 'TERMS_7', 'Optimoitu md5-lipun tiiviste on numerosarja, joka saadaan tietyn arpajaisen lipun numerosarjasta md5-hash-algoritmia käyttämällä. Lotobot-arvonnassa optimoitua md5-lippu hashia kutsutaan NUMEROksi, JOTKA OSALLISTUIVAT VOITTAVASSA. Voit lukea yksityiskohtaisesti kuinka saamme piirustukseen osallistuvan numeron. '),
(4008, 12, 7, 'TERMS_8', 'Palkintoraha on summa, joka maksetaan arvonnan voittajille sen valmistumisen jälkeen. Palkintopotti on kaikkien tiettyyn arpajaiseen myytyjen arpajaisten lippujen kustannusten summa.'),
(4009, 12, 7, 'RULES_TITLE', 'Arpajaiset'),
(4010, 12, 7, 'RULES_1', 'Jokaisella arvonnalla on rajoitettu aika.'),
(4011, 12, 7, 'RULES_2', 'Jokainen arpajainen piirtää rajoittamattoman määrän arpalippuja.'),
(4012, 12, 7, 'RULES_3', 'Arpajaiskilippu on voimassa ja osallistuu arvontaan vasta kun 3 hyväksyttyä vahvistusta maksua vastaan Bitcoin-verkossa.'),
(4013, 12, 7, 'RULES_4', 'Lippuja, joiden 3 maksun vahvistusta Bitcoin-verkossa on kulunut arvonnan jälkeen, ovat kelpaamattomat, eivätkä osallistu arvontaan.'),
(4014, 12, 7, 'RULES_5', 'Jokaisessa arvontalipussa lipun haltija ilmoittaa 7 numeroa välillä 0 - 99, jotka muodostavat perustan arvontaan osallistuvalle numerolle. Vastaanotettu numero ja sitä vastaava myyty lippu osallistuvat vain arvontaan, jossa lottokortti ostettiin.'),
(4015, 12, 7, 'RULES_6', 'Arvonnan palkintorahasto muodostuu Bitcoin-maksujen määrästä, joka maksetaan kaikista tiettyyn arvontaan osallistuvista arpajaisten lipuista.'),
(4016, 12, 7, 'RULES_7', 'Arpajaisten piirtäminen ja palkintorahaston jakaminen tapahtuu enintään 24 tunnin kuluessa arvonnan valmistumispäivästä.'),
(4017, 12, 7, 'RULES_8', 'Arpajaisten piirtämisessä muodostuu numero, joka osallistuu arpajaisten piirtämiseen jokaiselle tietyssä arpajaisessa myytävälle arpajaiskilipulle. Myös piirtoprosessin aikana muodostetaan arpajaisten piirustuksen optimoitu md5-tiiviste.'),
(4018, 12, 7, 'RULES_9', 'Arpajaisten voittajat määritetään laskemalla erotus moduulilla, joka osallistuu arpajaisiin osallistuvien kunkin pelaajan arpajaiseen myytyyn arpajaiseen, ja sen arpajaisen optimoidun md5-tiivisteen välillä, jonka arpajainen lippu on ostettu.'),
(4019, 12, 7, 'RULES_10', 'Piirtämisen tuloksena ensimmäinen voittajaryhmä määritetään pienimmäksi moduuliksi erotteltavasta erässä myytävän erillisen arpajaisen lipun arvontaan osallistuvan numeron määrän ja sen arpajaisen optimoidun md5 hash-arvon välillä, jossa arpajainen lippu ostettiin.'),
(4020, 12, 7, 'RULES_11', 'Arvonnan tuloksena toinen voittajaryhmä määritetään toiseksi suurimpana moduulina erotteltavasta arpajaisessa myytävän erillisen arpajaisen lipun arvontaan osallistuvien jäsenten lukumäärän ja optimoidun md5 hash-arvon välillä arvonnassa, jossa arpajainen lippu ostettiin.'),
(4021, 12, 7, 'RULES_12', 'Arvonnan tuloksena kolmas voittajaryhmä määritetään kolmanneksi suurimpana moduulina erotteltavasta arpajaisessa myytävän erillisen arpajaisen lipun arvontaan osallistuvien lukumäärän ja optimoidun md5 hash-arvon välillä erässä, jonka arpajainen lippu ostettiin.'),
(4022, 12, 7, 'RULES_13', 'Tiettyjen arpajaisten piirtämiseen tarkoitettu palkintorahasto on jaettu kolmeen voittajaryhmään seuraavan mukaisesti:<br>- Ensimmäinen voittajaryhmä - 50% palkintopotista;<br>- Toinen voittajaryhmä - 30% palkintopotista;<br>- Kolmas voittajaryhmä on 20% palkintopotista.'),
(4023, 12, 7, 'RULES_14', 'Jos kaksi tai useampi arpajaiset osallistuvat, pelaamiseen osallistuvan arpajaisen yhteydessä myytävän yksittäisen arpajaisen lipun arvontaan osallistuvien lukumäärän ja sen arpajaisen arvontaan optimoidun md5-rivin, jossa arpajainen lippu ostettiin, välinen erotus vastaavat toisiaan, voitto jaetaan suhteessa osallistujat, joilla on vastaavat moduulit voittokategorian mukaisesti.'),
(4024, 12, 7, 'RULES_15_1', 'Tiettyjen arpajaisten piirtämisen tulokset julkaistaan Lotobot.io-arpajaisten verkkosivuilla sivulla '),
(4025, 12, 7, 'RULES_15_2', ' ja näytetään sen jälkeen, kun on ilmoitettu arpajaisen numero, josta arpajainen lippu on ostettu.'),
(4026, 12, 7, 'RULES_16_1', 'Palkinnon maksaminen lotto-osanottajalle, jolla on oikeus saada minkä tahansa luokan palkinto, suoritetaan yksinomaan sivulta lähetetyn pyynnön jälkeen. '),
(4027, 12, 7, 'RULES_16_2', ' ja vain Bitcoin-lompakkoon, joka on ilmoitettu pyyntölomakkeessa, kun sitä täytetään. Maksu suoritetaan viimeistään 24 tunnin kuluessa voittopyynnön vastaanottamisesta.'),
(4028, 12, 7, 'RULES_17', 'Palkkion voiton nostamisesta arvontaan oikeuttavan arvontalipun omistajan bitcoin-lompakkoon on 10%.'),
