(4039, 12, 9, 'TITLE_HEADER', 'Lotobot-kumppaniohjelma. Ansaitse kanssamme'),
(4040, 12, 9, 'ERROR_PARTNER_ACCOUNT', 'Valitettavasti emme pystyneet luomaan kumppanitiliä. Yritä myöhemmin uudelleen.'),
(4041, 12, 9, 'MADE_PARTNER_ACCOUNT', 'Kumppanitili, jolla on tällainen sähköposti, on jo rekisteröity.'),
(4042, 12, 9, 'TITLE', 'Ansaitse kanssamme'),
(4043, 12, 9, 'SUBTITLE', 'Liity Lotobot-arpajaisten osakkuusyritysohjelmaan ja ansaitse 50% voitosta jokaiselta houkutellulta lotto-osallistujalta'),
(4044, 12, 9, 'DESCRIPTION', 'Lotobot on online-arpajainen, jossa on 100-prosenttinen palkintopotti, mikä tarkoittaa, että kaikki arpajaisten maksamat varat lähetetään palkintopottiin. Ansaitsemme rahaa tarjoamalla piirtoprosessin. Palvelumme välityspalkkio on 10% tietyn arpajaisen voittajan voittojen nostamisesta bitcoin-lompakkoon. Kuten menestyneimmät Internet-resurssit, meillä on kanta-asiakasohjelma kumppaneille, jotka auttavat kehittämään palveluamme. <span class=red_text>Me maksamme palkkion jokaisesta pelaajasta, joka on ostanut arvontalipun, riippumatta siitä voitti hän, houkutteli kumppani, pelaaja vai ei.</span> Kumppaniohjelmamme ansiosta jokainen voi saada tuloja Lotobotin online-arpajaisista.'),
(4045, 12, 9, 'RULES_TITLE', 'Säännöt ovat hyvin yksinkertaisia.'),
(4046, 12, 9, 'RULE_1', 'Maksamme 50% pelaajalta saatavista tuloista, mikä on 5% hänen ostamista lippuista. Lottohinta on 50 000 Satoshi, palkkio 10% tai 5000 Satoshi, ja maksamme puolet tästä summasta pelaajalle houkutellulle kumppanille. Toisin sanoen, sinun tulosi jokaiselta arpajaistasi osallistuvalta ja lipulta maksetulta lotto-osallistujalta ovat 2500 Satoshi.'),
(4047, 12, 9, 'RULE_2', 'Meillä ei ole rajoituksia maksun määrälle, joten voit nostaa saadut tulot jopa yhdeltä osallistuvalta arpajaisista.'),
(4048, 12, 9, 'RULE_3', 'Tulojen kertyminen tapahtuu heti arvonnan päättymisen jälkeen, jolloin pelaaja osti lipun.'),
(4049, 12, 9, 'RULE_4', 'Saadut siirtotulot maksetaan Bitcoin-lompakolla, joka määritetään, kun pyydetään varojen nostoa.'),
(4050, 12, 9, 'RULE_5', 'Enimmäismaksuaika on 24 tuntia tulojen peruuttamista koskevan pyynnön vastaanottamisesta.'),
(4051, 12, 9, 'CHECK_TITLE', 'On helppo tarkistaa meidät'),
(4052, 12, 9, 'CHECK_DESCRIPTION', 'Jos haluat olla varma, että jokainen pelaajaviittauslinkkiä napsauttava pelaaja sisällytetään sinua kiinnostavaan luetteloon, osta vain yksi arpajaislippu viittauslinkin kautta ja näet heti arpajaisen lipun houkuttelemassa luettelossa.'),
(4053, 12, 9, 'BECOME_PARTNER_TITLE', 'Partneriksi tuleminen on helppoa'),
(4054, 12, 9, 'BECOME_PARTNER_DESCRIPTION', 'Tullaksesi kumppaniohjelmamme jäseneksi tarvitset vain viittauslinkin. Ilmoita sähköpostiosoitteesi palvelun kirjoittamiseksi, kirjoittamalla se alla olevan lomakkeen oikeaan kenttään ja napsauttamalla \"Tule kumppaniksi\". Sen jälkeen saat yksilöllisen salasanan ja viittauslinkin. Sinulle jää vain jakaa vastaanotettu linkki foorumeilla, chat-huoneissa, sosiaalisissa verkostoissa ja saada tuloja jokaiselta mukana olevalta arpajaisten osallistujalta. Voit nostaa lähetystuotosi heti sen arvonnan läpäisemisen jälkeen, jonka houkuttelemasi suositus osti lipun.'),
(4055, 12, 9, 'PAGE_DESCRIPTION', 'Viittausohjelma Bitcoin-arpajaiset Lotobot on kätevä tapa ansaita voittoa verkkovastaaville ja bloggaajille. Kuinka tulla partneriksi ja ansaita rahaa houkuttelemilta pelaajilta.'),
(4056, 12, 9, 'PAGE_KEYWORDS', 'lotobot-lähetysohjelma, ansaita lotobotilla, lähetysohjelma, kuinka ansaita arpajaisia, ansaita arpajaisten lippujen myynnistä, lotobot-kumppani '),
