(4314, 13, 7, 'TERMS_1', 'Lotobot Lotere adalah permainan yang berlangsung dalam periode waktu tertentu, setelah itu ada distribusi kemenangan yang dikumpulkan di antara pemain yang membeli tiket lotre.'),
(4315, 13, 7, 'TERMS_2', 'Undian lotere adalah proses penentuan pemenang di antara peserta yang membeli tiket lotre tepat waktu untuk lotere tertentu.'),
(4316, 13, 7, 'TERMS_3', 'Tiket lotere adalah sekumpulan data yang diperlukan untuk berpartisipasi dalam lotere.'),
(4317, 13, 7, 'TERMS_4', 'Hash md5 yang dioptimalkan adalah urutan angka yang diperoleh dengan mengubah seri nomor asli menggunakan algoritma hash md5. Anda dapat membaca secara detail bagaimana kami mendapatkan hash md5 yang dioptimalkan '),
(4318, 13, 7, 'TERMS_5', 'Garis nomor tiket lotre adalah nomor yang tertera pada tiket lotre, dikumpulkan dalam satu baris dalam urutan yang sama di mana mereka dimasukkan dalam tiket lotre pada saat pembelian.'),
(4319, 13, 7, 'TERMS_6', 'Hash md5 yang dioptimalkan dari undian lotre adalah urutan angka yang diperoleh dengan mengoptimalkan hash md5 dari jumlah semua string angka dari semua tiket lotre dari undian tertentu.'),
(4320, 13, 7, 'TERMS_7', 'Hash tiket md5 yang dioptimalkan adalah urutan angka yang diperoleh dari serangkaian angka tiket lotre tertentu menggunakan algoritma hash md5. Di dalam lotre Lotobot, hash tiket md5 yang dioptimalkan disebut NOMOR YANG BERPARTISIPASI DALAM PEMENANG. Anda dapat membaca secara detail bagaimana kami mendapatkan nomor yang berpartisipasi dalam gambar '),
(4321, 13, 7, 'TERMS_8', 'Dana hadiah adalah jumlah yang dibayarkan kepada pemenang undian setelah selesai. Kumpulan hadiah adalah jumlah biaya semua tiket lotre yang terjual dalam lotre tertentu.'),
(4322, 13, 7, 'RULES_TITLE', 'Aturan Lotere'),
(4323, 13, 7, 'RULES_1', 'Setiap undian memiliki jumlah waktu terbatas.'),
(4324, 13, 7, 'RULES_2', 'Setiap lotere menarik jumlah tiket lotre yang tidak terbatas.'),
(4325, 13, 7, 'RULES_3', 'Tiket lotere valid dan ikut serta dalam undian hanya setelah 3 konfirmasi pembayaran yang diterima dalam jaringan Bitcoin.'),
(4326, 13, 7, 'RULES_4', 'Tiket yang 3 konfirmasi pembayarannya di jaringan Bitcoin telah berlalu setelah tanggal undian tidak valid dan tidak berpartisipasi dalam undian.'),
(4327, 13, 7, 'RULES_5', 'Dalam setiap tiket lotre, pemilik tiket menunjukkan 7 angka dari 0 hingga 99, yang membentuk dasar untuk menerima nomor yang berpartisipasi dalam lotre. Nomor yang diterima dan tiket yang dijual yang sesuai dengannya hanya berpartisipasi dalam undian lotere di mana tiket lotre dibeli.'),
(4328, 13, 7, 'RULES_6', 'Dana hadiah undian terbentuk dari jumlah pembayaran Bitcoin yang dibayarkan untuk semua tiket lotere yang berpartisipasi dalam undian tertentu.'),
(4329, 13, 7, 'RULES_7', 'Pengundian undian dan distribusi dana hadiah berlangsung dalam periode tidak melebihi 24 jam setelah tanggal penyelesaian pengundian.'),
(4330, 13, 7, 'RULES_8', 'Dalam proses menggambar lotre, nomor terbentuk yang berpartisipasi dalam menggambar lotre untuk setiap tiket lotre yang dijual dalam lotre tertentu. Juga selama proses menggambar, hash md5 yang dioptimalkan dari gambar lotre terbentuk.'),
(4331, 13, 7, 'RULES_9', 'Pemenang lotere ditentukan dengan menghitung modul perbedaan antara jumlah yang berpartisipasi dalam lotere untuk setiap tiket lotre yang dijual dalam lotere yang dimainkan, dan hash md5 yang dioptimalkan dari tiket lotre di mana tiket lotre dibeli.'),
(4332, 13, 7, 'RULES_10', 'Sebagai hasil dari pengundian, kategori pemenang pertama ditentukan sebagai modul terkecil dari perbedaan antara jumlah yang berpartisipasi dalam pengundian undian tiket lotre terpisah yang dijual dalam lotre yang sedang dimainkan, dan hash md5 yang dioptimalkan dari pengundian lotre di mana tiket lotere dibeli.'),
(4333, 13, 7, 'RULES_11', 'Sebagai hasil dari undian, kategori pemenang kedua ditentukan sebagai modul terbesar kedua dari perbedaan antara jumlah yang berpartisipasi dalam undian lotre dari tiket lotre terpisah yang dijual dalam lotre yang sedang dimainkan, dan hash md5 yang dioptimalkan dari undian lotere di mana tiket lotere dibeli.'),
(4334, 13, 7, 'RULES_12', 'Sebagai hasil undian, kategori ketiga pemenang ditentukan sebagai modul terbesar ketiga dari perbedaan antara jumlah yang berpartisipasi dalam undian lotere dari tiket lotre terpisah yang dijual dalam lotre yang sedang dimainkan dan hash md5 yang dioptimalkan dari undian lotre di mana tiket lotere dibeli.'),
(4335, 13, 7, 'RULES_13', 'Dana hadiah untuk menggambar lotre tertentu dibagi menjadi tiga kategori pemenang dengan ketentuan sebagai berikut:<br>- Kategori pemenang pertama - 50% dari total hadiah;<br>- Kategori pemenang kedua - 30% dari total hadiah;<br>- Kategori pemenang ketiga adalah - 20% dari total hadiah.'),
(4336, 13, 7, 'RULES_14', 'Jika dua atau lebih peserta dari undian lotere, perbedaan antara jumlah yang berpartisipasi dalam undian lotere dari tiket lotre individu yang dijual dalam lotere yang dimainkan dan hash md5 yang dioptimalkan dari undian lotre di mana tiket lotre dibeli bersamaan, kemenangan dibagi secara proporsional antara peserta dengan modul yang cocok sesuai dengan kategori kemenangan.'),
(4337, 13, 7, 'RULES_15_1', 'Hasil dari gambar lotere tertentu diterbitkan di situs web lotre Lotobot.io pada halaman '),
(4338, 13, 7, 'RULES_15_2', ' dan ditampilkan setelah menunjukkan nomor lotere di mana tiket lotre dibeli.'),
(4339, 13, 7, 'RULES_16_1', 'Pembayaran hadiah kepada peserta lotere yang berhak menerima hadiah dari kategori apa pun dilakukan secara eksklusif setelah permintaan dikirim dari halaman '),
(4340, 13, 7, 'RULES_16_2', ' dan hanya untuk dompet Bitcoin yang ditunjukkan dalam formulir permintaan saat mengisinya. Pembayaran dilakukan selambat-lambatnya dalam waktu 24 jam sejak diterimanya permintaan pembayaran kemenangan.'),
