(4355, 13, 9, 'TITLE', 'Hasilkan bersama kami'),
(4356, 13, 9, 'SUBTITLE', 'Bergabunglah dengan program afiliasi lotere Lotobot dan dapatkan 50% dari keuntungan dari setiap peserta lotere yang tertarik'),
(4357, 13, 9, 'DESCRIPTION', 'Lotobot adalah lotere online dengan kelompok hadiah 100%, yang berarti bahwa semua dana yang dibayarkan oleh pemain lotere akan dikirim ke kumpulan hadiah. Kami menghasilkan uang dengan menyediakan proses menggambar. Komisi layanan kami adalah 10% untuk penarikan kemenangan ke dompet bitcoin dari pemenang undian lotere tertentu. Seperti sumber daya Internet paling sukses, kami memiliki program loyalitas untuk mitra yang membantu mengembangkan layanan kami. <span class=\"red_text\"> Kami membayar hadiah untuk setiap pemain yang membeli tiket lotere, terlepas dari apakah dia menang, tertarik oleh mitra, pemain atau tidak.</span> Berkat program afiliasi kami, semua orang dapat menerima penghasilan dari lotre online Lotobot.'),
(4358, 13, 9, 'RULES_TITLE', 'Aturan kami sangat sederhana.'),
(4359, 13, 9, 'RULE_1', 'Kami membayar 50% dari pendapatan yang diterima dari pemain, yaitu 5% dari biaya tiket yang dibeli olehnya. Biaya tiket lotere adalah 50.000 Satoshi, komisi kami adalah 10% atau 5.000 Satoshi, dan kami membayar setengah dari jumlah ini kepada mitra yang menarik pemain. Artinya, penghasilan Anda dari setiap peserta lotere yang ditarik dan dibayar untuk tiket Anda adalah 2500 Satoshi.'),
(4360, 13, 9, 'RULE_2', 'Kami tidak memiliki batasan pada jumlah pembayaran, sehingga Anda dapat menarik penghasilan yang diterima bahkan dari satu peserta lotere yang terlibat.'),
(4361, 13, 9, 'RULE_3', 'Pendapatan akrual terjadi segera setelah akhir pengundian, di mana tiket dibeli oleh pemain yang terlibat.'),
(4362, 13, 9, 'RULE_4', 'Pembayaran dari pendapatan rujukan yang diterima dilakukan pada dompet Bitcoin yang ditentukan saat meminta penarikan dana.'),
(4363, 13, 9, 'RULE_5', 'Periode pembayaran maksimum adalah 24 jam setelah menerima permintaan penarikan pendapatan.'),
(4364, 13, 9, 'CHECK_TITLE', 'Sangat mudah untuk memeriksa kami'),
(4365, 13, 9, 'CHECK_DESCRIPTION', 'Untuk memastikan bahwa setiap pemain yang mengklik tautan rujukan akan dimasukkan dalam daftar yang Anda tarik, beli saja salah satu tiket lotre melalui tautan referensi Anda dan Anda akan segera melihat tiket lotre dalam daftar tertarik.'),
(4366, 13, 9, 'BECOME_PARTNER_TITLE', 'Menjadi pasangan kita itu mudah'),
(4367, 13, 9, 'BECOME_PARTNER_DESCRIPTION', 'Untuk menjadi anggota program afiliasi kami, yang Anda butuhkan adalah mendapatkan tautan rujukan. Tunjukkan Email Anda untuk memasuki layanan, tulis di bidang yang sesuai dari formulir di bawah ini dan klik \"Menjadi mitra\". Setelah itu, Anda akan menerima kata sandi unik dan tautan rujukan. Yang tersisa bagi Anda adalah membagikan tautan yang diterima di forum, di ruang obrolan, di jejaring sosial, dan menerima penghasilan dari setiap peserta lotere yang terlibat. Anda akan dapat menarik penghasilan referral Anda segera setelah melewati undian di mana referal yang Anda tarik membeli tiket.'),
