(4630, 14, 7, 'TERMS_4', 'Hashed md5 yang dioptimumkan adalah urutan nombor yang diperoleh dengan menukar siri nombor asal menggunakan algoritma hasd md5. Anda boleh baca secara terperinci bagaimana kami mendapatkan hash md5 yang dioptimumkan. '),
(4631, 14, 7, 'TERMS_5', 'Garis nombor tiket loteri adalah nombor yang ditunjukkan pada tiket loteri, yang dikumpulkan dalam satu baris dalam urutan yang sama di mana mereka dimasukkan dalam tiket loteri pada masa pembelian.'),
(4632, 14, 7, 'TERMS_6', 'Hash md5 yang dioptimumkan dari undian loteri adalah urutan nombor yang diperoleh dengan mengoptimumkan hash md5 jumlah semua baris nombor dari semua tiket loteri lukisan tertentu.'),
(4633, 14, 7, 'TERMS_7', 'Hash tiket md5 yang dioptimumkan adalah urutan nombor yang diperoleh dari rentetan nombor tiket loteri tertentu menggunakan algoritma hasd md5. Di dalam loteri Lotobot, hash tiket md5 yang dioptimumkan dipanggil NUMBER YANG TERMASUK DALAM PEMENANG. Anda boleh membaca secara terperinci bagaimana kami mendapat nombor yang menyertai lukisan. '),
(4634, 14, 7, 'TERMS_8', 'Dana hadiah ialah jumlah yang dibayar kepada pemenang lukisan selepas selesai. Kolam hadiah adalah jumlah kos semua tiket loteri yang dijual dalam loteri tertentu.'),
(4635, 14, 7, 'RULES_TITLE', 'Kaedah Loteri'),
(4636, 14, 7, 'RULES_1', 'Setiap cabutan mempunyai masa yang terhad.'),
(4637, 14, 7, 'RULES_2', 'Setiap loteri menarik nombor tiket loteri yang tidak terhad.'),
(4638, 14, 7, 'RULES_3', 'Tiket loteri adalah sah dan mengambil bahagian dalam lukisan hanya selepas 3 diterima pengesahan pembayaran dalam rangkaian Bitcoin.'),
(4639, 14, 7, 'RULES_4', 'Tiket yang 3 pengesahan pembayaran pada rangkaian Bitcoin telah berlalu selepas tarikh undian tidak sah dan tidak mengambil bahagian dalam cabutan itu.'),
(4640, 14, 7, 'RULES_5', 'Dalam setiap tiket loteri, pemegang tiket menunjukkan 7 nombor dari 0 hingga 99, yang merupakan asas untuk nombor yang terlibat dalam loteri. Nombor yang diterima dan tiket yang dijual sepadan dengannya hanya mengambil undian loteri di mana tiket loteri dibeli.'),
(4641, 14, 7, 'RULES_6', 'Dana hadiah untuk cabutan terbentuk daripada jumlah pembayaran Bitcoin yang dibayar untuk semua tiket loteri yang menyertai cabutan tertentu.'),
(4642, 14, 7, 'RULES_7', 'Lukisan loteri dan pengedaran dana hadiah berlaku dalam tempoh tidak melebihi 24 jam selepas tarikh selesai lukisan itu.'),
(4643, 14, 7, 'RULES_8', 'Dalam proses melukis loteri, sejumlah dibentuk yang mengambil bahagian dalam lukisan loteri untuk setiap tiket loteri yang dijual dalam loteri tertentu. Juga semasa proses lukisan, hashed md5 optimum dari lukisan loteri terbentuk.'),
(4644, 14, 7, 'RULES_9', 'Pemenang loteri ditentukan dengan mengira modul perbezaan antara bilangan yang menyertai loteri untuk setiap tiket loteri yang dijual di loteri yang dimainkan, dan hash md5 yang dioptimumkan dari tiket loteri di mana tiket loteri dibeli.'),
(4645, 14, 7, 'RULES_10', 'Sebagai hasil lukisan itu, kategori pertama pemenang ditentukan sebagai modul terkecil perbezaan antara bilangan yang mengambil bahagian dalam loteri lukisan tiket loteri yang berasingan yang dijual dalam loteri yang dimainkan, dan hashed md5 optik dari lukisan loteri di mana tiket loteri dibeli.'),
(4646, 14, 7, 'RULES_11', 'Hasilnya, kategori kedua pemenang ditentukan sebagai modul kedua terbesar perbezaan antara bilangan yang menyertai undian loteri tiket loteri yang berasingan yang dijual di loteri yang dimainkan, dan hashed md5 yang dioptimumkan dalam undian loteri di mana tiket loteri telah dibeli.'),
(4647, 14, 7, 'RULES_12', 'Hasilnya, kategori ketiga pemenang ditentukan sebagai modul ketiga terbesar perbezaan antara bilangan yang menyertai undian loteri tiket loteri yang berasingan yang dijual di loteri yang dimainkan dan hashed md5 yang optimum dari undian loteri di mana tiket loteri telah dibeli.'),
(4648, 14, 7, 'RULES_13', 'Dana hadiah untuk melukis loteri tertentu dibahagikan kepada tiga kategori pemenang mengikut berikut:<br>- Kategori pertama pemenang - 50% daripada kolam hadiah;<br>- Kategori kedua pemenang - 30% daripada kolam hadiah;<br>- Kategori pemenang ketiga adalah 20% dari kolam hadiah.'),
(4649, 14, 7, 'RULES_14', 'Sekiranya dua atau lebih peserta undian loteri, perbezaan di antara nombor yang mengambil bahagian dalam undian loteri tiket loteri individu yang dijual dalam loteri yang dimainkan dan hashed md5 optimum undian loteri di mana tiket loteri dibeli bertepatan, kemenangan dibahagikan berkadaran antara peserta yang mempunyai modul yang sepadan selaras dengan kategori kemenangan.'),
(4650, 14, 7, 'RULES_15_1', 'Hasil lukisan loteri tertentu diterbitkan di laman web loteri Lotobot.io pada halaman '),
(4651, 14, 7, 'RULES_15_2', ' dan dipaparkan selepas menandakan nombor loteri di mana tiket loteri dibeli.'),
(4652, 14, 7, 'RULES_16_1', 'Pembayaran hadiah kepada peserta undian yang berhak menerima hadiah bagi mana-mana kategori dijalankan hanya selepas permintaan dihantar dari halaman '),
(4653, 14, 7, 'RULES_16_2', ' dan hanya kepada dompet Bitcoin yang ditunjukkan dalam borang permintaan apabila mengisi ia. Bayaran dibuat paling lambat dalam tempoh 24 jam dari penerimaan permintaan untuk pembayaran kemenangan.'),
(4654, 14, 7, 'RULES_17', 'Suruhanjaya untuk menarik balik kemenangan kepada dompet bitcoin pemilik tiket loteri yang berhak menerima kemenangan ialah 10%.'),
