(4666, 14, 9, 'ERROR_PARTNER_ACCOUNT', 'Malangnya, kami tidak dapat membuat akaun afiliasi. Sila cuba lagi nanti.'),
(4667, 14, 9, 'MADE_PARTNER_ACCOUNT', 'Akaun rakan kongsi dengan E-mel tersebut sudah didaftarkan.'),
(4668, 14, 9, 'TITLE', 'Dapatkan dengan kami'),
(4669, 14, 9, 'SUBTITLE', 'Sertai program afiliasi Lotobot loteri dan dapatkan 50% daripada keuntungan dari setiap peserta loteri yang menarik'),
(4670, 14, 9, 'DESCRIPTION', 'Lotobot adalah loteri dalam talian dengan kolam hadiah 100%, yang bermaksud bahawa semua dana yang dibayar oleh pemain loteri akan dihantar ke kolam hadiah. Kami membuat wang dengan menyediakan proses lukisan. Komisen perkhidmatan kami adalah 10% untuk penarikan balik kemenangan kepada dompet bitcoin pemenang undian loteri tertentu. Seperti sumber Internet yang paling berjaya, kami mempunyai program kesetiaan untuk rakan-rakan yang membantu untuk membangunkan perkhidmatan kami. <span class=\"red_text\">Kami membayar ganjaran untuk setiap pemain yang membeli tiket loteri, tidak kira sama ada dia menang, tertarik dengan rakan kongsi, pemain atau tidak.</span> Terima kasih kepada program afiliasi kami, semua orang boleh menerima pendapatan daripada Loteri loteri dalam talian.'),
(4671, 14, 9, 'RULES_TITLE', 'Peraturan kita sangat mudah.'),
(4672, 14, 9, 'RULE_1', 'Kami membayar 50% daripada pendapatan yang diterima daripada pemain, iaitu 5% daripada kos tiket yang dibeli olehnya. Kos tiket loteri adalah 50,000 Satoshi, komisen kami adalah 10% atau 5,000 Satoshi, dan kami membayar separuh dari jumlah ini kepada pasangan yang menarik pemain. Iaitu pendapatan anda dari setiap peserta loteri yang menarik dan dibayar untuk tiket anda ialah 2500 Satoshi.'),
(4673, 14, 9, 'RULE_2', 'Kami tidak mempunyai sekatan ke atas jumlah pembayaran, jadi anda boleh menarik balik pendapatan yang diterima walaupun dari satu peserta loteri yang terlibat.'),
(4674, 14, 9, 'RULE_3', 'Akrual pendapatan berlaku sejurus selepas akhir lukisan, di mana tiket itu dibeli oleh pemain yang terlibat.'),
(4675, 14, 9, 'RULE_4', 'Pembayaran pendapatan rujukan diterima dilakukan pada dompet Bitcoin yang ditentukan ketika meminta penarikan dana.'),
(4676, 14, 9, 'RULE_5', 'Tempoh pembayaran maksimum adalah 24 jam selepas menerima permintaan untuk pengeluaran pendapatan.'),
(4677, 14, 9, 'CHECK_TITLE', 'Sangat mudah untuk memeriksa kami'),
(4678, 14, 9, 'CHECK_DESCRIPTION', 'Untuk memastikan bahawa setiap pemain yang mengklik pautan rujukan akan dimasukkan ke dalam senarai yang tertarik oleh anda, hanya membeli salah satu tiket loteri melalui pautan rujukan anda dan anda akan segera melihat tiket loteri dalam senarai yang tertarik.'),
(4679, 14, 9, 'BECOME_PARTNER_TITLE', 'Menjadi rakan kongsi kami adalah mudah'),
(4680, 14, 9, 'BECOME_PARTNER_DESCRIPTION', 'Untuk menjadi ahli program affiliate kami, semua yang anda perlukan adalah untuk mendapatkan pautan rujukan. Tunjukkan E-mel anda untuk memasuki perkhidmatan tersebut, menuliskannya dalam bidang yang sesuai borang di bawah dan klik \"Menjadi rakan kongsi\". Selepas itu, anda akan menerima kata laluan unik dan pautan rujukan. Semua yang ada untuk anda adalah untuk berkongsi pautan yang diterima di forum, di bilik sembang, di rangkaian sosial dan menerima pendapatan daripada peserta loteri yang tertarik. Anda akan dapat menarik balik pendapatan rujukan anda selepas meluluskan undian di mana rujukan anda menarik membeli tiket.'),
(4681, 14, 9, 'PAGE_DESCRIPTION', 'Program rujukan Bitcoin lottery Lotobot adalah cara yang mudah untuk membuat keuntungan untuk webmaster dan blogger. Bagaimana untuk menjadi rakan kongsi dan mendapatkan wang daripada pemain yang tertarik.'),
