(4951, 15, 7, 'RULES_3', 'A sorsjegy érvényes, és csak a 3 Bitcoin hálózaton elfogadott fizetési visszaigazolást követően vesz részt a rajzoláson.'),
(4952, 15, 7, 'RULES_4', 'Azok a jegyek, amelyek 3 fizetési igazolása a Bitcoin hálózaton a sorsolás napját követően telt el, érvénytelenek és nem vesznek részt a sorsoláson.'),
(4953, 15, 7, 'RULES_5', 'Minden jegyben a jegytulajdonos 7 számot jelöl 0-tól 99-ig, amelyek képezik az alapot a lottón részt vevő szám kézhezvételéhez. A kapott szám és az ahhoz tartozó eladott jegy csak abban a sorsoláson vesz részt, amelyben a lottójegyet megvásárolták.'),
(4954, 15, 7, 'RULES_6', 'A sorsolás nyereményalapját az egyes sorsoláson részt vevő minden sorsjegyre fizetett Bitcoin-összegek összegéből hozzák létre.'),
(4955, 15, 7, 'RULES_7', 'A sorsolásra és a nyereményalap elosztására legfeljebb 24 órán belül kerül sor a sorsolás dátuma után.'),
(4956, 15, 7, 'RULES_8', 'A lottó sorsolása során egy szám alakul ki, amely részt vesz a sorsoláson az egyes lottókban értékesített sorsjegyek rajzolásában. A rajzolási folyamat során szintén kialakul a lottó rajz optimalizált md5 kivonata.'),
(4957, 15, 7, 'RULES_9', 'A lottó nyerteseit úgy kell kiszámítani, hogy kiszámolják a különbséget, amelyben a lottón részt vevő számok száma megoszlik a lejátszott lottón értékesített minden egyes lottón, és a lottóeszköz optimalizált md5 hash-jának, amelyben a lottójegyet megvásárolták.'),
(4958, 15, 7, 'RULES_10', 'A rajz eredményeként a nyertesek első kategóriáját úgy határozzuk meg, hogy a lejátszott lottón értékesített külön lottójegy lottójátékának sorsolásán részt vevő szám különbségének és a sorsolásra optimalizált md5 kivonat közötti különbség legkisebb modulja, amelyben a lottójegyet vásárolták.'),
(4959, 15, 7, 'RULES_11', 'A sorsolás eredményeként a nyertesek második kategóriáját úgy határozzuk meg, mint a második legnagyobb modul a különbségnek a különbségéből, amely részt vesz a lejátszott lottón értékesített külön lottójáték sorsolásán, és a lottó sorsolásának optimalizált md5 hash-ján, amelyben a lottójegyet megvásárolták.'),
(4960, 15, 7, 'RULES_12', 'A sorsolás eredményeként a nyertesek harmadik kategóriáját úgy határozzuk meg, mint a harmadik legnagyobb modul a különbség harmadik moduljaként, amely részt vesz a lejátszott lottón értékesített külön lottójáték sorsolásán, és a lottó sorsolásának optimalizált md5 hash-ja, amelyben a lottójegyet megvásárolták.'),
(4961, 15, 7, 'RULES_13', 'Az adott lottó nyereményalapja három kategóriába sorolható a nyertesek számára, az alábbiak szerint:<br>- A nyertesek első kategóriája - a nyereményalap 50% -a;<br>- A nyertesek második kategóriája - a nyereményalap 30% -a;<br>- A nyertesek harmadik kategóriája a nyereményalap 20% -a.'),
(4962, 15, 7, 'RULES_14', 'Ha a lottón két vagy több résztvevő vesz részt, akkor a különbség a különbség között, amely részt vesz a meghívott lottón eladott egyedi lottójáték sorsolásában, és a lottó sorsolásának optimalizált md5 hash-jában, amelyben a lottójegyet megvásárolták, a nyereményt arányosan osztják fel résztvevők megfelelő modulokkal, a nyeremény kategóriája szerint.'),
(4963, 15, 7, 'RULES_15_1', 'Egy adott lottó rajz eredményeit a Lotobot.io lottó honlapján teszik közzé az oldalon '),
(4964, 15, 7, 'RULES_15_2', ' és megjelennek, miután megjelölték a sorszámot, amelyben a sorsjegyet vásárolták.'),
(4965, 15, 7, 'RULES_16_1', 'A nyeremény kifizetése annak a lottó résztvevőnek, aki jogosult bármely kategóriájú nyeremény megszerzésére, kizárólag az oldal elküldése után történik. '),
(4966, 15, 7, 'RULES_16_2', ' és csak a megkeresési űrlapon feltüntetett Bitcoin pénztárcához, amikor kitölti. A fizetés legkésőbb a nyeremény kifizetésére vonatkozó kérelem kézhezvételétől számított 24 órán belül történik.'),
(4967, 15, 7, 'RULES_17', 'A nyeremény megszerzéséért fizetendő jutalék a nyerésre jogosult lottójegy tulajdonosának a bitcoin pénztárcájáért történő nyereményért.'),
(4968, 15, 7, 'PAGE_DESCRIPTION', 'Lotobot Bitcoin szabályok, kifejezések és meghatározások. Olvassa el, hogy megtanulja, hogyan kell játszani és megnyerni a bitcoin lottót.'),
(4969, 15, 7, 'PAGE_KEYWORDS', 'lotobot szabályok, lotobot lottó szabályok, lotobot szabályok, hogyan kell játszani lotobot'),
