(4971, 15, 8, 'REQUEST_ERROR', 'Sajnos nem sikerült megszerezni a jegy részleteit. Próbáld újra később.'),
(4972, 15, 8, 'DATA_ERROR', 'A bevitt adatok helytelenek. Ellenőrizze a bevitt adatokat, és próbálja újra.'),
(4973, 15, 0, 'TICKET_DATA', 'Jegy adatai'),
(4974, 15, 8, 'SUBTITLE', 'Annak érdekében, hogy megnézhesse a vásárolt lottójegyet, adja meg a csekk adatait az alábbi képernyőn.'),
(4975, 15, 8, 'SHOW_ANOTHER_TICKET', 'Mutasson újabb jegyet'),
(4976, 15, 8, 'PAGE_DESCRIPTION', 'Elfelejtette a Lotobot jegy adatait? Itt láthatja az összes információt a vásárolt lottójegyről.'),
(4977, 15, 8, 'PAGE_KEYWORDS', 'lotobot jegy, lotobot jegy adatai, lotobot jegy információk, lotobot jegy kinyomtatása'),
(4978, 15, 9, 'TITLE_HEADER', 'Lotobot társult program. Keressen velünk'),
(4979, 15, 9, 'ERROR_PARTNER_ACCOUNT', 'Sajnos nem tudtunk létrehozni társult fiókot. Próbáld újra később.'),
(4980, 15, 9, 'MADE_PARTNER_ACCOUNT', 'Az ilyen e-mail címmel rendelkező partnerfiók már regisztrálva van.'),
(4981, 15, 9, 'TITLE', 'Keressen velünk'),
(4982, 15, 9, 'SUBTITLE', 'Csatlakozzon a Lotobot lottóvállalati programhoz, és nyereségének 50% -át szerezzen minden vonzott lottó résztvevőtől'),
(4983, 15, 9, 'DESCRIPTION', 'A Lotobot egy 100% -os nyereményalapú online lottó, ami azt jelenti, hogy a lottójátékosok által fizetett összes pénzt a nyereményalapba juttatják el. Pénzt keresünk azáltal, hogy rajzot készítünk. Szolgáltatásunk jutaléka 10%, ha nyereményt vonnak vissza egy adott lottó sorsolás nyertesének a bitcoin pénztárcájába. A legtöbb sikeres internetes forráshoz hasonlóan hűségprogramunk van a partnereink számára, akik segítik szolgáltatásunk fejlesztését. <span class=\"red_text\">Jutalmat fizetünk minden olyan játékosért, aki lottójegyet vásárolt, függetlenül attól, hogy nyert, partnere vonzott-e, vagy sem.</span> Társult programunknak köszönhetően mindenki bevételt szerezhet a Lotobot online lottón keresztül.'),
(4984, 15, 9, 'RULES_TITLE', 'Szabályaink nagyon egyszerűek.'),
(4985, 15, 9, 'RULE_1', 'Fizetünk a játékos jövedelmének 50% -át, ami az általa vásárolt jegyek költségeinek 5% -a. A sorsjegy ára 50 000 Satoshi, jutalékunk 10% vagy 5000 Satoshi, és ennek az összegnek a felét fizetjük annak a partnernek, aki vonzza a játékost. Vagyis a jövedelme minden egyes lottón résztvevőtől, amelyet vonzott és fizetett a jegyéért, 2500 Satoshi lesz.'),
(4986, 15, 9, 'RULE_2', 'Nincs korlátozás a fizetés összegére, tehát a bevételeket akár egy érintett lottón résztvevőtől is kivonhatja.'),
(4987, 15, 9, 'RULE_3', 'A jövedelem felhalmozódása azonnal történik a sorsolás vége után, amikor a jegyet az érintett játékos vásárolta meg.'),
(4988, 15, 9, 'RULE_4', 'A beérkezett átruházási jövedelem kifizetése a Bitcoin pénztárcáján történik, amelyet a pénzeszközök visszavonásakor kérnek.'),
(4989, 15, 9, 'RULE_5', 'A maximális fizetési határidő 24 óra a jövedelem visszavonására irányuló kérelem kézhezvétele után.'),
(4990, 15, 9, 'CHECK_TITLE', 'Könnyű megnézni minket'),
(4991, 15, 9, 'CHECK_DESCRIPTION', 'Annak biztosítása érdekében, hogy minden olyan játékos, aki rákattint az átirányítási linkre, felkerül az Ön által vonzott listára, csak vásároljon egyet a lottó jegyekről az áttételi link segítségével, és azonnal látni fogja a lottó jegyet a vonzott listában.'),
(4992, 15, 9, 'BECOME_PARTNER_TITLE', 'Könnyű partnerré válni'),
(4993, 15, 9, 'BECOME_PARTNER_DESCRIPTION', 'A társult programunk tagjává válásához csak annyit kell tennie, hogy kap egy hivatkozási linket. Jelölje meg e-mail címét, hogy beléphessen a szolgáltatásba, írja be az alábbi űrlap megfelelő mezőjébe, majd kattintson a \"Legyen partner\" lehetőségre. Ezt követően kap egy egyedi jelszót és egy hivatkozási linket. Csak annyit kell tennie, hogy megosztja a kapott linket a fórumokon, a csevegőszobákban, a közösségi hálózatokon, és jövedelmet szerez minden résztvevő lottón. Az átirányítási jövedelem azonnal visszavonható, miután átadta a sorsolást, amelyben a vonzotta Önnek jegyet vásárolt.'),
(4994, 15, 9, 'PAGE_DESCRIPTION', 'A Bitcoin Lottery Lotobot ajánlóprogramja kényelmes módja annak, hogy profitot szerezzen a webmesterek és a bloggerek számára. Hogyan lehet partnerré válni és pénzt keresni a vonzott játékosoktól?'),
(4995, 15, 9, 'PAGE_KEYWORDS', 'lotobot ajánlási program, keresni a lotobot segítségével, ajánlási program, hogyan lehet lottót keresni, keresni a lottójegyek eladásából, lotobot partner '),
