(5245, 16, 6, 'INFOGRAPHICS_TITLE', 'We begrijpen dat dit algoritme nogal verwarrend en ingewikkeld is, maar het garandeert de afwezigheid van de mogelijkheid van vervalsing van loten en het voorspellen van een winnende combinatie.'),
