(5249, 16, 6, 'PAGE_KEYWORDS', 'nummer voor tekening, nummer voor loterij lotobot, conversie van ticketnummers van lotobot'),
(5250, 16, 7, 'TITLE_HEADER', 'Regels Bitcoin-loterij Lotobot'),
(5251, 16, 7, 'TITLE', 'Regels Bitcoin-loterij Lotobot'),
(5252, 16, 7, 'TERMS_TITLE', 'Termen en definities'),
(5253, 16, 7, 'TERMS_1', 'Lotobot Lottery is een spel dat zich in een bepaalde periode afspeelt, waarna de verzamelde winsten worden verdeeld onder spelers die loten hebben gekocht.'),
(5254, 16, 7, 'TERMS_2', 'Loterijtekening is een proces waarbij winnaars worden bepaald onder deelnemers die op tijd een lot hebben gekocht voor een specifieke loterij.'),
(5255, 16, 7, 'TERMS_3', 'Een loterijticket is een set gegevens die nodig is om deel te nemen aan een loterij.'),
(5256, 16, 7, 'TERMS_4', 'Geoptimaliseerde md5-hash is een reeks getallen die is verkregen door de oorspronkelijke nummerreeks te converteren met behulp van het md5-hash-algoritme. U kunt gedetailleerd lezen hoe we de geoptimaliseerde md5-hash krijgen '),
(5257, 16, 7, 'TERMS_5', 'De regel van het lotnummer is de getallen in het lot, verzameld in een lijn in dezelfde volgorde waarin ze op het moment van aankoop in het lot waren ingevoerd.'),
(5258, 16, 7, 'TERMS_6', 'Een geoptimaliseerde md5-hash van een loterijtrekking is een reeks getallen die is verkregen door de md5-hash te optimaliseren van de som van alle regels met getallen uit alle loten van een bepaalde trekking.'),
(5259, 16, 7, 'TERMS_7', 'Een geoptimaliseerde md5-tickethash is een reeks getallen verkregen uit een reeks nummers van een specifiek loterijticket met behulp van het md5-hash-algoritme. Binnen de Lotobot-loterij wordt de geoptimaliseerde md5-tickethash het AANTAL genoemd dat aan het winnen deelneemt. U kunt gedetailleerd lezen hoe we het nummer krijgen dat deelneemt aan de tekening. '),
(5260, 16, 7, 'TERMS_8', 'Prijzenfonds is het bedrag dat aan de winnaars van de trekking wordt betaald na voltooiing. De prijzenpot is de som van de kosten van alle loten die in een bepaalde loterij worden verkocht.'),
(5261, 16, 7, 'RULES_TITLE', 'Loterij regels'),
(5262, 16, 7, 'RULES_1', 'Elke trekking heeft een beperkte hoeveelheid tijd.'),
(5263, 16, 7, 'RULES_2', 'Elke loterij trekt een onbeperkt aantal loten.'),
(5264, 16, 7, 'RULES_3', 'Het lottoticket is geldig en neemt pas deel aan de trekking na 3 geaccepteerde betalingsbevestigingen in het Bitcoin-netwerk.'),
(5265, 16, 7, 'RULES_4', 'Tickets waarvan de 3 bevestigingen van betaling op het Bitcoin-netwerk zijn verstreken na de trekkingsdatum zijn ongeldig en nemen niet deel aan de trekking.'),
(5266, 16, 7, 'RULES_5', 'In elk lottoticket geeft de kaarteigenaar 7 nummers van 0 tot 99 aan, die de basis vormen voor het ontvangen van het nummer dat deelneemt aan de loterij. Het ontvangen nummer en het bijbehorende bijbehorende ticket nemen alleen deel aan de loterijtrekking waarin het lot is gekocht.'),
(5267, 16, 7, 'RULES_6', 'Het prijzengeld van de trekking wordt gevormd uit het aantal Bitcoin-betalingen dat is betaald voor alle loten die aan een bepaalde trekking deelnemen.'),
(5268, 16, 7, 'RULES_7', 'Loterijtekening en distributie van het prijzenfonds vindt plaats binnen een periode van maximaal 24 uur na de datum van voltooiing van de tekening.'),
(5269, 16, 7, 'RULES_8', 'Tijdens het tekenen van een loterij wordt een nummer gevormd dat deelneemt aan de loting voor elk lot dat in een bepaalde loterij wordt verkocht. Ook tijdens het tekenproces wordt een geoptimaliseerde md5-hash van de loterijtekening gevormd.'),
(5270, 16, 7, 'RULES_9', 'Winnaars van de loterij worden bepaald door de module te berekenen van het verschil tussen het aantal dat deelneemt aan de loterij voor elk verkocht lot in de loterij en de geoptimaliseerde md5-hash van het lot waarin het lot is gekocht.'),
(5271, 16, 7, 'RULES_10', 'Als gevolg van de trekking wordt de eerste categorie winnaars bepaald als de kleinste module van het verschil tussen het aantal dat deelneemt aan de loterijtekening van een afzonderlijk loterijticket dat wordt verkocht in de loterij die wordt gespeeld, en de geoptimaliseerde md5-hash van de loterijtekening waarin het loterijticket werd gekocht.'),
(5272, 16, 7, 'RULES_11', 'Als gevolg van de trekking wordt de tweede categorie winnaars bepaald als de tweede grootste module van het verschil tussen het aantal dat deelneemt aan de loterijtrekking van een afzonderlijk loterijticket dat wordt verkocht in de loterij die wordt gespeeld, en de geoptimaliseerde md5-hash van de loterijtrekking waarin het loterijticket is gekocht.'),
(5273, 16, 7, 'RULES_12', 'Als gevolg van de trekking wordt de derde categorie winnaars bepaald als de derde grootste module van het verschil tussen het aantal dat deelneemt aan de loterijtrekking van een afzonderlijk loterijticket dat wordt verkocht in de gespeelde loterij en de geoptimaliseerde md5-hash van de loterijtrekking waarin het loterijticket is gekocht.'),
(5274, 16, 7, 'RULES_13', 'Het prijzenfonds voor het trekken van een specifieke loterij is op de volgende manier verdeeld in drie categorieën winnaars:<br>- De eerste categorie winnaars - 50% van de prijzenpot;<br>- De tweede categorie winnaars - 30% van de prijzenpot;<br>- De derde categorie winnaars is 20% van de prijzenpot.'),
(5275, 16, 7, 'RULES_14', 'Als twee of meer deelnemers aan de loterijtrekking, het verschil tussen het aantal dat deelneemt aan de loterijtrekking van een individueel loterijticket dat wordt verkocht in de loterij die wordt gespeeld en de geoptimaliseerde md5-hash van de loterijtrekking waarin het loterijticket is gekocht, samenvalt, wordt de winst evenredig verdeeld tussen deelnemers met bijpassende modules in overeenstemming met de categorie van de winst.'),
(5276, 16, 7, 'RULES_15_1', 'De resultaten van een specifieke loterijtekening worden op de website van de Lotobot.io-loterij op de pagina gepubliceerd '),
