(5295, 16, 9, 'SUBTITLE', 'Word lid van het Lotobot loterij affiliate programma en verdien 50% van de winst van elke aangetrokken loterij deelnemer'),
(5296, 16, 9, 'DESCRIPTION', 'Lotobot is een online loterij met een prijzenpot van 100%, wat betekent dat alle fondsen die door loterijen worden betaald naar de prijzenpot worden gestuurd. We verdienen geld door een tekenproces aan te bieden. De commissie van onze service is 10% voor het opnemen van winsten naar de bitcoin-portemonnee van de winnaar van een bepaalde loterijtrekking. Zoals de meeste succesvolle internetbronnen, hebben we een loyaliteitsprogramma voor partners die onze service helpen ontwikkelen. <span class=\"red_text\">We betalen een beloning voor elke speler die een lot heeft gekocht, ongeacht of hij heeft gewonnen, aangetrokken door een partner, een speler of niet.</span> Dankzij ons partnerprogramma kan iedereen inkomsten ontvangen uit de online loterij van Lotobot.'),
(5297, 16, 9, 'RULES_TITLE', 'Onze regels zijn heel eenvoudig.'),
(5298, 16, 9, 'RULE_1', 'We betalen 50% van de inkomsten van de speler, wat 5% is van de kosten van door hem gekochte tickets. De kosten van het lot zijn 50.000 Satoshi, onze commissie is 10% of 5.000 Satoshi en we betalen de helft van dit bedrag aan de partner die de speler heeft aangetrokken. Dat wil zeggen dat uw inkomen van elke deelnemer aan de loterij die wordt aangetrokken en betaald voor uw ticket, 2500 Satoshi zal zijn.'),
(5299, 16, 9, 'RULE_2', 'We hebben geen beperkingen op het bedrag van de betaling, dus u kunt de ontvangen inkomsten zelfs van een betrokken loterijpartner intrekken.'),
(5300, 16, 9, 'RULE_3', 'De opbouw van inkomsten vindt plaats onmiddellijk na het einde van de trekking, waarin het ticket door de betrokken speler is gekocht.'),
(5301, 16, 9, 'RULE_4', 'Betaling van de ontvangen verwijzingsinkomsten wordt uitgevoerd op de Bitcoin-portemonnee die is opgegeven bij het aanvragen van een opname van geld.'),
(5302, 16, 9, 'RULE_5', 'De maximale betalingstermijn is 24 uur na ontvangst van een verzoek tot intrekking van inkomsten.'),
(5303, 16, 9, 'CHECK_TITLE', 'Het is gemakkelijk om ons te bekijken'),
(5304, 16, 9, 'CHECK_DESCRIPTION', 'Om er zeker van te zijn dat elke speler die op de verwijzingslink klikt, wordt opgenomen in de lijst met door u aangetrokken, koopt u gewoon een van de loten via uw verwijzingslink en u zult het lot meteen zien in de lijst met aangetrokken.'),
(5305, 16, 9, 'BECOME_PARTNER_TITLE', 'Onze partner worden is eenvoudig'),
(5306, 16, 9, 'BECOME_PARTNER_DESCRIPTION', 'Om lid te worden van ons partnerprogramma is het enige dat u nodig hebt om een ​​verwijzingslink te krijgen. Geef uw e-mailadres op om toegang te krijgen tot de service, schrijf het in het juiste veld van het onderstaande formulier en klik op \"Partner worden\". Daarna ontvangt u een uniek wachtwoord en een verwijzingslink. U hoeft alleen nog maar de ontvangen link te delen op de forums, in chatrooms, op sociale netwerken en inkomsten te ontvangen van elke aangetrokken loterijpartner. U kunt uw verwijzingsinkomen onmiddellijk intrekken na het passeren van de loterij waarbij de verwijzing die u hebt aangetrokken, een ticket heeft gekocht.'),
