(5474, 17, 1, 'SQUARE6', 'Comisionul de serviciu este de doar 10%. Încasat în momentul în care premiul este transferat câștigătorului.'),
(5475, 17, 1, 'HOW_IT_WORKS', 'Cum funcționează loteria'),
(5476, 17, 1, 'RULE1', 'Alegeți tipul de loterie: o dată pe săptămână, o dată pe lună sau o dată la trei luni.'),
(5477, 17, 1, 'RULE2', 'Alegeți 7 cifre de la 0 la 99 și completați câmpurile bilete goale cu cifrele selectate.'),
