(5480, 17, 1, 'RULE5', 'De îndată ce plata va trece de 3 confirmări în rețeaua Bitcoin, biletul achiziționat va fi adăugat la desen și suma plătită va fi adăugată la fondul de premii.'),
(5481, 17, 1, 'RULE6_1', 'La sfârșitul perioadei de vânzare a loteriei și a biletelor, Lotobot va calcula hash-ul md5 pentru fiecare bilet de loterie din loterie și, comparându-le cu hash-ul md5, suma tuturor biletelor de loterie, va determina combinațiile câștigătoare. Detalii despre cum obținem hash-ul md5 pentru fiecare bilet pot fi citite '),
(5482, 17, 1, 'RULE6_2', 'pe această pagină'),
(5483, 17, 1, 'RULE7', 'Lotobot va distribui fondul de premiere în funcție de apropierea hash-ului din suma fiecărui bilet individual la hașa loteriei totale. Hash Suma întregii loterii se calculează ca hash md5 din suma tuturor biletelor vândute în loterie. Cel mai apropiat va primi 50% din fondul de premiere, al doilea cel mai apropiat 30% și al treilea 20%.'),
