(5485, 17, 1, 'DETAIL_RULES', 'vezi reguli detaliate'),
(5486, 17, 1, 'OPPORTUNITY', 'Fiecare tragere la sorți a Lotobot este o oportunitate de a prinde noroc! Nu ratați fericita voastră șansă! Alegeți-vă loteria și cumpărați un bilet chiar acum.'),
