(5552, 17, 6, 'ALGORITHM_WIKI', 'Articolul Wikipedia'),
(5553, 17, 6, 'ALGORITHM_2', 'Puteți experimenta întotdeauna cu numere și linii hashing pe unul dintre numeroasele servicii de pe Internet. Le puteți găsi folosind '),
