(5555, 17, 6, 'MD5_GOOGLE_LINK', 'https://www.google.ro/search?q=md5+online&oq=md5+online'),
(5556, 17, 6, 'STEP_3', 'În a treia etapă, ștergem toate caracterele, cu excepția cifrelor din șirul md5 rezultat și obținem un număr mare'),
(5557, 17, 6, 'STEP_4', 'În pasul patru, eliminăm toate zerourile de la început și sfârșit, dacă există. În cel de-al patrulea pas obținem numărul final, acest număr va participa la loterie'),
(5558, 17, 6, 'INFOGRAPHICS_TITLE', 'Înțelegem că acest algoritm este destul de confuz și complicat, dar garantează absența posibilității de falsificare a biletelor de loterie și prezice o combinație câștigătoare.'),
(5559, 17, 6, 'SELECTED_NUMS', 'Numere selectate'),
(5560, 17, 6, 'STEP', 'pas'),
(5561, 17, 6, 'PAGE_DESCRIPTION', 'Cum obținem numărul care participă la loteria Lotobot. Hash MD5 este utilizat pentru a converti numerele biletului și numărul final pentru tragerea la sorți.'),
(5562, 17, 6, 'PAGE_KEYWORDS', 'numărul pentru desen, numărul pentru tragerea la loterie, conversia numerelor de bilete'),
(5563, 17, 7, 'TITLE_HEADER', 'Reguli Loteria Loteria Bitcoin'),
(5564, 17, 7, 'TITLE', 'Reguli Loteria Loteria Bitcoin'),
(5565, 17, 7, 'TERMS_TITLE', 'Termeni și definiții'),
(5566, 17, 7, 'TERMS_1', 'Lotobot Lottery este un joc care are loc într-o anumită perioadă de timp, după care există o distribuție a câștigurilor colectate între jucătorii care au achiziționat bilete de loterie.'),
(5567, 17, 7, 'TERMS_2', 'Tragerea la sorți este un proces de determinare a câștigătorilor în rândul participanților care au cumpărat la timp un bilet la o loterie specifică.'),
(5568, 17, 7, 'TERMS_3', 'Un bilet de loterie este un set de date necesare pentru a participa la o loterie.'),
(5569, 17, 7, 'TERMS_4', 'Hash optimizat md5 este o secvență de numere obținute prin conversia seriei de numere originale folosind algoritmul hash md5. Puteți citi în detaliu cum obținem hash-ul md5 optimizat. '),
(5570, 17, 7, 'TERMS_5', 'Linia de număr a biletului de loterie este numerele indicate pe biletul de loterie, colectate într-o linie în aceeași secvență în care au fost înscrise în biletul de loterie la momentul achiziției.'),
(5571, 17, 7, 'TERMS_6', 'Un hash md5 optimizat al unei trageri de loterie este o succesiune de numere obținute prin optimizarea hash-ului md5 a sumei tuturor liniilor de numere din toate biletele de loterie ale unei anumite trageri.'),
(5572, 17, 7, 'TERMS_7', 'Un hash de bilet md5 optimizat este o secvență de numere obținute dintr-un șir de numere ale unui bilet de loterie specific folosind algoritmul hash md5. În cadrul loteriei Lotobot, hash-ul biletului md5 optimizat se numește NUMĂRUL CARE PARTICIPĂ LA CÂȘTIGĂRI. Puteți citi în detaliu cum obținem numărul care participă la desen. '),
(5573, 17, 7, 'TERMS_8', 'Fondul de premiere este suma plătită câștigătorilor desenului după finalizarea acestuia. Fondul de premiere reprezintă suma costurilor tuturor biletelor de loterie vândute într-o anumită loterie.'),
(5574, 17, 7, 'RULES_TITLE', 'Regulile Loteriei'),
(5575, 17, 7, 'RULES_1', 'Fiecare remiză are un timp limitat.'),
(5576, 17, 7, 'RULES_2', 'Fiecare loterie atrage un număr nelimitat de bilete de loterie.'),
(5577, 17, 7, 'RULES_3', 'Biletul de loterie este valabil și participă la desen doar după 3 confirmări acceptate de plată în rețeaua Bitcoin.'),
(5578, 17, 7, 'RULES_4', 'Biletele ale căror 3 confirmări de plată în rețeaua Bitcoin au trecut după data extragerii nu sunt valide și nu participă la tragerea la sorți.'),
(5579, 17, 7, 'RULES_5', 'În fiecare bilet de loterie, titularul de bilet indică 7 numere de la 0 la 99, care constituie baza pentru numărul care este implicat în loterie. Numărul primit și biletul vândut corespunzător acestuia participă numai la tragerea la sorți în care a fost achiziționat biletul de loterie.'),
(5580, 17, 7, 'RULES_6', 'Fondul de premiere al extragerii este format din suma plăților Bitcoin plătite pentru toate biletele de loterie care participă la o anumită tragere la sorți.'),
(5581, 17, 7, 'RULES_7', 'Tragerea la sorți și distribuirea fondului de premiere are loc într-o perioadă care nu depășește 24 de ore de la data finalizării desenului.'),
(5582, 17, 7, 'RULES_8', 'În procesul de tragere a unei loterii, se formează un număr care participă la tragerea unei loterii pentru fiecare bilet de loterie vândut într-o anumită loterie. De asemenea, în timpul procesului de desen, este format un hash md5 optimizat al desenului de loterie.'),
(5583, 17, 7, 'RULES_9', 'Câștigătorii loteriei sunt determinați calculând modulul diferenței dintre numărul care participă la loterie pentru fiecare bilet de loterie vândut în loteria jucată și hașa md5 optimizată a biletului de loterie în care a fost cumpărat biletul de loterie.'),
(5584, 17, 7, 'RULES_10', 'În urma extragerii, prima categorie de câștigători este determinată ca fiind cel mai mic modul dintre diferența dintre numărul care participă la tragerea la loterie a unui bilet de loterie separat vândut în loterie, și hașa md5 optimizată a desenului de loterie în care a fost cumpărat biletul de loterie.'),
(5585, 17, 7, 'RULES_11', 'În urma tragerii la sorți, cea de-a doua categorie de câștigători este determinată ca al doilea modul cel mai mare din diferența dintre numărul care participă la tragerea la sorți a unui bilet de loterie separat vândut în loterie, și hașa md5 optimizată a tragerii de loterie în care a fost achiziționat biletul de loterie.'),
(5586, 17, 7, 'RULES_12', 'În urma tragerii la sorți, cea de-a treia categorie de câștigători este determinată ca cel de-al treilea modul cel mai mare din diferența dintre numărul care participă la tragerea la sorți a unui bilet de loterie separat vândut în loteria jucată și hașa md5 optimizată a tragerii la loterie în care a fost achiziționat biletul de loterie.'),
(5587, 17, 7, 'RULES_13', 'Fondul de premiere pentru desenarea unei loterii specifice este împărțit în trei categorii de câștigători, în conformitate cu următoarele:<br>- Prima categorie de câștigători - 50% din fondul de premiere;<br>- Cea de-a doua categorie de câștigători - 30% din fondul de premiere;<br>- A treia categorie de câștigători este 20% din fondul de premii.'),
(5588, 17, 7, 'RULES_14', 'Dacă doi sau mai mulți participanți la tragerea la sorți, diferența dintre numărul care participă la tragerea la loterie a unui bilet individual de loterie vândut în loteria care se joacă și hașa md5 optimizată a tragerii de loterie în care a fost achiziționat biletul de loterie coincide, câștigul se împarte proporțional între participanții cu module de potrivire în conformitate cu categoria câștigurilor.'),
(5589, 17, 7, 'RULES_15_1', 'Rezultatele unui desen de loterie specific sunt publicate pe site-ul loteriei Lotobot.io din pagină '),
(5590, 17, 7, 'RULES_15_2', ' și sunt afișate după indicarea numărului de loterie în care a fost achiziționat biletul de loterie.'),
(5591, 17, 7, 'RULES_16_1', 'Plata premiului către participantul la loterie care are dreptul să primească un premiu din orice categorie se efectuează exclusiv după o cerere trimisă din pagină '),
(5592, 17, 7, 'RULES_16_2', ' și numai la portofelul Bitcoin indicat în formularul de solicitare la completarea acestuia. Plata se face în cel mult 24 de ore de la primirea cererii de plată a câștigurilor.'),
(5593, 17, 7, 'RULES_17', 'Comisionul pentru retragerea câștigurilor din portofelul bitcoin al proprietarului unui bilet de loterie îndreptățit să primească un câștig este de 10%.'),
(5594, 17, 7, 'PAGE_DESCRIPTION', 'Reguli, definiții și definiții Bitcoin Lotobot. Citiți pentru a afla cum să jucați și să câștigați la loteria bitcoin.'),
(5595, 17, 7, 'PAGE_KEYWORDS', 'reguli de lotobot, reguli de loterie, reguli de lotobot, cum să joci lotobot'),
(5596, 17, 8, 'TITLE_HEADER', 'Vizualizați detaliile biletului achiziționat'),
(5597, 17, 8, 'REQUEST_ERROR', 'Ne pare rău, nu am putut primi detaliile biletului. Încercați din nou mai târziu.'),
(5598, 17, 8, 'DATA_ERROR', 'Datele introduse sunt incorecte. Verificați datele introduse și încercați din nou.'),
(5599, 17, 0, 'TICKET_DATA', 'Detaliile biletului'),
(5600, 17, 8, 'SUBTITLE', 'Pentru a vizualiza informații despre biletul de loterie achiziționat, introduceți datele din verificarea în formularul de mai jos.'),
(5601, 17, 8, 'SHOW_ANOTHER_TICKET', 'Afișați un alt bilet'),
(5602, 17, 8, 'PAGE_DESCRIPTION', 'Ai uitat detaliile biletului pentru Lotobot? Aici puteți vedea toate informațiile de pe biletul de loterie achiziționat.'),
(5603, 17, 8, 'PAGE_KEYWORDS', 'bilet lotobot, detalii bilet lotobot, informații bilet lotobot, tipărire bilet lotobot'),
(5604, 17, 9, 'TITLE_HEADER', 'Programul de afiliere Lotobot. Câștigă cu noi'),
(5605, 17, 9, 'ERROR_PARTNER_ACCOUNT', 'Din păcate, nu am putut crea un cont de afiliere. Încercați din nou mai târziu.'),
(5606, 17, 9, 'MADE_PARTNER_ACCOUNT', 'Un cont de partener cu un astfel de e-mail este deja înregistrat.'),
(5607, 17, 9, 'TITLE', 'Câștigă cu noi'),
(5608, 17, 9, 'SUBTITLE', 'Alăturați-vă programului de afiliere la loteria Lotobot și obțineți 50% din profitul fiecărui participant la loterie atras'),
(5609, 17, 9, 'DESCRIPTION', 'Lotobot este o loterie online cu un fond de premii de 100%, ceea ce înseamnă că toate fondurile plătite de jucătorii de loterie vor fi trimise la fondul de premii. Facem bani prin asigurarea unui proces de desen. Comisionul serviciului nostru este de 10% pentru retragerea câștigurilor din portofelul bitcoin al câștigătorului unei anumite trageri la sorti. Ca majoritatea resurselor de internet de succes, avem un program de fidelizare pentru parteneri care ajută la dezvoltarea serviciului nostru. <span class=\"red_text\">Plătim o recompensă pentru fiecare jucător care a cumpărat un bilet de loterie, indiferent dacă a câștigat, atras de un partener, de un jucător sau nu.</span> Datorită programului nostru de afiliere, toată lumea poate primi venituri din loteria online Lotobot.'),
(5610, 17, 9, 'RULES_TITLE', 'Regulile noastre sunt foarte simple.'),
(5611, 17, 9, 'RULE_1', 'Plătim 50% din veniturile primite de la jucător, ceea ce reprezintă 5% din costul biletelor achiziționate de acesta. Costul biletului de loterie este de 50.000 Satoshi, comisionul nostru este de 10% sau 5.000 Satoshi, iar noi plătim jumătate din această sumă partenerului care a atras jucătorul. Adică, venitul dvs. de la fiecare participant la loterie atras și plătit pentru biletul dvs. va fi de 2500 Satoshi.'),
(5612, 17, 9, 'RULE_2', 'Nu avem restricții cu privire la valoarea plății, așa că puteți retrage veniturile primite chiar și de la un participant la loterie implicat.'),
(5613, 17, 9, 'RULE_3', 'Încasarea veniturilor apare imediat după încheierea extragerii, în care biletul a fost achiziționat de jucătorul implicat.'),
(5614, 17, 9, 'RULE_4', 'Plata venitului de referință primit se efectuează pe portofelul Bitcoin specificat la solicitarea retragerii fondurilor.'),
(5615, 17, 9, 'RULE_5', 'Perioada maximă de plată este de 24 de ore de la primirea unei cereri de retragere a veniturilor.'),
(5616, 17, 9, 'CHECK_TITLE', 'Este ușor să ne verificăm'),
(5617, 17, 9, 'CHECK_DESCRIPTION', 'Pentru a fi sigur că fiecare jucător care face clic pe linkul de recomandare va fi inclus în lista de atracți de tine, trebuie doar să cumperi unul dintre biletele de loterie prin link-ul de recomandare și vei vedea imediat biletul de loterie în lista celor atrași.'),
(5618, 17, 9, 'BECOME_PARTNER_TITLE', 'A deveni partenerul nostru este ușor'),
(5619, 17, 9, 'BECOME_PARTNER_DESCRIPTION', 'Pentru a deveni membru al programului nostru de afiliere, tot ce ai nevoie este să obții un link de trimitere. Indicați e-mailul dvs. pentru a intra în serviciu, scrieți-l în câmpul corespunzător al formularului de mai jos și faceți clic pe \"Deveniți partener\". După aceea, veți primi o parolă unică și un link de trimitere. Tot ce vă rămâne este să împărtășiți link-ul primit pe forumuri, în camerele de chat, pe rețelele de socializare și să primiți venituri de la fiecare participant la loterie atras. Veți putea să vă retrageți veniturile din recomandări imediat după trecerea tombolei în care sesizarea atrasă a cumpărat un bilet.'),
(5620, 17, 9, 'PAGE_DESCRIPTION', 'Programul de trimitere Loteria Bitcoin Lotobot este o modalitate convenabilă de a face profit pentru webmasteri și bloggeri. Cum să devii partener și să câștigi bani de la jucători atrași.'),
