(5879, 18, 7, 'TERMS_1', 'Lotobot Loterie je hra, která se odehrává v určitém časovém období, po kterém se rozdělí získané výher mezi hráče, kteří si zakoupili loterijní tikety.'),
(5880, 18, 7, 'TERMS_2', 'Kreslení loterií je proces určování vítězů mezi účastníky, kteří si koupili loterijní lístek včas pro konkrétní loterii.'),
(5881, 18, 7, 'TERMS_3', 'Loterie je sada dat nezbytných pro účast v loterii.'),
(5882, 18, 7, 'TERMS_4', 'Optimalizovaný hash md5 je posloupnost čísel získaných převodem původní řady čísel pomocí algoritmu hash md5. Můžete si detailně přečíst, jak získáme optimalizovaný hash md5. '),
(5883, 18, 7, 'TERMS_5', 'Linka s číselným číslem loterie je čísla uvedená v loterijním lístku, shromážděná na řádku ve stejném pořadí, v jakém byla zadána na loterijním lístku v době nákupu.'),
(5884, 18, 7, 'TERMS_6', 'Optimalizovaný hash md5 loterijního losování je posloupnost čísel získaných optimalizací hash md5 součtu všech řádků čísel ze všech loterních losů konkrétního losování.'),
(5885, 18, 7, 'TERMS_7', 'Optimalizovaný hash lístku md5 je posloupnost čísel získaných z řetězce čísel konkrétní loterijní lístky pomocí algoritmu hash md5. V loterii Lotobot se optimalizovaný hash lístku md5 nazývá ČÍSLO, KTERÝM SE ZÍSKÁ. Můžete si detailně přečíst, jak získáme číslo, které se podílí na výkresu. '),
(5886, 18, 7, 'TERMS_8', 'Výherní fond je částka vyplacená vítězem losování po jeho dokončení. Výherní fond je součtem nákladů na všechny loterijní lístky prodané v konkrétní loterii.'),
(5887, 18, 7, 'RULES_TITLE', 'Pravidla loterie'),
(5888, 18, 7, 'RULES_1', 'Každé losování má omezené množství času.'),
(5889, 18, 7, 'RULES_2', 'Každá loterie čerpá neomezený počet loterií.'),
(5890, 18, 7, 'RULES_3', 'Loterie je platná a účastní se losování až po 3 přijatých potvrzeních o platbě v bitcoinové síti.'),
(5891, 18, 7, 'RULES_4', 'Lístky, jejichž 3 potvrzení o platbě v bitcoinové síti prošly po datu losování, jsou neplatné a neúčastní se losování.'),
(5892, 18, 7, 'RULES_5', 'V každé loterijní kartě držitel vstupenky uvede 7 čísel od 0 do 99, které tvoří základ pro číslo, které se účastní loterie. Přijaté číslo a prodaný lístek, který s ním odpovídá, se účastní pouze losování, ve kterém byla loterijní karta zakoupena.'),
(5893, 18, 7, 'RULES_6', 'Výherní fond losování je tvořen částkou bitcoinových plateb zaplacených za všechny loterijní vstupenky účastnící se konkrétního losování.'),
(5894, 18, 7, 'RULES_7', 'Losování a distribuce výherního fondu probíhá v období nepřesahujícím 24 hodin po datu dokončení losování.'),
(5895, 18, 7, 'RULES_8', 'Při losování loterie se vytvoří číslo, které se účastní losování loterie pro každou loterijní lístek prodaný v konkrétní loterii. Také během procesu kreslení se vytvoří optimalizovaný hash loterního kreslení md5.'),
(5896, 18, 7, 'RULES_9', 'Vítězové loterie jsou stanoveni výpočtem modulu rozdílu mezi počtem účastnících se v loterii pro každou loterijní jízdenku prodanou v loterii, která se hraje, a optimalizovanou md5 hash loterie, ve které byla loterijní jízdenka zakoupena.'),
(5897, 18, 7, 'RULES_10', 'V důsledku losování je první kategorie výherců určena jako nejmenší modul rozdílu mezi počtem účastnících se loterijního losování samostatného loterijního lístku prodaného v hrané loterii a optimalizovaným hashováním md5 loterijního losování, ve kterém byla loterijní los zakoupena.'),
(5898, 18, 7, 'RULES_11', 'V důsledku losování je druhá kategorie výherců určena jako druhý největší modul rozdílu mezi počtem účastnících se loterijního losování samostatného loterijního lístku prodaného v hrané loterii a optimalizovaným hašováním md5 loterijního losování, ve kterém byla loterijní los zakoupena.'),
(5899, 18, 7, 'RULES_12', 'V důsledku losování je třetí kategorie výherců určena jako třetí největší modul rozdílu mezi počtem účastnících se loterijního losování samostatného loterijního lístku prodaného v hrané loterii a optimalizovaným hašováním md5 loterijního losování, ve kterém byla loterijní los zakoupena.'),
(5900, 18, 7, 'RULES_13', 'Výherní fond pro losování konkrétní loterie je rozdělen do tří kategorií výherců v následujícím souladu:<br>- První kategorie vítězů - 50% z výherní skupiny;<br>- Druhá kategorie vítězů - 30% z výherní skupiny;<br>- Třetí kategorií vítězů je 20% z výherní skupiny.'),
(5901, 18, 7, 'RULES_14', 'Pokud losují dva nebo více účastníků loterie, rozdíl mezi počtem účastnících se loterijního losování jednotlivých loterijních vstupenek prodaných v hrané loterii a optimalizovaným hašováním md5 loterijního losování, ve kterém byla loterijní loterie zakoupena, se vítězství úměrně rozdělí mezi účastníci s odpovídajícími moduly v souladu s kategorií výher.'),
(5902, 18, 7, 'RULES_15_1', 'Výsledky konkrétní loterijní kresby jsou zveřejněny na webových stránkách loterie Lotobot.io na stránce '),
(5903, 18, 7, 'RULES_15_2', ' a jsou zobrazeny po zadání čísla loterie, ve kterém byl loterijní lístek zakoupen.'),
(5904, 18, 7, 'RULES_16_1', 'Výplata ceny účastníkovi loterie, který má nárok na výhru jakékoli kategorie, se provádí výhradně na základě žádosti odeslané ze stránky. '),
(5905, 18, 7, 'RULES_16_2', ' a pouze při vyplňování bitcoinové peněženky uvedené ve formuláři žádosti. Platba se provádí nejpozději do 24 hodin od přijetí žádosti o výplatu výher.'),
