(5918, 18, 9, 'ERROR_PARTNER_ACCOUNT', 'Bohužel se nám nepodařilo vytvořit přidružený účet. Zkuste to prosím znovu později.'),
(5919, 18, 9, 'MADE_PARTNER_ACCOUNT', 'Partnerský účet s tímto e-mailem je již zaregistrován.'),
(5920, 18, 9, 'TITLE', 'Vydělávejte s námi'),
(5921, 18, 9, 'SUBTITLE', 'Připojte se k partnerskému programu loterie Lotobot a získejte 50% zisku od každého přitažlivého účastníka loterie'),
(5922, 18, 9, 'DESCRIPTION', 'Lotobot je online loterie se 100% výherním fondem, což znamená, že všechny finanční prostředky placené hráči loterií budou zaslány do výherního fondu. Vyděláváme peníze poskytováním procesu kreslení. Provize naší služby je 10% za výběr výher bitcoinové peněžence vítěze určitého losování. Stejně jako nejúspěšnější internetové zdroje máme i věrnostní program pro partnery, který pomáhá rozvíjet naše služby. <span class=\"red_text\">Platíme odměnu za každého hráče, který si zakoupil loterijní los, bez ohledu na to, zda vyhrál, přilákal partnera, hráče nebo ne.</span> Díky našemu přidruženému programu může každý získat příjem z online loterie Lotobot.'),
(5923, 18, 9, 'RULES_TITLE', 'Naše pravidla jsou velmi jednoduchá.'),
(5924, 18, 9, 'RULE_1', 'Platíme 50% z příjmů získaných od hráče, což je 5% z ceny jím zakoupených vstupenek. Cena loterie je 50 000 satoshi, naše provize je 10% nebo 5 000 satoshi a polovinu této částky platíme partnerovi, který hráče přilákal. To znamená, že váš příjem od každého účastníka loterie přitahovaného a zaplaceného za vaši vstupenku bude 2500 satoshi.'),
(5925, 18, 9, 'RULE_2', 'Nemáme žádné omezení, pokud jde o výši platby, takže si můžete vybrat přijatý příjem i od jednoho zúčastněného účastníka loterie.'),
(5926, 18, 9, 'RULE_3', 'K nárůstu příjmu dochází okamžitě po skončení losování, ve kterém hráč zakoupil lístek.'),
(5927, 18, 9, 'RULE_4', 'Platba přijatého příjmu z doporučení se provádí na bitcoinové peněžence určené při žádosti o výběr finančních prostředků.'),
(5928, 18, 9, 'RULE_5', 'Maximální doba splatnosti je 24 hodin po obdržení žádosti o výběr příjmů.'),
(5929, 18, 9, 'CHECK_TITLE', 'Je snadné nás zkontrolovat'),
(5930, 18, 9, 'CHECK_DESCRIPTION', 'Abyste si byli jisti, že každý hráč, který klikne na odkaz na doporučení, bude zahrnut do seznamu, který vás zaujal, stačí si přes odkaz na odkaz zakoupit jeden z loterijních lístků a okamžitě uvidíte loterijní lístek v seznamu přitažlivých.'),
(5931, 18, 9, 'BECOME_PARTNER_TITLE', 'Stát se naším partnerem je snadné'),
(5932, 18, 9, 'BECOME_PARTNER_DESCRIPTION', 'Chcete-li se stát členem našeho přidruženého programu, potřebujete pouze odkaz na doporučení. Uveďte svůj e-mail pro vstup do služby, napište ji do příslušného pole níže uvedeného formuláře a klikněte na \"Staňte se partnerem\". Poté obdržíte jedinečné heslo a odkaz na doporučení. Zbývá vám pouze sdílet přijatý odkaz na fórech, v chatovacích místnostech, na sociálních sítích a získat příjem od každého zúčastněného účastníka loterie. Budete mít možnost vybrat svůj příjem z doporučení okamžitě po absolvování tomboly, v níž doporučení, které jste přilákali, zakoupilo lístek.'),
(5933, 18, 9, 'PAGE_DESCRIPTION', 'Referenční program Bitcoinová loterie Lotobot je pohodlný způsob, jak dosáhnout zisku pro webmastery a blogery. Jak se stát partnerem a vydělávat peníze od přitažlivých hráčů.'),
