(6823, 21, 7, 'TERMS_6', '복권 추첨의 md5 해시 최적화는 특정 추첨의 모든 복권 티켓에서 모든 문자열의 합계의 md5 해시를 최적화하여 얻은 일련의 숫자입니다.'),
(6824, 21, 7, 'TERMS_7', '최적화 된 md5 티켓 해시는 md5 해시 알고리즘을 사용하여 특정 복권 티켓의 숫자 문자열에서 얻은 일련의 숫자입니다. Lotobot 복권 내에서 최적화 된 md5 티켓 해시는 수상에 참여한 번호라고합니다. 도면에 참여하는 숫자를 얻는 방법을 자세히 읽을 수 있습니다 '),
(6825, 21, 7, 'TERMS_8', '상금은 완료 후 그림의 승자에게 지불되는 금액입니다. 상금 풀은 특정 복권에서 판매 된 모든 복권 티켓 비용의 합계입니다.'),
