(6830, 21, 7, 'RULES_4', '비트 코인 네트워크에서 지불 확인이 3 회 이루어진 티켓은 추첨 날짜 이후에 유효하지 않으며 추첨에 참여하지 않습니다.'),
(6831, 21, 7, 'RULES_5', '각 복권 티켓에서, 티켓 소지자는 0에서 99까지 7 개의 숫자를 나타내며, 이는 복권에 관련된 숫자의 기초를 형성합니다. 접수 된 번호와 이에 상응하는 판매 티켓은 복권을 구매 한 복권 추첨에만 참여합니다.'),
(6832, 21, 7, 'RULES_6', '추첨의 상금은 특정 추첨에 참여하는 모든 복권에 지불 된 비트 코인 지불 금액으로 구성됩니다.'),
(6833, 21, 7, 'RULES_7', '추첨 기금의 추첨 및 배포는 추첨 완료 후 24 시간을 초과하지 않는 기간에 이루어집니다.'),
(6834, 21, 7, 'RULES_8', '복권 추첨 과정에서 특정 복권으로 판매되는 각 복권 티켓에 대한 복권 추첨에 참여하는 숫자가 형성됩니다. 또한 드로잉 프로세스 동안, 복권 드로잉의 최적화 된 md5 해시가 형성됩니다.'),
