(6837, 21, 7, 'RULES_11', '추첨의 결과로, 두 번째 우승자 카테고리는 추첨에서 판매되는 별도의 복권 티켓의 추첨 추첨에 참여하는 수와 추첨 티켓을 구매 한 추첨 추첨의 md5 해시 간의 차이 중 두 번째로 큰 모듈로 결정됩니다.'),
