(6839, 21, 7, 'RULES_13', '특정 복권 추첨을위한 상금은 다음과 같이 3 가지 범주의 수상자로 나뉩니다.<br>- 우승자의 첫 번째 범주-상금의 50 %;<br>- 우승자의 두 번째 카테고리-상금의 30 %;<br>- 우승자의 세 번째 범주는 상금 풀의 20 %입니다.'),
(6840, 21, 7, 'RULES_14', '추첨 추첨의 두 명 이상의 참가자, 추첨에서 판매 된 개별 추첨 티켓의 추첨 추첨에 참여한 수와 추첨 티켓을 구매 한 추첨 추첨의 최적화 된 md5 해시의 차이가 일치하면 승리는 상금 범주에 따라 일치하는 모듈을 가진 참가자.'),
