(6843, 21, 7, 'RULES_16_1', '모든 범주의 상품을받을 자격이있는 복권 참가자에게 상품을 지불하는 것은 페이지에서 요청을 보낸 후에 만 수행됩니다. '),
(6844, 21, 7, 'RULES_16_2', ' 요청 양식에 표시된 Bitcoin 지갑에만 채울 수 있습니다. 상금 지불 요청을받은 후 24 시간 이내에 지불이 이루어집니다.'),
