(6857, 21, 9, 'ERROR_PARTNER_ACCOUNT', '유감스럽게도 제휴사 계정을 만들 수 없었습니다. 나중에 다시 시도하십시오.'),
(6858, 21, 9, 'MADE_PARTNER_ACCOUNT', '해당 이메일의 파트너 계정이 이미 등록되어 있습니다.'),
(6859, 21, 9, 'TITLE', '우리와 함께 적립'),
(6860, 21, 9, 'SUBTITLE', 'Lotobot 복권 제휴 프로그램에 가입하고 각 추첨 된 복권 참가자로부터 50 %의 수익을 올리십시오'),
(6861, 21, 9, 'DESCRIPTION', 'Lotobot은 100 % 상금 풀이있는 온라인 복권입니다. 즉, 복권 플레이어가 지불 한 모든 자금이 상금 풀로 전송됩니다. 우리는 그리기 과정을 제공함으로써 돈을 버는 것입니다. 당사 복무 수수료는 특정 복권 추첨 당첨자의 비트 코인 지갑으로 당첨금을 인출하는 데 10 %입니다. 대부분의 성공적인 인터넷 리소스와 마찬가지로 서비스 개발을 돕는 파트너를위한 로열티 프로그램이 있습니다. <span class=\"red_text\">우리는 복권을 구입 한 각 플레이어에 대해, 파트너, 플레이어에 의해 끌 렸는지 여부에 관계없이 복권을 구입했습니다.</span> 제휴 프로그램 덕분에 누구나 Lotobot 온라인 복권에서 수입을 얻을 수 있습니다.'),
(6862, 21, 9, 'RULES_TITLE', '우리의 규칙은 매우 간단합니다.'),
(6863, 21, 9, 'RULE_1', '우리는 플레이어로부터받은 수입의 50 %를 지불하는데, 이는 그 사람이 구매 한 티켓 비용의 5 %입니다. 복권 비용은 사토시 50,000이며, 커미션은 10 % 또는 사토시 5,000이며,이 금액의 절반을 플레이어를 유치한 파트너에게 지불합니다. 즉, 귀하의 티켓에 대해 유치 및 지불 된 각 복권 참가자의 수입은 2500 Satoshi입니다.'),
(6864, 21, 9, 'RULE_2', '우리는 지불 금액에 제한이 없으므로, 당신은 한 복권 참가자 한 명으로부터받은 소득을 인출 할 수 있습니다.'),
(6865, 21, 9, 'RULE_3', '수입이 발생하면 추첨이 끝난 직후에 관련 플레이어가 티켓을 구입 한 직후에 발생합니다.'),
(6866, 21, 9, 'RULE_4', '받은 추천 수입의 지불은 자금 인출을 요청할 때 지정된 비트 코인 지갑에서 수행됩니다.'),
(6867, 21, 9, 'RULE_5', '최대 지불 기간은 소득 철회 요청을받은 후 24 시간입니다.'),
(6868, 21, 9, 'CHECK_TITLE', '우리를 확인하기 쉽습니다.'),
(6869, 21, 9, 'CHECK_DESCRIPTION', '추천 링크를 클릭하는 각 플레이어가 귀하의 유인 목록에 포함되도록하려면 귀하의 추천 링크를 통해 복권 중 하나를 구입하면 유인 목록에서 복권을 즉시 볼 수 있습니다.'),
(6870, 21, 9, 'BECOME_PARTNER_TITLE', '파트너가되는 것은 쉽다'),
(6871, 21, 9, 'BECOME_PARTNER_DESCRIPTION', '제휴 프로그램 회원이 되려면 추천 링크를 받으면됩니다. 아래 양식의 해당 필드에 이메일을 작성하여 서비스에 들어가고 클릭하여 파트너가 되십시오. 그 후에는 고유 한 비밀번호와 추천 링크를 받게됩니다. 귀하에게 남아있는 것은 포럼, 대화방, 소셜 네트워크에서 수신 된 링크를 공유하고 각 관련 복권 참가자로부터 수입을받는 것입니다. 유치한 추천이 티켓을 구매 한 추첨을 통과 한 후 즉시 귀하의 추천 소득을 인출 할 수 있습니다.'),
(6872, 21, 9, 'PAGE_DESCRIPTION', '추천 프로그램 비트 코인 복권 Lotobot은 웹 마스터와 블로거에게 이익을주는 편리한 방법입니다. 파트너가되고 유치한 플레이어로부터 돈을 벌 수있는 방법.'),
