(7130, 22, 7, 'TERMS_TITLE', 'Pojmy a definície'),
(7131, 22, 7, 'TERMS_1', 'Lotobotová lotéria je hra, ktorá sa koná v určitom časovom období, po ktorom je rozdelená získaná výhra medzi hráčov, ktorí si zakúpili lotériové lístky.'),
(7132, 22, 7, 'TERMS_2', 'Kreslenie lotérií je proces určovania víťazov medzi účastníkmi, ktorí si kúpili tiket načas pre konkrétnu lotériu.'),
