(7134, 22, 7, 'TERMS_4', 'Optimalizovaný hash md5 je postupnosť čísel získaných prevodom pôvodných číselných radov pomocou algoritmu hash md5. Môžete si prečítať podrobne, ako získame optimalizovaný hash md5 '),
(7135, 22, 7, 'TERMS_5', 'Číslo riadku s číselným údajom o lotérii je číslo uvedené na lotériovom lístku, ktoré sa zhromažďujú v riadku v rovnakom poradí, v akom boli zadané na lotériovom lístku v čase nákupu.'),
(7136, 22, 7, 'TERMS_6', 'Optimalizovaná md5 hash lotériového losovania je postupnosť čísel získaných optimalizáciou md5 hash súčtu všetkých riadkov čísel zo všetkých losovacích lístkov konkrétneho losovania.'),
(7137, 22, 7, 'TERMS_7', 'Optimalizovaný hašovací lístok md5 je postupnosť čísel získaných z reťazca čísiel konkrétneho lotériového lístka pomocou algoritmu hash md5. V lotérii lotérie sa optimalizovaný hash lístka md5 nazýva ČÍSLO, KTORÉ SA ÚČASTI NA VÝHRANÍ. Môžete si prečítať, ako získame číslo, ktoré sa zúčastňuje na výkrese '),
(7138, 22, 7, 'TERMS_8', 'Výherný fond je suma vyplatená výhercom losovania po jeho dokončení. Výherný fond je súčet nákladov na všetky lotériové lístky predané v konkrétnej lotérii.'),
(7139, 22, 7, 'RULES_TITLE', 'Pravidlá lotérie'),
(7140, 22, 7, 'RULES_1', 'Každá remíza má obmedzené množstvo času.'),
(7141, 22, 7, 'RULES_2', 'Každá lotéria čerpá neobmedzený počet lotériových lístkov.'),
(7142, 22, 7, 'RULES_3', 'Lotériový lístok je platný a zúčastňuje sa na žrebovaní až po 3 akceptovaných potvrdeniach o platbe v bitcoínovej sieti.');
INSERT INTO `content` (`id_content_block`, `id_lang`, `id_page`, `name_content_block`, `value_content_block`) VALUES
(7143, 22, 7, 'RULES_4', 'Lístky, ktorých 3 potvrdenia o platbe v bitcoínovej sieti prešli po dátume žrebovania, sú neplatné a nezúčastňujú sa žrebovania.'),
(7144, 22, 7, 'RULES_5', 'V každom lotériovom tikete majiteľ vstupenky uvedie 7 čísel od 0 do 99, ktoré tvoria základ pre prijatie čísla, ktoré sa zúčastňuje na lotérii. Prijaté číslo a predávaný lístok, ktorý sa naň vzťahuje, sa zúčastňuje iba žrebovania, v ktorom bol žreb zakúpený.'),
(7145, 22, 7, 'RULES_6', 'Výherný fond žrebovania je tvorený sumou bitcoinových platieb zaplatených za všetky lotériové lístky zúčastňujúce sa konkrétneho žrebovania.'),
(7146, 22, 7, 'RULES_7', 'Žrebovanie a distribúcia výherného fondu sa uskutočňuje v období nepresahujúcom 24 hodín od dátumu ukončenia žrebovania.'),
(7147, 22, 7, 'RULES_8', 'V procese žrebovania sa vytvorí číslo, ktoré sa podieľa na žrebovaní pre každú žrebovú lotériu predanú v konkrétnej lotérii. Tiež počas procesu kreslenia sa vytvára optimalizovaný hash md5 losovania.'),
(7148, 22, 7, 'RULES_9', 'Výhercovia lotérie sa určia vypočítaním modulu rozdielu medzi počtom, ktorý sa zúčastňuje na lotérii pre každú lotériovú vstupenku predanú v lotérii, ktorá sa hrá, a optimalizovanou md5 hašovanou lotériovou vstupenkou, v ktorej sa kúpil lotériový lístok.'),
(7149, 22, 7, 'RULES_10', 'V dôsledku žrebovania je prvá kategória výhercov určená ako najmenší modul rozdielu medzi počtom, ktorý sa zúčastňuje na losovaní samostatného žrebovania predaného v hranej lotérii, a optimalizovaným hašovaním md5 žrebovania, v ktorom bol žreb zakúpený.'),
(7150, 22, 7, 'RULES_11', 'V dôsledku žrebovania je druhá kategória výhercov určená ako druhý najväčší modul rozdielu medzi počtom, ktorý sa zúčastňuje žrebovania lotérie samostatného lotériového lístka predávaného v hranej lotérii, a optimalizovaným hašovaním md5 lotériového žrebovania, v ktorom sa lotériový lístok zakúpil.'),
(7151, 22, 7, 'RULES_12', 'V dôsledku žrebovania je tretia kategória výhercov určená ako tretí najväčší modul rozdielu medzi počtom, ktorý sa zúčastňuje žrebovania lotérie samostatného lotériového lístka predávaného v hranej lotérii, a optimalizovaným hašovaním md5 lotériového žrebovania, v ktorom sa losoval.'),
(7152, 22, 7, 'RULES_13', 'Výherný fond za losovanie konkrétnej lotérie je rozdelený do troch kategórií výhercov v tomto poradí:<br>- Prvá kategória víťazov - 50% z ceny;<br>- Druhá kategória víťazov - 30% z ceny;<br>- Treťou kategóriou víťazov je 20% z ceny.'),
(7153, 22, 7, 'RULES_14', 'Ak žrebujú dvaja alebo viacerí účastníci lotérie, rozdiel medzi počtom, ktorý sa zúčastňuje na žrebovaní jednotlivej žrebovej žetóny predanej v hranej lotérii a optimalizovaným hašovacím žrebom md5 žrebovania, v ktorom sa zakúpil žreb, sa výhra úmerne rozdelí medzi účastníci so zodpovedajúcimi modulmi podľa kategórie výher.'),
(7154, 22, 7, 'RULES_15_1', 'Výsledky konkrétneho losovania sú zverejnené na webovej stránke lotérie Lotobot.io na tejto stránke '),
(7155, 22, 7, 'RULES_15_2', ' a sú zobrazené po vyznačení čísla lotérie, v ktorej bol lotériový lístok zakúpený.'),
(7156, 22, 7, 'RULES_16_1', 'Výplata ceny účastníkovi lotérie, ktorý má právo na získanie ceny akejkoľvek kategórie, sa uskutoční výlučne na základe žiadosti odoslanej zo stránky. '),
(7157, 22, 7, 'RULES_16_2', ' a iba pri vkladaní bitcoínovej peňaženky uvedenej vo formulári žiadosti. Platba sa uskutoční najneskôr do 24 hodín od prijatia žiadosti o vyplatenie výhry.'),
(7158, 22, 7, 'RULES_17', 'Provízia za výber výhier na bitcoínovej peňaženke majiteľa lotériového lístka s nárokom na výhru je 10%.'),
