(7169, 22, 9, 'TITLE_HEADER', 'Pridružený program Lotobot. Zarábajte s nami'),
(7170, 22, 9, 'ERROR_PARTNER_ACCOUNT', 'Bohužiaľ sa nám nepodarilo vytvoriť pridružený účet. Skúste to znova neskôr.'),
(7171, 22, 9, 'MADE_PARTNER_ACCOUNT', 'Partnerský účet s takýmto e-mailom je už zaregistrovaný.'),
(7172, 22, 9, 'TITLE', 'Zarábajte s nami'),
(7173, 22, 9, 'SUBTITLE', 'Pripojte sa k pridruženému programu lotérie Lotte a získajte 50% zisku od každého pritiahnutého účastníka lotérie'),
(7174, 22, 9, 'DESCRIPTION', 'Lotobot je online lotéria so 100% prize poolom, čo znamená, že všetky finančné prostriedky zaplatené hráčmi v lotérii budú odoslané do prize pool. Zarábame peniaze poskytovaním procesu kreslenia. Provízia z našej služby je 10% z výberu výhier na bitcoínovú peňaženku výhercu určitého losovania. Rovnako ako najúspešnejšie internetové zdroje máme aj vernostný program pre partnerov, ktorý pomáha rozvíjať naše služby. <span class=\"red_text\">Platíme odmenu za každého hráča, ktorý si zakúpil lotériový lístok, bez ohľadu na to, či vyhral, pritiahol partnera, hráča alebo nie.</span> Vďaka nášmu pridruženému programu môže každý získať príjem z online lotérie Lotobot.'),
(7175, 22, 9, 'RULES_TITLE', 'Naše pravidlá sú veľmi jednoduché.'),
(7176, 22, 9, 'RULE_1', 'Platíme 50% z príjmu, ktorý hráč dostal, čo predstavuje 5% z ceny ním zakúpených vstupeniek. Cena za lotériový lístok je 50 000 satoshi, naša provízia je 10% alebo 5 000 satoshi a polovicu tejto sumy platíme partnerovi, ktorý pritiahol hráča. To znamená, že váš príjem z každého účastníka v lotérii, ktorý získal a zaplatil za lístok, bude 2500 satoshi.'),
(7177, 22, 9, 'RULE_2', 'Pokiaľ ide o výšku platby, nemáme žiadne obmedzenia, takže si môžete vybrať prijaté príjmy aj od jedného zúčastneného účastníka lotérie.'),
(7178, 22, 9, 'RULE_3', 'Prírastok príjmu nastáva okamžite po ukončení žrebovania, v ktorom hráč zakúpil lístok.'),
(7179, 22, 9, 'RULE_4', 'Platba prijatého príjmu zo sprostredkovania sa vykonáva na bitcoínovej peňaženke uvedenej pri žiadosti o výber prostriedkov.'),
(7180, 22, 9, 'RULE_5', 'Maximálna lehota splatnosti je 24 hodín od prijatia žiadosti o výber príjmu.'),
(7181, 22, 9, 'CHECK_TITLE', 'Je ľahké nás skontrolovať'),
(7182, 22, 9, 'CHECK_DESCRIPTION', 'Aby ste si boli istí, že každý hráč, ktorý klikne na odkaz so sprostredkovaním, bude zahrnutý do zoznamu, ktorý vás zaujal, kúpte si prostredníctvom odkazu na odkaz jeden z lotériových lístkov a okamžite uvidíte lotériový lístok v zozname prilákaných.'),
(7183, 22, 9, 'BECOME_PARTNER_TITLE', 'Stať sa našim partnerom je ľahké'),
(7184, 22, 9, 'BECOME_PARTNER_DESCRIPTION', 'Aby ste sa mohli stať členom nášho pridruženého programu, potrebujete iba odkaz na sprostredkovanie. Uveďte svoj e-mail, aby ste vstúpili do služby, napíšte ju do príslušného poľa formulára nižšie a kliknite na \"Staňte sa partnerom\". Potom dostanete jedinečné heslo a odkaz na odporúčanie. Zostáva vám iba zdieľať prijatý odkaz na fórach, v chatovacích miestnostiach, na sociálnych sieťach a získať príjem od každého zúčastneného účastníka lotérie. Svoj príjem zo sprostredkovania budete môcť vybrať okamžite po absolvovaní tomboly, v ktorej si kúpené lístky kúpili lístok.'),
(7185, 22, 9, 'PAGE_DESCRIPTION', 'Odporúčací program Bitcoinová lotéria Lotobot je pohodlný spôsob, ako dosiahnuť zisk pre webmasterov a blogerov. Ako sa stať partnerom a zarábať peniaze od priťahovaných hráčov.'),
