(7769, 23, 7, 'RULES_16_2', ' ve sadece doldururken istek formunda belirtilen Bitcoin cüzdanına. Ödeme, kazançların ödenmesi talebinin alınmasından itibaren en geç 24 saat içinde yapılır.'),
(7768, 23, 7, 'RULES_16_1', 'Ödülün herhangi bir kategoriden ödül almaya hak kazanan piyango katılımcısına ödenmesi, münhasıran sayfadan gönderilen bir talepten sonra gerçekleştirilir '),
(7767, 23, 7, 'RULES_15_2', ' ve piyango biletinin satın alındığı piyango numarası belirtildikten sonra görüntülenir.'),
(7766, 23, 7, 'RULES_15_1', 'Belirli bir piyango çiziminin sonuçları sayfadaki Lotobot.io piyangosunun web sitesinde yayınlanır. '),
(7765, 23, 7, 'RULES_14', 'Çekilişin iki veya daha fazla katılımcısı çekilirse, oynanan piyangoda satılan bireysel bir piyango biletinin çekilişine katılan sayı ile piyango biletinin satın alındığı piyango çekilişinin optimize md5 karması arasındaki fark çakışır, kazanç orantılı olarak bölünür kazanç kategorisine göre eşleşen modülleri olan katılımcılar.'),
(7764, 23, 7, 'RULES_13', 'Belirli bir piyango çekmeye yönelik ödül fonu, aşağıdaki şekilde üç kazanan kategoriye ayrılır:<br>- İlk kazanan kategorisi - ödül havuzunun% 50&#39;si;<br>- İkinci kategoride kazananlar - ödül havuzunun% 30&#39;u;<br>- Üçüncü kazanan kategorisi ödül havuzunun% 20&#39;sidir.'),
(7763, 23, 7, 'RULES_12', 'Çekiliş sonucunda, kazanan kategorinin üçüncü kategorisi, oynanan piyangoda satılan ayrı bir piyango biletinin piyango çekilişine katılan sayı ile piyango biletinin satın alındığı piyango çekilişinin optimize md5 karması arasındaki farkın üçüncü en büyük modülü olarak belirlenir.'),
(7762, 23, 7, 'RULES_11', 'Çekiliş sonucunda, ikinci kazanan kategorisi, oynanan piyangoda satılan ayrı bir piyango biletinin piyango çekilişine katılan sayı ile piyango biletinin satın alındığı piyango çekilişinin optimize md5 karması arasındaki farkın en büyük ikinci modülü olarak belirlenir.'),
(7761, 23, 7, 'RULES_10', 'Çizim sonucunda ilk kazanan kategorisi, oynanan piyangoda satılan ayrı bir piyango biletinin piyango çizimine katılan sayı ile piyango biletinin satın alındığı piyango çiziminin optimize md5 karması arasındaki farkın en küçük modülü olarak belirlenir.'),
(7760, 23, 7, 'RULES_9', 'Piyango kazananları, oynanan piyangoda satılan her piyango bileti için piyangoya katılan sayı ile piyango biletinin satın alındığı piyango biletinin optimize md5 karması arasındaki fark modülü hesaplanarak belirlenir.'),
(7759, 23, 7, 'RULES_8', 'Bir piyango çizme sürecinde, belirli bir piyangoda satılan her piyango bileti için bir piyangonun çekilmesine katılan bir sayı oluşur. Ayrıca çekme işlemi sırasında, piyango çiziminin optimize edilmiş bir md5 karması oluşur.'),
(7758, 23, 7, 'RULES_7', 'Piyango çekilişi ve ödül fonunun dağıtımı, çekilişin bitim tarihinden itibaren 24 saati geçmeyen bir sürede gerçekleşir.'),
(7757, 23, 7, 'RULES_6', 'Çekilişin ödül fonu, belirli bir çekilişe katılan tüm piyango biletleri için ödenen Bitcoin ödeme tutarından oluşur.'),
(7756, 23, 7, 'RULES_5', 'Her piyango biletinde, bilet sahibi, çekilişe katılan sayıyı almak için temel oluşturan 0 ila 99 arasında 7 sayı belirtir. Alınan numara ve ona karşılık gelen satılan bilet sadece piyango biletinin satın alındığı piyango çekilişine katılır.'),
(7755, 23, 7, 'RULES_4', 'Çekiliş tarihinden sonra Bitcoin ağında 3 ödeme onayı geçen biletler geçersizdir ve çekilişe katılmaz.'),
(7754, 23, 7, 'RULES_3', 'Piyango bileti geçerlidir ve yalnızca Bitcoin ağında kabul edilen 3 ödeme onayından sonra çizimde yer alır.'),
(7753, 23, 7, 'RULES_2', 'Her piyango sınırsız sayıda piyango bileti çeker.'),
(7752, 23, 7, 'RULES_1', 'Her çekilişin sınırlı bir süresi vardır.'),
(7751, 23, 7, 'RULES_TITLE', 'Piyango Kuralları'),
(7750, 23, 7, 'TERMS_8', 'Ödül fonu, çizimin kazananlarına tamamlandıktan sonra ödenen miktardır. Ödül havuzu, belirli bir piyangoda satılan tüm piyango biletlerinin toplamıdır.'),
(7749, 23, 7, 'TERMS_7', 'Optimize edilmiş bir md5 bilet karması, md5 karma algoritması kullanılarak belirli bir piyango biletinin bir sayı dizisinden elde edilen bir sayı dizisidir. Lotobot çekilişinde, optimize md5 bilet karması, KAZANAN KATILAN SAYI olarak adlandırılır. Çizime katılan numarayı nasıl elde ettiğimizi ayrıntılı olarak okuyabilirsiniz '),
(7748, 23, 7, 'TERMS_6', 'Bir piyango çekilişinin optimize edilmiş md5 karması, belirli bir çekilişin tüm piyango biletlerindeki tüm sayı satırlarının toplamının md5 karmasını optimize ederek elde edilen bir sayı dizisidir.'),
(7747, 23, 7, 'TERMS_5', 'Piyango bileti numarası satırı, piyango biletinde, satın alma sırasında piyango biletine girildikleri sırayla toplanan numaralardır.'),
(7746, 23, 7, 'TERMS_4', 'Optimize edilmiş md5 karması, md5 karma algoritması kullanılarak orijinal sayı serilerinin dönüştürülmesiyle elde edilen bir sayı dizisidir. Optimize edilmiş md5 karmasını nasıl elde ettiğimizi ayrıntılı olarak okuyabilirsiniz. '),
