(8075, 1, 7, 'RULES_11', 'В результаті розіграшу визначається друга категорія переможців як другий за величиною модуль різниці між числом, яке бере участь в розіграші лотереї окремого лотерейного квитка проданого в розігрується лотереї, і оптимізованого md5 хеш-кодування розіграшу лотереї, в якій був куплений лотерейний квиток.'),
(8076, 1, 7, 'RULES_12', 'В результаті розіграшу визначається третя категорія переможців як третій за величиною модуль різниці між числом, яке бере участь в розіграші лотереї окремого лотерейного квитка проданого в розігрується лотереї і оптимізованого md5 хеш-кодування розіграшу лотереї, в якій був куплений лотерейний квиток.'),
(8077, 1, 7, 'RULES_13', 'Призовий фонд розіграшу конкретної лотереї розподіляється за трьома категоріями переможців в наступному відповідно:<br>- Перша категорія переможців - 50% призового фонду;<br>- Друга категорія переможців - 30% призового фонду;<br>- Третя категорія переможців - 20% призового фонду.'),
(8078, 1, 7, 'RULES_14', 'У разі, якщо у двох і більше учасників розіграшу лотереї модулі різниці між числом, яке бере участь в розіграші лотереї окремого лотерейного квитка проданого в розігрується лотереї, і оптимізованого md5 хеш-кодування розіграшу лотереї, в якій був куплений лотерейний квиток, співпадуть, то виграш ділиться пропорційно між учасниками з збіглися модулями відповідно до категорії виграшу.'),
(8079, 1, 7, 'RULES_15_1', 'Результати конкретного розіграшу лотереї публікуються на сайті лотереї Lotobot.io на сторінці '),
(8080, 1, 7, 'RULES_15_2', ' і відображаються після вказівки номера лотереї, в якій був придбаний лотерейний квиток.'),
(8081, 1, 7, 'RULES_16_1', 'Виплата призового винагороди учаснику лотереї, має право на отримання виграшу будь-якої категорії, здійснюється виключно тільки після запиту, відправленого зі сторінки '),
(8082, 1, 7, 'RULES_16_2', ' і тільки на біткоіни гаманець, вказаний у формі запиту під час її заповнення. Виплата проводиться не пізніше, ніж в період 24 годин з моменту отримання запиту на виплату виграшу.'),
(8083, 1, 7, 'RULES_17', 'Комісія за висновок виграшу на біткоіни гаманець власника лотерейного квитка має право на отримання виграшу становить 10%.'),
(8084, 1, 7, 'PAGE_DESCRIPTION', 'Правила біткоіни лотереї Lotobot, терміни та визначення. Прочитай, щоб дізнатися як грати і вигравати в біткоіни лотереї.'),
