(8094, 1, 9, 'TITLE_HEADER', 'Партнерська програма Lotobot. Заробляй разом з нами'),
(8095, 1, 9, 'ERROR_PARTNER_ACCOUNT', 'На жаль, ми не змогли створити партнерську обліковий запис. Будь ласка, спробуйте ще раз пізніше.'),
(8096, 1, 9, 'MADE_PARTNER_ACCOUNT', 'Партнерський аккаунт з таким Email вже зареєстрований.'),
(8097, 1, 9, 'TITLE', 'Заробляй разом з нами'),
(8098, 1, 9, 'SUBTITLE', 'Приєднуйся до партнерської програми біткоіни лотереї Lotobot і заробляй 50% від прибутку з кожного залученого учасника лотереї'),
(8099, 1, 9, 'DESCRIPTION', 'Lotobot - це інтернет лотерея з 100% призовим фондом, а це значить, що всі кошти, сплачені гравцями лотереї, будуть спрямовані в призовий фонд. Ми заробляємо на забезпеченні процесу розіграшу. Комісія нашого сервісу становить 10% на висновок виграшу на біткоіни гаманець переможця певного розіграшу лотереї. Як і у більшості успішних інтернет ресурсів, у нас є програма лояльності для партнерів, які допомагають розвивати наш сервіс. <span class=\"red_text\">Ми виплачуємо винагороду за кожного гравця, який купив лотерейний квиток, незалежно від того виграв, залучений партнером, гравець чи ні.</span> Завдяки нашій партнерській програмі кожен може отримувати дохід від інтернет лотереї Lotobot.'),
(8100, 1, 9, 'RULES_TITLE', 'Наші правила дуже прості'),
(8101, 1, 9, 'RULE_1', 'Ми виплачуємо 50% доходу отриманого від гравця, що становить 5% від вартості куплених ним квитків. Вартість лотерейного квитка 50000 Satoshi, наша комісія 10% або 5000 Satoshi, і половину цієї суми ми виплачуємо партнеру, привернув гравця. Тобто твій дохід з кожного залученого і оплатив свій квиток учасника лотереї складе 2500 Satoshi.'),
(8102, 1, 9, 'RULE_2', 'У нас немає обмежень на суму виплати, таким чином ти можеш вивести дохід, отриманий навіть з одного залученого учасника лотереї.'),
(8103, 1, 9, 'RULE_3', 'Нарахування доходу відбувається відразу після завершення розіграшу, в якому був куплений квиток залученими тобою гравцем.'),
(8104, 1, 9, 'RULE_4', 'Виплата отриманого реферального доходу здійснюється на біткоіни гаманець, вказаний при запиті на виведення коштів.'),
(8105, 1, 9, 'RULE_5', 'Максимальний термін виплати становить 24 години після отримання запиту на висновок доходу.'),
(8106, 1, 9, 'CHECK_TITLE', 'Нас легко перевірити'),
(8107, 1, 9, 'CHECK_DESCRIPTION', 'Щоб бути впевненим, що кожен гравець, який прийшов за отриманою реферального посиланням, потрапить в список залучених тобою, просто купи один з лотерейних квитків через свою реферальне посилання і ти відразу побачиш лотерейний квиток в списку залучених.'),
(8108, 1, 9, 'BECOME_PARTNER_TITLE', 'Стати нашим партнером просто'),
(8109, 1, 9, 'BECOME_PARTNER_DESCRIPTION', 'Щоб стати учасником нашої партнерської програми, все, що тобі потрібно, це отримати реферальне посилання. Вкажи свій Email для входу на сервіс, записавши його в відповідне поле форми нижче і кликни \"Стати партнером\". Після цього ти отримаєш унікальний пароль і реферальне посилання. Все, що тобі залишиться, це ділитися отриманою посиланням на форумах, в чатах, в соціальних мережах і отримувати дохід з кожного залученого учасника лотереї. Ти зможеш вивести свій реферальний дохід відразу після проходження розіграшу в якому залучений тобою реферал купив квиток.'),
(8110, 1, 9, 'PAGE_DESCRIPTION', 'Реферальная програма біткоіни лотереї Lotobot це зручний спосіб отримувати прибуток для вебмайстрів та блогерів. Як стати партнером і заробляти з залучених гравців.'),
