(8353, 26, 6, 'STEP_2', 'Trong bước thứ hai, chúng tôi xử lý chuỗi thu được ở bước đầu tiên bằng thuật toán băm md5 và thu được một chuỗi các ký tự'),
(8354, 26, 6, 'ALGORITHM_1', 'Thuật toán md5 rất phổ biến trong mật mã và thường được sử dụng để mã hóa mật khẩu. Tìm hiểu thêm về md5 trong '),
(8355, 26, 6, 'ALGORITHM_WIKI', 'Bài viết trên Wikipedia'),
(8356, 26, 6, 'ALGORITHM_2', 'Bạn luôn có thể thử nghiệm băm bất kỳ số và dòng nào trên một trong nhiều dịch vụ trên Internet. Bạn có thể tìm thấy chúng bằng cách sử dụng '),
(8357, 26, 6, 'ALGORITHM_GOOGLE', 'tìm kiếm trên google'),
(8358, 26, 6, 'MD5_GOOGLE_LINK', 'https://www.google.com.vn/search?q=md5+online&oq=md5+online'),
(8359, 26, 6, 'STEP_3', 'Trong bước thứ ba, chúng tôi xóa tất cả các ký tự ngoại trừ các chữ số từ chuỗi md5 kết quả và nhận được một số lượng lớn'),
(8360, 26, 6, 'STEP_4', 'Trong bước bốn, chúng tôi loại bỏ tất cả các số không từ đầu và cuối, nếu có. Bước thứ tư chúng ta có được số cuối cùng, chính số này sẽ tham gia xổ số'),
(8361, 26, 6, 'INFOGRAPHICS_TITLE', 'Chúng tôi hiểu rằng thuật toán này khá khó hiểu và phức tạp, nhưng nó đảm bảo không có khả năng làm sai lệch vé số và dự đoán kết hợp trúng thưởng.'),
(8362, 26, 6, 'SELECTED_NUMS', 'Số được chọn'),
(8363, 26, 6, 'STEP', 'Bước'),
(8364, 26, 6, 'PAGE_DESCRIPTION', 'Làm thế nào để chúng ta có được số lượng tham gia xổ số Lotobot. Băm MD5 được sử dụng để chuyển đổi số vé và số cuối cùng cho lần rút.'),
(8365, 26, 6, 'PAGE_KEYWORDS', 'số để vẽ, số để vẽ xổ số xổ số, chuyển đổi số vé xổ số'),
(8366, 26, 7, 'TITLE_HEADER', 'Quy tắc xổ số Bitcoin xổ số'),
(8367, 26, 7, 'TITLE', 'Quy tắc xổ số Bitcoin xổ số'),
(8368, 26, 7, 'TERMS_TITLE', 'Điều khoản và định nghĩa'),
(8369, 26, 7, 'TERMS_1', 'Xổ số xổ số là một trò chơi diễn ra trong một khoảng thời gian nhất định, sau đó có sự phân phối tiền thưởng thu được giữa những người chơi đã mua vé số.'),
(8370, 26, 7, 'TERMS_2', 'Vẽ xổ số là một quá trình xác định người chiến thắng trong số những người tham gia đã mua vé số đúng hạn cho một loại xổ số cụ thể.'),
(8371, 26, 7, 'TERMS_3', 'Vé số là một tập hợp dữ liệu cần thiết để tham gia xổ số.'),
(8372, 26, 7, 'TERMS_4', 'Tối ưu hóa băm md5 là một chuỗi các số có được bằng cách chuyển đổi chuỗi số gốc bằng thuật toán băm md5. Bạn có thể đọc chi tiết cách chúng tôi nhận được băm md5 được tối ưu hóa. '),
(8373, 26, 7, 'TERMS_5', 'Dòng số vé số là số được chỉ định trong vé xổ số, được thu thập trong một dòng theo cùng một chuỗi trong đó chúng được nhập vào vé xổ số tại thời điểm mua.'),
(8374, 26, 7, 'TERMS_6', 'Băm md5 được tối ưu hóa của một lần rút xổ số là một chuỗi các số có được bằng cách tối ưu hóa băm md5 của tổng tất cả các chuỗi số từ tất cả các vé xổ số của một lần rút thăm cụ thể.'),
(8375, 26, 7, 'TERMS_7', 'Băm vé md5 được tối ưu hóa là một chuỗi các số có được từ một chuỗi các số của một vé xổ số cụ thể bằng thuật toán băm md5. Trong xổ số Lotobot, băm vé md5 được tối ưu hóa được gọi là SỐ THAM GIA THAM GIA. Bạn có thể đọc chi tiết cách chúng tôi có được số lượng tham gia vào bản vẽ. '),
(8376, 26, 7, 'TERMS_8', 'Quỹ giải thưởng là số tiền được trả cho những người chiến thắng trong bản vẽ sau khi hoàn thành. Tổng giải thưởng là tổng chi phí của tất cả các vé số được bán trong một xổ số cụ thể.'),
(8377, 26, 7, 'RULES_TITLE', 'Quy tắc xổ số'),
(8378, 26, 7, 'RULES_1', 'Mỗi lần rút có một khoảng thời gian giới hạn.'),
(8379, 26, 7, 'RULES_2', 'Mỗi xổ số rút ra một số lượng vé số không giới hạn.'),
(8380, 26, 7, 'RULES_3', 'Vé số có giá trị và chỉ tham gia vào bản vẽ sau 3 lần xác nhận thanh toán được chấp nhận trong mạng Bitcoin.'),
(8381, 26, 7, 'RULES_4', 'Vé có 3 xác nhận thanh toán trên mạng Bitcoin đã trôi qua sau ngày rút thăm không hợp lệ và không tham gia rút thăm.'),
(8382, 26, 7, 'RULES_5', 'Trong mỗi vé số, người giữ vé chỉ ra 7 số từ 0 đến 99, tạo thành cơ sở cho số có liên quan đến xổ số. Số đã nhận và vé đã bán tương ứng với nó chỉ tham gia rút thăm xổ số trong đó vé số được mua.'),
(8383, 26, 7, 'RULES_6', 'Quỹ giải thưởng của kỳ quay được hình thành từ số tiền thanh toán Bitcoin được trả cho tất cả các vé số tham gia vào một lần rút cụ thể.'),
(8384, 26, 7, 'RULES_7', 'Vẽ xổ số và phân phối quỹ giải thưởng diễn ra trong khoảng thời gian không quá 24 giờ sau ngày hoàn thành bản vẽ.'),
(8385, 26, 7, 'RULES_8', 'Trong quá trình vẽ xổ số, một số được hình thành tham gia vẽ xổ số cho mỗi vé số được bán trong một xổ số cụ thể. Cũng trong quá trình vẽ, một băm md5 được tối ưu hóa của bản vẽ xổ số được hình thành.'),
(8386, 26, 7, 'RULES_9', 'Người trúng xổ số được xác định bằng cách tính mô-đun chênh lệch giữa số người tham gia xổ số cho mỗi vé xổ số được bán trong xổ số đang được chơi và băm md5 được tối ưu hóa của vé xổ số được mua vé số.'),
(8387, 26, 7, 'RULES_10', 'Theo kết quả của bản vẽ, loại người trúng giải đầu tiên được xác định là mô-đun nhỏ nhất về sự khác biệt giữa số người tham gia rút thăm xổ số của một vé xổ số được bán trong xổ số đang được chơi và băm md5 được tối ưu hóa trong bản vẽ xổ số được mua.'),
(8388, 26, 7, 'RULES_11', 'Theo kết quả bốc thăm, loại người trúng thưởng thứ hai được xác định là mô-đun lớn thứ hai về sự khác biệt giữa số người tham gia rút thăm xổ số của một vé xổ số riêng biệt được bán trong xổ số được chơi và băm md5 được tối ưu hóa của xổ số được mua.'),
(8389, 26, 7, 'RULES_12', 'Theo kết quả bốc thăm, loại người trúng giải thứ ba được xác định là mô-đun lớn thứ ba về sự khác biệt giữa số người tham gia rút thăm xổ số của một vé xổ số riêng biệt được bán trong xổ số được chơi và băm md5 được tối ưu hóa trong lần xổ số được mua.'),
(8390, 26, 7, 'RULES_13', 'Quỹ giải thưởng để vẽ xổ số cụ thể được chia thành ba loại người chiến thắng theo quy định sau:<br>- Hạng mục đầu tiên của người chiến thắng - 50% tổng giải thưởng;<br>- Hạng mục người chiến thắng thứ hai - 30% tổng giải thưởng;<br>- Hạng mục người chiến thắng thứ ba là 20% tổng giải thưởng.'),
(8391, 26, 7, 'RULES_14', 'Nếu hai hoặc nhiều người tham gia rút thăm xổ số, chênh lệch giữa số người tham gia rút thăm xổ số của một vé xổ số cá nhân được bán trong xổ số đang được chơi và băm md5 được tối ưu hóa của xổ số được mua trong đó vé xổ số được mua trùng nhau người tham gia với các mô-đun phù hợp theo danh mục tiền thắng.'),
(8392, 26, 7, 'RULES_15_1', 'Kết quả của một bản vẽ xổ số cụ thể được công bố trên trang web của xổ số Lotobot.io trên trang '),
(8393, 26, 7, 'RULES_15_2', ' và được hiển thị sau khi cho biết số xổ số đã mua vé số.'),
(8394, 26, 7, 'RULES_16_1', 'Việc thanh toán giải thưởng cho người tham gia xổ số có quyền nhận giải thưởng thuộc bất kỳ hạng mục nào được thực hiện riêng sau khi yêu cầu được gửi từ trang '),
(8395, 26, 7, 'RULES_16_2', ' và chỉ vào ví Bitcoin được chỉ định trong biểu mẫu yêu cầu khi điền vào. Thanh toán được thực hiện không muộn hơn trong vòng 24 giờ kể từ khi nhận được yêu cầu thanh toán tiền thắng cược.'),
(8396, 26, 7, 'RULES_17', 'Hoa hồng rút tiền trúng thưởng vào ví bitcoin của chủ sở hữu vé số có quyền nhận tiền thưởng là 10%.'),
(8397, 26, 7, 'PAGE_DESCRIPTION', 'Quy tắc, điều khoản và định nghĩa về Bitcoin của Lotobot. Đọc để tìm hiểu cách chơi và trúng xổ số bitcoin.');
INSERT INTO `content` (`id_content_block`, `id_lang`, `id_page`, `name_content_block`, `value_content_block`) VALUES
(8398, 26, 7, 'PAGE_KEYWORDS', 'luật chơi xổ số, luật chơi xổ số xổ số, luật chơi xổ số, cách chơi xổ số'),
(8399, 26, 8, 'TITLE_HEADER', 'Xem chi tiết vé đã mua'),
(8400, 26, 8, 'REQUEST_ERROR', 'Xin lỗi, chúng tôi không thể lấy chi tiết vé. Vui lòng thử lại sau.'),
(8401, 26, 8, 'DATA_ERROR', 'Dữ liệu nhập vào không chính xác. Kiểm tra dữ liệu đã nhập và thử lại.'),
(8402, 26, 0, 'TICKET_DATA', 'Chi tiết vé của bạn'),
(8403, 26, 8, 'SUBTITLE', 'Để xem thông tin về vé số đã mua, hãy nhập dữ liệu từ tờ séc vào mẫu dưới đây.'),
(8404, 26, 8, 'SHOW_ANOTHER_TICKET', 'Hiển thị một vé khác'),
(8405, 26, 8, 'PAGE_DESCRIPTION', 'Quên chi tiết vé Lotobot của bạn? Tại đây bạn có thể xem tất cả các thông tin về vé số đã mua.'),
(8406, 26, 8, 'PAGE_KEYWORDS', 'vé lotobot, chi tiết vé lotobot, thông tin vé lotobot, in vé lotobot'),
(8407, 26, 9, 'TITLE_HEADER', 'Chương trình liên kết của Lotobot. Kiếm tiền với chúng tôi'),
(8408, 26, 9, 'ERROR_PARTNER_ACCOUNT', 'Thật không may, chúng tôi không thể tạo một tài khoản liên kết. Vui lòng thử lại sau.'),
(8409, 26, 9, 'MADE_PARTNER_ACCOUNT', 'Một tài khoản đối tác với Email như vậy đã được đăng ký.'),
(8410, 26, 9, 'TITLE', 'Kiếm tiền với chúng tôi'),
(8411, 26, 9, 'SUBTITLE', 'Tham gia chương trình liên kết Bitcoin của Lotobot và kiếm 50% lợi nhuận từ mỗi người tham gia xổ số thu hút'),
(8412, 26, 9, 'DESCRIPTION', 'Lotobot là xổ số trực tuyến với nhóm giải thưởng 100%, có nghĩa là tất cả các khoản tiền được trả bởi người chơi xổ số sẽ được gửi đến nhóm giải thưởng. Chúng tôi kiếm tiền bằng cách cung cấp một quá trình vẽ. Hoa hồng của dịch vụ của chúng tôi là 10% cho việc rút tiền thắng vào ví bitcoin của người trúng xổ số nhất định. Giống như hầu hết các tài nguyên Internet thành công, chúng tôi có một chương trình khách hàng thân thiết cho các đối tác giúp phát triển dịch vụ của chúng tôi. <span class=\"red_text\">Chúng tôi trả phần thưởng cho mỗi người chơi đã mua vé số, bất kể anh ta thắng, bị thu hút bởi đối tác, người chơi hay không.</span> Nhờ chương trình liên kết của chúng tôi, mọi người đều có thể nhận được thu nhập từ xổ số trực tuyến Lotobot.'),
(8413, 26, 9, 'RULES_TITLE', 'Quy tắc của chúng tôi rất đơn giản.'),
(8414, 26, 9, 'RULE_1', 'Chúng tôi trả 50% thu nhập nhận được từ người chơi, bằng 5% chi phí vé mà anh ta mua. Chi phí của vé xổ số là 50.000 Satoshi, hoa hồng của chúng tôi là 10% hoặc 5.000 Satoshi và chúng tôi trả một nửa số tiền này cho đối tác đã thu hút người chơi. Nghĩa là, thu nhập của bạn từ mỗi người tham gia xổ số được thu hút và trả cho vé của bạn sẽ là 2500 Satoshi.'),
(8415, 26, 9, 'RULE_2', 'Chúng tôi không có giới hạn về số tiền thanh toán, vì vậy bạn có thể rút thu nhập nhận được ngay cả từ một người tham gia xổ số có liên quan.'),
(8416, 26, 9, 'RULE_3', 'Thu nhập tích lũy xảy ra ngay sau khi kết thúc bản vẽ, trong đó vé được mua bởi người chơi có liên quan.'),
(8417, 26, 9, 'RULE_4', 'Thanh toán thu nhập giới thiệu nhận được được thực hiện trên ví Bitcoin được chỉ định khi yêu cầu rút tiền.'),
(8418, 26, 9, 'RULE_5', 'Thời hạn thanh toán tối đa là 24 giờ sau khi nhận được yêu cầu rút thu nhập.'),
(8419, 26, 9, 'CHECK_TITLE', 'Thật dễ dàng để kiểm tra chúng tôi'),
(8420, 26, 9, 'CHECK_DESCRIPTION', 'Để chắc chắn rằng mỗi người chơi nhấp vào liên kết giới thiệu sẽ được đưa vào danh sách thu hút của bạn, chỉ cần mua một trong những vé số thông qua liên kết giới thiệu của bạn và bạn sẽ thấy ngay vé số trong danh sách thu hút.'),
(8421, 26, 9, 'BECOME_PARTNER_TITLE', 'Trở thành đối tác của chúng tôi thật dễ dàng'),
(8422, 26, 9, 'BECOME_PARTNER_DESCRIPTION', 'Để trở thành thành viên của chương trình liên kết của chúng tôi, tất cả những gì bạn cần là có được một liên kết giới thiệu. Cho biết Email của bạn để vào dịch vụ, viết nó vào trường thích hợp của biểu mẫu bên dưới và nhấp vào \"Trở thành đối tác\". Sau đó, bạn sẽ nhận được một mật khẩu duy nhất và một liên kết giới thiệu. Tất cả những gì còn lại cho bạn là chia sẻ liên kết nhận được trên các diễn đàn, trong các phòng chat, trên mạng xã hội và nhận thu nhập từ mỗi người tham gia xổ số có liên quan. Bạn sẽ có thể rút thu nhập giới thiệu của mình ngay lập tức sau khi vượt qua xổ số mà giới thiệu bạn đã thu hút đã mua vé.'),
(8423, 26, 9, 'PAGE_DESCRIPTION', 'Chương trình giới thiệu Xổ số Bitcoin Lotobot là một cách thuận tiện để kiếm lợi nhuận cho các quản trị web và blogger. Làm thế nào để trở thành đối tác và kiếm tiền từ những người chơi thu hút.'),
(8424, 26, 9, 'PAGE_KEYWORDS', 'chương trình giới thiệu xổ số, kiếm tiền với xổ số, chương trình giới thiệu, cách kiếm xổ số, kiếm tiền từ bán vé số, đối tác xổ số'),
(8425, 26, 10, 'TITLE_HEADER_PLAY_WEEK', 'Mua vé xổ số mỗi tuần'),
(8426, 26, 10, 'TITLE_HEADER_PLAY', 'Chọn xổ số may mắn của bạn'),
(8427, 26, 10, 'TITLE_HEADER_PLAY_MONTH', 'Mua vé với một trận hòa mỗi tháng'),
(8428, 26, 10, 'TITLE_HEADER_PLAY_QUARTER', 'Mua vé xổ số ba tháng một lần'),
(8429, 26, 10, 'TITLE', 'Mua vé may mắn của bạn'),
(8430, 26, 10, 'SUBTITLE_1', 'Thật không may, không có một xổ số duy nhất được tổ chức theo loại '),
(8431, 26, 10, 'SUBTITLE_2', ' Vui lòng thử lại sau.'),
(8432, 26, 10, 'THINK_NUMBERS', 'Hãy đến với 7 con số may mắn'),
(8433, 26, 10, 'PAY_TICKET', 'Trả vé của bạn'),
(8434, 26, 10, 'GET_NUMBER', 'Nhận số may mắn'),
(8435, 26, 10, 'ACTION_1', 'Tạo 7 số từ 0 đến 99 và viết chúng vào bảy trường trống bên dưới.<br><span class=\"red_text semi-bold_text\">Chú ý!</span> <span class=\"red_text\">Không sử dụng bất kỳ ký tự nào ngoài số.</span>'),
(8436, 26, 10, 'CREATE_RANDOM_NUMBERS', 'Tạo số ngẫu nhiên'),
