(8999, 27, 7, 'TERMS_5', '彩票号码行是彩票中指示的号码，该行中的号码以购买时在彩票中输入的相同顺序排列。'),
(9000, 27, 7, 'TERMS_6', '彩票抽奖的优化md5哈希是通过优化特定抽奖的所有彩票的所有数字的总和的md5哈希而获得的数字序列。'),
(9001, 27, 7, 'TERMS_7', '优化的md5票据哈希是使用md5哈希算法从特定彩票的数字字符串中获得的数字序列。 在Lotobot彩票中，优化的md5票证哈希值称为中奖人数。 您可以详细阅读我们如何获得参与绘图的号码 '),
(9002, 27, 7, 'TERMS_8', '奖金是指绘画完成后支付给获奖者的金额。 奖池是在特定彩票中出售的所有彩票的总成本。'),
