(9006, 27, 7, 'RULES_3', '彩票有效并只有在3位比特币网络中接受付款确认后才参与抽奖。'),
(9007, 27, 7, 'RULES_4', '在抽奖日期之后通过了比特币网络上3笔付款确认单的门票无效，不参与抽奖。'),
(9008, 27, 7, 'RULES_5', '在每个彩票中，持票人都指示0到99之间的7个数字，这些数字构成彩票中涉及的数字的基础。 接收到的号码和与其对应的出售票仅参与购买彩票的抽奖。'),
(9009, 27, 7, 'RULES_6', '抽奖的奖金是由参加特定抽奖的所有彩票的比特币支付金额构成的。'),
(9010, 27, 7, 'RULES_7', '抽奖和奖金分配在抽奖完成之日起不超过24小时内进行。'),
(9011, 27, 7, 'RULES_8', '在抽奖的过程中，对于在特定彩票中出售的每个彩票，形成参与抽奖的号码。 同样在抽奖过程中，形成彩票抽奖的优化的md5哈希。'),
(9012, 27, 7, 'RULES_9', '通过计算所玩彩票中所售出的每个彩票的参与彩票的数量与购买该彩票的彩票的md5哈希值之间的差值的模块，确定彩票的赢家。'),
(9013, 27, 7, 'RULES_10', '作为抽奖的结果，第一类中奖者被确定为参与正在玩的彩票中出售的另一张彩票的参加抽奖的彩票号码与购买了该彩票的彩票的优化md5哈希之间的差的最小模块。'),
(9014, 27, 7, 'RULES_11', '作为抽奖的结果，第二类获奖者被确定为参与正在玩的彩票中出售的另一张彩票的参加抽奖的人数与购买该彩票的抽奖的md5哈希值的优化后的第二大模块。'),
(9015, 27, 7, 'RULES_12', '作为抽奖的结果，第三类获奖者被确定为参与正在玩的彩票中出售的另一张彩票的参加抽奖的人数与购买该彩票的抽奖的md5哈希值的优化之间的差异的第三大模块。'),
(9016, 27, 7, 'RULES_13', '抽奖特定彩票的奖金按照以下方式分为三类：<br>-第一类获奖者-奖金的50％；<br>-第二类优胜者-奖金池的30％；<br>-第三类获奖者是奖池的20％。'),
(9017, 27, 7, 'RULES_14', '如果两个或两个以上的抽奖参与者，参与所玩彩票中出售的单个彩票的抽奖人数与购买该彩票的最佳md5哈希值之间的差值相符，则胜利将按比例分配 参与者根据奖金类别具有匹配模块。');
