(9035, 27, 9, 'MADE_PARTNER_ACCOUNT', '使用该电子邮件的合作伙伴帐户已被注册。'),
(9036, 27, 9, 'TITLE', '与我们一起赚钱'),
(9037, 27, 9, 'SUBTITLE', '加入Lotobot彩票会员计划，并从每个吸引的彩票参与者中获得50％的利润'),
(9038, 27, 9, 'DESCRIPTION', 'Lotobot是具有100％奖池的在线彩票，这意味着彩票玩家支付的所有资金都将发送到奖池中。 我们通过提供绘图程序来赚钱。 我们的服务佣金是将一定彩票中奖者的奖金提取到比特币钱包中的10％。 像大多数成功的Internet资源一样，我们为合作伙伴制定了一个忠诚度计划，以帮助我们开发服务。 <span class=\"red_text\">对于购买彩票的每位玩家，我们都会给予奖励，无论他是否赢了，是否被伴侣，玩家吸引。</span> 多亏了我们的会员计划，每个人都可以从Lotobot在线彩票中获得收入。'),
(9039, 27, 9, 'RULES_TITLE', '我们的规则很简单。'),
(9040, 27, 9, 'RULE_1', '我们将支付从玩家那里获得的收入的50％，即他购买的门票费用的5％。 彩票的费用为50,000聪，我们的佣金为10％或5,000聪，我们将其中一半的费用支付给吸引玩家的合作伙伴。 即，您从每个彩票参与者那里获得的收入和为您支付的门票收入将是2500 Satoshi。'),
(9041, 27, 9, 'RULE_2', '我们对付款金额没有限制，因此您甚至可以从一名参与彩票的参与者中提取收入。'),
(9042, 27, 9, 'RULE_3', '抽奖结束后立即产生应计收入，其中所涉及的玩家购买了彩票。'),
(9043, 27, 9, 'RULE_4', '请求提款时，在指定的比特币钱包中支付收到的推荐收入。'),
(9044, 27, 9, 'RULE_5', '最长付款期是收到收入要求后的24小时。'),
(9045, 27, 9, 'CHECK_TITLE', '检查我们很容易'),
(9046, 27, 9, 'CHECK_DESCRIPTION', '为确保单击推荐链接的每个玩家都将包含在您吸引的列表中，只需通过您的推荐链接购买一张彩票，您将立即在吸引列表中看到该彩票。'),
