(9314, 28, 7, 'TERMS_7', '優化的md5票據哈希是使用md5哈希算法從特定彩票的數字字符串中獲得的數字序列。 在Lotobot彩票中，優化的md5票證哈希值稱為中獎人數。 您可以詳細閱讀我們如何獲得參與繪圖的號碼 '),
(9315, 28, 7, 'TERMS_8', '獎金是指繪畫完成後支付給獲獎者的金額。 獎池是在特定彩票中出售的所有彩票的總成本。'),
