(9321, 28, 7, 'RULES_5', '在每個彩票中，彩票所有者指示0到99之間的7個數字，這些數字構成接收參與彩票的數字的基礎。 接收到的號碼和與其對應的售票僅參與購買彩票的抽獎。'),
