(9323, 28, 7, 'RULES_7', '抽獎和獎金分配在抽獎完成之日起不超過24小時內進行。'),
(9324, 28, 7, 'RULES_8', '在抽獎的過程中，對於在特定彩票中出售的每個彩票，形成參與抽獎的號碼。 同樣在抽獎過程中，形成彩票抽獎的優化的md5哈希。'),
(9325, 28, 7, 'RULES_9', '彩票的中獎者是通過計算所玩彩票中所售出的每個彩票的參與彩票的號碼與購買該彩票的彩票的md5哈希值之間的差值的模塊來確定的。'),
(9326, 28, 7, 'RULES_10', '作為抽獎的結果，第一類中獎者被確定為參加正在玩的彩票中出售的另一張彩票的參加抽獎的彩票號碼與購買了該彩票的彩票的優化md5哈希之間的差的最小模塊。'),
(9327, 28, 7, 'RULES_11', '作為抽獎的結果，第二類獲獎者被確定為參與正在玩的彩票中出售的另一張彩票的參加抽獎的人數與購買該彩票的抽獎的md5哈希值的優化後的第二大模塊。'),
(9328, 28, 7, 'RULES_12', '作為抽獎的結果，第三類獲獎者被確定為參與正在玩的彩票中出售的另一張彩票的參加抽獎的人數與購買該彩票的抽獎的md5哈希值的優化之間的差異的第三大模塊。'),
(9329, 28, 7, 'RULES_13', '抽獎特定彩票的獎金按照以下方式分為三類：<br>- 第一類獲獎者-獎金池的50％；<br>- 第二類獲獎者-獎金池的30％；<br>- 第三類獲獎者是獎池的20％。'),
(9330, 28, 7, 'RULES_14', '如果兩個或兩個以上的抽獎參與者，參與所玩彩票中出售的單個彩票的抽獎人數與購買該彩票的最佳md5哈希值之間的差值相符，則勝利將按比例分配 參與者根據獎金類別具有匹配模塊。'),
