(9333, 28, 7, 'RULES_16_1', '僅在頁面發送請求後，才向有權獲得任何類別的獎品的彩票參與者支付獎品 '),
(9334, 28, 7, 'RULES_16_2', ' 並僅在填寫請求表時在請求表中指明的比特幣錢包中使用。 必須在收到獎金要求後的24小時內付款。'),
