(9349, 28, 9, 'TITLE', '與我們一起賺錢'),
(9350, 28, 9, 'SUBTITLE', '加入Lotobot彩票聯盟計劃，並從每個吸引的彩票參與者中獲得50％的利潤'),
(9351, 28, 9, 'DESCRIPTION', 'Lotobot是具有100％獎池的在線彩票，這意味著彩票玩家支付的所有資金將被發送到獎池。 我們通過提供繪圖程序來賺錢。 我們的服務佣金是將一定彩票中獎者的獎金提取到比特幣錢包中的10％。 像大多數成功的Internet資源一樣，我們為合作夥伴制定了一項忠誠度計劃，以幫助我們開發服務。 <span class=\"red_text\">對於購買彩票的每位玩家，我們都會給予獎勵，無論他是否贏了，是否被伴侶，玩家吸引。</span> 多虧了我們的會員計劃，每個人都可以從Lotobot在線彩票中獲得收入。'),
(9352, 28, 9, 'RULES_TITLE', '我們的規則很簡單。'),
(9353, 28, 9, 'RULE_1', '我們將支付從玩家那裡獲得的收入的50％，即他購買的門票費用的5％。 彩票的費用為50,000聰，我們的佣金為10％或5,000聰，我們將其中一半的費用支付給吸引玩家的合作夥伴。 即，您從每個彩票參與者那裡獲得的收入和為您支付的門票收入將是2500 Satoshi。'),
(9354, 28, 9, 'RULE_2', '我們對付款金額沒有限制，因此您甚至可以從一名參與彩票的參與者中提取收入。'),
(9355, 28, 9, 'RULE_3', '抽獎結束後立即產生應計收入，其中所涉及的玩家購買了彩票。'),
(9356, 28, 9, 'RULE_4', '請求提款時，在指定的比特幣錢包中支付收到的推薦收入。'),
(9357, 28, 9, 'RULE_5', '最長付款期是收到收入提款請求後的24小時。'),
(9358, 28, 9, 'CHECK_TITLE', '檢查我們很容易'),
(9359, 28, 9, 'CHECK_DESCRIPTION', '為確保單擊推薦鏈接的每個玩家都將包含在您吸引的列表中，只需通過您的推薦鏈接購買一張彩票，您將立即在吸引列表中看到該彩票。'),
(9360, 28, 9, 'BECOME_PARTNER_TITLE', '成為我們的合作夥伴很容易'),
(9361, 28, 9, 'BECOME_PARTNER_DESCRIPTION', '要成為我們的會員計劃的成員，您需要獲取一個推薦鏈接。指明您的電子郵件以輸入服務，並在下面表格的相應字段中編寫該服務，然後單擊以成為會員。之後，您將收到一個唯一的密碼和一個引薦鏈接。您剩下的就是在論壇，聊天室，社交網絡上共享收到的鏈接，並從每個吸引的彩票參與者那裡獲得收入。通過吸引您的推薦人購買彩票的抽獎後，您將能夠立即提取推薦人收入。'),
