(9612, 29, 6, 'STEP_4', 'Ceturtajā darbībā mēs noņemsim visas nulles no sākuma un beigām, ja tādas ir. Ceturtajā posmā mēs iegūstam gala numuru, tieši šis numurs piedalīsies loterijā'),
(9613, 29, 6, 'INFOGRAPHICS_TITLE', 'Mēs saprotam, ka šis algoritms ir diezgan neskaidrs un sarežģīts, taču tas garantē, ka nav iespējas viltot loterijas biļetes un paredzēt uzvarošu kombināciju.'),
