(9615, 29, 6, 'STEP', 'Solis'),
(9616, 29, 6, 'PAGE_DESCRIPTION', 'Kā mēs iegūstam numuru, kas piedalās Lotobot loterijā. MD5 sajaukšana tiek izmantota, lai konvertētu biļešu numurus un izlozes galīgo numuru.'),
