(9619, 29, 7, 'TITLE', 'Noteikumi Bitcoin loterijas Lotobot'),
(9620, 29, 7, 'TERMS_TITLE', 'Termini un definīcijas'),
(9621, 29, 7, 'TERMS_1', 'Lotobot loterija ir spēle, kas notiek noteiktā laika posmā, pēc kuras tiek savākti laimesti sadalīti starp spēlētājiem, kuri iegādājās loterijas biļetes.'),
(9622, 29, 7, 'TERMS_2', 'Loterijas izloze ir process, kurā uzvarētāji tiek noteikti starp dalībniekiem, kuri laicīgi iegādājās loterijas biļeti konkrētai loterijai.'),
(9623, 29, 7, 'TERMS_3', 'Loterijas biļete ir datu kopums, kas nepieciešams, lai piedalītos loterijā.'),
(9624, 29, 7, 'TERMS_4', 'Optimizēta md5 hash ir skaitļu virkne, kas iegūta, konvertējot oriģinālo numuru sēriju, izmantojot md5 hash algoritmu. Jūs varat detalizēti izlasīt, kā mēs iegūstam optimizēto md5 hash '),
(9625, 29, 7, 'TERMS_5', 'Loterijas biļetes numuru rinda ir skaitļi, kas norādīti loterijas biļetē, savākti rindā tajā pašā secībā, kurā tie pirkuma brīdī tika ievadīti loterijas biļetē.'),
(9626, 29, 7, 'TERMS_6', 'Optimizēta loterijas izlozes md5 hash ir skaitļu virkne, kas iegūta, optimizējot md5 hash no visu skaitļu līniju summas no visām loterijas biļetēm noteiktā izlozē.'),
(9627, 29, 7, 'TERMS_7', 'Optimizēta md5 biļešu maiņa ir skaitļu secība, kas iegūta no noteiktas loterijas biļetes ciparu virknes, izmantojot md5 hash algoritmu. Lotobot loterijas ietvaros optimizēto md5 biļešu maiņu sauc par SKAITS, KAS DALĪJS UZVARĒT. Jūs varat detalizēti izlasīt, kā mēs iegūstam numuru, kas piedalās zīmēšanā '),
(9628, 29, 7, 'TERMS_8', 'Balvu fonds ir summa, kas izlozes uzvarētājiem tiek izmaksāta pēc tās pabeigšanas. Balvu fonds ir visu loterijas biļešu izmaksu summa, kas tiek pārdota noteiktā loterijā.'),
(9629, 29, 7, 'RULES_TITLE', 'Izlozes noteikumi'),
(9630, 29, 7, 'RULES_1', 'Katrai izlozei ir ierobežots laika periods.'),
(9631, 29, 7, 'RULES_2', 'Katrā loterijā tiek izlozēts neierobežots loterijas biļešu skaits.'),
(9632, 29, 7, 'RULES_3', 'Loterijas biļete ir derīga un piedalās izlozē tikai pēc 3 pieņemtiem maksājuma apstiprinājumiem Bitcoin tīklā.'),
(9633, 29, 7, 'RULES_4', 'Biļetes, kuru 3 maksājuma apstiprinājumi Bitcoin tīklā ir pagājuši pēc izlozes datuma, nav derīgas un nepiedalās izlozē.'),
(9634, 29, 7, 'RULES_5', 'Katrā loterijas biļetē biļetes īpašnieks norāda 7 numurus no 0 līdz 99, kas ir par pamatu tā numura saņemšanai, kurš piedalās loterijā. Saņemtais numurs un tam atbilstošā pārdotā biļete piedalās tikai loterijas izlozē, kurā tika iegādāta loterijas biļete.'),
(9635, 29, 7, 'RULES_6', 'Izlozes balvu fonds tiek veidots no Bitcoin maksājumu summas, kas samaksāta par visām loterijas biļetēm, kas piedalās noteiktā izlozē.'),
(9636, 29, 7, 'RULES_7', 'Loterijas izloze un balvu fonda sadale notiek ne ilgāk kā 24 stundas pēc izlozes pabeigšanas dienas.'),
(9637, 29, 7, 'RULES_8', 'Izlozes izlozes procesā tiek izveidots skaitlis, kurš piedalās loterijas izlozē par katru loterijas biļeti, kas tiek pārdota noteiktā loterijā. Arī zīmēšanas laikā tiek izveidots optimizēts loterijas zīmējuma md5 hash.'),
(9638, 29, 7, 'RULES_9', 'Loterijas uzvarētāji tiek noteikti, aprēķinot starpību starp numuru, kas piedalās loterijā par katru izsolītajā loterijā pārdoto loterijas biļeti, un optimizēto loterijas biļetes md5 hash, kurā loterijas biļete tika nopirkta.'),
(9639, 29, 7, 'RULES_10', 'Zīmēšanas rezultātā tiek noteikta pirmā uzvarētāju kategorija kā mazākais starpības modulis starp skaitli, kurš piedalās izlozētās loterijas laikā pārdotās atsevišķās loterijas biļetes izlozē, un optimizēto loterijas zīmējuma md5 hash, kurā loterijas biļete tika nopirkta.'),
(9640, 29, 7, 'RULES_11', 'Izlozes rezultātā tiek noteikta otrā uzvarētāju kategorija kā otrais lielākais modulis starpībai starp skaitli, kas piedalās izlozētās loterijas laikā pārdotās atsevišķās loterijas biļetes izlozē, un optimizēto loterijas izlozes md5 hash, kurā loterijas biļete tika nopirkta.'),
(9641, 29, 7, 'RULES_12', 'Izlozes rezultātā tiek noteikta trešā uzvarētāju kategorija kā trešais lielākais modulis starpībai starp numuru, kas piedalās izlozētās loterijas laikā pārdotās atsevišķās loterijas biļetes izlozē, un optimizēto loterijas izlozes, kurā loterijas biļete tika nopirkta, md5 hash.'),
(9642, 29, 7, 'RULES_13', 'Balvu fonds noteiktas loterijas izlozei ir sadalīts trīs uzvarētāju kategorijās šādā kārtībā:<br>- Pirmās kategorijas uzvarētāji - 50% no balvu fonda;<br>- Otrās kategorijas uzvarētāji - 30% no balvu fonda;<br>- Trešās kategorijas uzvarētāji ir 20% no balvu fonda.'),
(9643, 29, 7, 'RULES_14', 'Ja divi vai vairāki loterijas dalībnieki izlozē, starpība starp skaitu, kas piedalās izspēlētās loterijas individuālās loterijas biļetes izlozē, un optimizētās loterijas izlozes, kurā loterijas biļete tika nopirkta, md5 hash sakrīt, laime tiek sadalīta proporcionāli starp dalībnieki ar atbilstošiem moduļiem atbilstoši laimestu kategorijai.'),
(9644, 29, 7, 'RULES_15_1', 'Konkrētas loterijas zīmēšanas rezultāti tiek publicēti Lotobot.io loterijas vietnē lapā '),
(9645, 29, 7, 'RULES_15_2', ' un tiek parādīti pēc loterijas numura norādīšanas, kurā tika nopirkta loterijas biļete.'),
(9646, 29, 7, 'RULES_16_1', 'Laimesta izmaksa loterijas dalībniekam, kuram ir tiesības saņemt jebkuras kategorijas balvu, tiek veikta tikai pēc lapas nosūtīta pieprasījuma. '),
(9647, 29, 7, 'RULES_16_2', ' un tikai uz Bitcoin maku, kas norādīts pieprasījuma formā, to aizpildot. Maksājums tiek veikts ne vēlāk kā 24 stundu laikā pēc laimesta maksājuma pieprasījuma saņemšanas.'),
(9648, 29, 7, 'RULES_17', 'Komisija par laimesta izņemšanu bitcoin makam no loterijas biļetes īpašnieka, kurš ir tiesīgs saņemt laimestu, ir 10%.'),
(9649, 29, 7, 'PAGE_DESCRIPTION', 'Lotobot Bitcoin noteikumi, termini un definīcijas. Lasiet, lai uzzinātu, kā spēlēt un uzvarēt bitcoin loterijā.'),
(9650, 29, 7, 'PAGE_KEYWORDS', 'Lotobot noteikumi, Lotobot loterijas noteikumi, Lotobot noteikumi, kā spēlēt Lotobot'),
(9651, 29, 8, 'TITLE_HEADER', 'Skatiet informāciju par iegādātajām biļetēm'),
(9652, 29, 8, 'REQUEST_ERROR', 'Atvainojiet, mēs nevarējām iegūt informāciju par biļeti. Lūdzu, vēlāk mēģiniet vēlreiz.'),
(9653, 29, 8, 'DATA_ERROR', 'Ievadītie dati nav pareizi. Pārbaudiet ievadītos datus un mēģiniet vēlreiz.'),
(9654, 29, 0, 'TICKET_DATA', 'Informācija par jūsu biļeti'),
(9655, 29, 8, 'SUBTITLE', 'Lai skatītu informāciju par nopirkto loterijas biļeti, zemāk esošajā formā ievadiet čeka datus.'),
(9656, 29, 8, 'SHOW_ANOTHER_TICKET', 'Parādiet citu biļeti'),
(9657, 29, 8, 'PAGE_DESCRIPTION', 'Vai aizmirsāt informāciju par Lotobot biļeti? Šeit jūs varat redzēt visu informāciju par iegādāto loterijas biļeti.'),
(9658, 29, 8, 'PAGE_KEYWORDS', 'Lotobot biļete, Lotobot biļetes informācija, Lotobot biļetes informācija, Lotobot biļetes izdruka'),
(9659, 29, 9, 'TITLE_HEADER', 'Lotobot filiāļu programma. Nopelniet ar mums'),
(9660, 29, 9, 'ERROR_PARTNER_ACCOUNT', 'Diemžēl mēs nevarējām izveidot filiāli. Lūdzu, vēlāk mēģiniet vēlreiz.'),
(9661, 29, 9, 'MADE_PARTNER_ACCOUNT', 'Partneru konts ar šādu e-pastu jau ir reģistrēts.'),
(9662, 29, 9, 'TITLE', 'Nopelniet ar mums'),
(9663, 29, 9, 'SUBTITLE', 'Pievienojieties Lotobot loterijas filiāles programmai un nopelniet 50% no peļņas no katra piesaistītā loterijas dalībnieka'),
(9664, 29, 9, 'DESCRIPTION', 'Lotobot ir tiešsaistes loterija ar 100% balvu fondu, kas nozīmē, ka visi loteriju dalībnieku samaksātie līdzekļi tiks nosūtīti uz balvu fondu. Mēs nopelnām naudu, nodrošinot zīmēšanas procesu. Mūsu pakalpojuma komisija ir 10% par laimesta izņemšanu uz noteiktu loterijas izlozes uzvarētāja bitcoin maku. Tāpat kā veiksmīgākie interneta resursi, mums ir lojalitātes programma partneriem, kas palīdz attīstīt mūsu pakalpojumus. <span class=\"red_text\">Mēs maksājam atlīdzību par katru spēlētāju, kurš nopirka loterijas biļeti, neatkarīgi no tā, vai viņš uzvarēja, piesaistīja partneris, spēlētājs vai nē.</span> Pateicoties mūsu filiāles programmai, ikviens var saņemt ienākumus no Lotobot tiešsaistes loterijas.'),
(9665, 29, 9, 'RULES_TITLE', 'Mūsu noteikumi ir ļoti vienkārši.'),
(9666, 29, 9, 'RULE_1', 'Mēs maksājam 50% no ienākumiem, kas saņemti no spēlētāja, kas ir 5% no viņa nopirkto biļešu izmaksām. Izlozes biļetes cena ir 50 000 Satoshi, mūsu komisija ir 10% vai 5000 Satoshi, un pusi no šīs summas mēs maksājam partnerim, kurš piesaistīja spēlētāju. Tas ir, jūsu ienākumi no katra loterijas dalībnieka, kurš tiek piesaistīts un samaksāts par jūsu biļeti, būs 2500 Satoshi.'),
(9667, 29, 9, 'RULE_2', 'Maksājuma summai nav ierobežojumu, tāpēc jūs varat izņemt ienākumus pat no viena iesaistītā loterijas dalībnieka.'),
(9668, 29, 9, 'RULE_3', 'Ienākumu uzkrāšana notiek tūlīt pēc izlozes beigām, kurā biļeti iegādājās iesaistītais spēlētājs.'),
(9669, 29, 9, 'RULE_4', 'Saņemto ienākumu apmaksa tiek veikta ar Bitcoin maku, kas norādīts, pieprasot līdzekļu izņemšanu.'),
(9670, 29, 9, 'RULE_5', 'Maksimālais maksājuma periods ir 24 stundas pēc ienākuma atsaukšanas pieprasījuma saņemšanas.'),
(9671, 29, 9, 'CHECK_TITLE', 'Ir viegli mūs pārbaudīt'),
(9672, 29, 9, 'CHECK_DESCRIPTION', 'Lai būtu drošs, ka katrs spēlētājs, kurš noklikšķina uz novirzīšanas saites, tiks iekļauts jūsu piesaistīto sarakstā, vienkārši iegādājieties kādu no loterijas biļetēm caur savu nodošanas saiti un piesaistīto sarakstā uzreiz redzēsit loterijas biļeti.'),
(9673, 29, 9, 'BECOME_PARTNER_TITLE', 'Kļūt par mūsu partneri ir viegli'),
(9674, 29, 9, 'BECOME_PARTNER_DESCRIPTION', 'Lai kļūtu par mūsu saistītās programmas dalībnieku, viss, kas jums nepieciešams, ir iegūt novirzīšanas saiti. Norādiet savu e-pastu, lai ievadītu pakalpojumu, ierakstot to attiecīgajā veidlapas laukā zemāk un noklikšķiniet, lai kļūtu par filiāli. Pēc tam jūs saņemsit unikālu paroli un novirzīšanas saiti. Atliek tikai dalīties ar saņemto saiti forumos, tērzēšanas istabās, sociālajos tīklos un saņemt ienākumus no katra piesaistītā loterijas dalībnieka. Savus novirzīšanas ienākumus varēsiet izņemt tūlīt pēc izlozes, kurā jūsu piesaistītais novirzīšanas biļete tika nokārtota.'),
(9675, 29, 9, 'PAGE_DESCRIPTION', 'Nodošanas programma Bitcoin loterija Lotobot ir ērts veids, kā gūt peļņu tīmekļa pārziņiem un emuāru autoriem. Kā kļūt par partneri un nopelnīt naudu no piesaistītajiem spēlētājiem.'),
(9676, 29, 9, 'PAGE_KEYWORDS', 'lotobot nodošanas programma, nopelnīt ar lotobot, nodošanas programma, kā nopelnīt loteriju, nopelnīt no loterijas biļešu pārdošanas, lotobot partneris'),
(9677, 29, 10, 'TITLE_HEADER_PLAY_WEEK', 'Katru nedēļu iegādājieties izlozes biļeti');
