(9979, 30, 9, 'RULE_1', 'Maksame 50% mängijalt saadud sissetulekust, mis on 5% tema ostetud piletite maksumusest. Loteriipileti maksumus on 50 000 Satoshi, meie vahendustasu on 10% või 5000 Satoshi ja maksame poole sellest summast mängijale meelitanud partnerile. See tähendab, et teie sissetulek igalt loteriil osalejalt, kes on meelitatud ja pileti eest makstud, on 2500 Satoshi.'),
(9980, 30, 9, 'RULE_2', 'Meil ei ole makse summa osas piiranguid, nii et saate saadud tulu välja võtta isegi ühelt seotud loterii osaliselt.'),
